var book = {
	"name": "Psalmen",
	"numChapters": 150,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> I. Martua * ma halak, na so olo ** mangihuthon tahi ni angka parjahat, jala na so olo jongjong tu dalan ni angka pardosa, jala na so olo + sahundulan dohot angka pangarehei.",
			"2": "<sup>2</sup> Sai * patik ni Jahowa do lomo ni rohana, jala sai i do + dipingkiri rohana arian dohot borngin.",
			"3": "<sup>3</sup> Songon * hau do ibana, na sinuan di topi ni batang aek, na marparbuehon parbuena di hajujumpang ni tingkina + bulungna pe ndang olo malos, jala sude na niulana manjadi do. II.",
			"4": "<sup>4</sup> Alai ndang songon i anggo pangalaho ni angka parjahat, songon orbuk, na hinabangkon ni alogo do nasida.",
			"5": "<sup>5</sup> Dibahen i ndang manahan angka parjahat i maradophon paruhuman, manang tarbahen angka pardosa jongjong di luhutan ni angka na tigor roha.",
			"6": "<sup>6</sup> Ai * ditanda Jahowa do dalan ni angka na tigor roha i; alai matua laho lonong do anggo dalan ni angka parjahat."
		},
		"2": {
			"1": "<sup>1</sup> I. Boasa sai ogaoga angka parbegu, jala sai na so marniula dipingkiri roha ni angka bangso?",
			"2": "<sup>2</sup> Hehe martahi do angka * raja ni tano on rap dohot angka na begu, mangalo Jahowa dohot + Messiasna i.",
			"3": "<sup>3</sup> “Tarapui ma angka ihotnasida, jala taambolongkon ma angka talina i,” ninna.",
			"4": "<sup>4</sup> Alai * diengkelengkel Ibana na + marhabangsa di banua ginjang i do nasida, jala dielesi Tuhanta i do nasida.",
			"5": "<sup>5</sup> Songgahanna do nasida sogot di rimasna, jadi martimpalan ma nasida mida parpiarpiar ni murukna.",
			"6": "<sup>6</sup> Hape anggo Ahu, hupabangkit do Rajangku di * dolok Sion, dolok habadiaonku. II.",
			"7": "<sup>7</sup> Jamitahononku ma na gabe patik, didok Jahowa do mandok ahu: Anakku do Ho, sadarion do Ho hutubuhon.",
			"8": "<sup>8</sup> * Pangido ma sian Ahu, asa hulehon tu Ho angka + parbegu bahen jambarmu, jala gok di Ho angka ujung ni tano on.",
			"9": "<sup>9</sup> Ropuhanmu ma nasida dohot * batahi bosi jala songon + hudon do nasida taporanmu. III.",
			"10": "<sup>10</sup> On pe, hamu ale angka raja, sai olo ma hamu parrohaon, jala hamu ale angka panguhum ni tano on, sai olo ma hamu paingoton.",
			"11": "<sup>11</sup> Oloi hamu ma Jahowa dohot biar ni roha, jala marolopolop ma hamu, huhut angka hitir.",
			"12": "<sup>12</sup> * Umma hamu ma Anak i, asa unang ro rimasna, jadi ** mago hamu maon ditongan dalan, ai tibu do marpiarpiar + rimasna, alai ++ martua ma sude angka na marhaposan tu Ibana."
		},
		"3": {
			"1": "<sup>1</sup> Ende ni raja Daud uju na maporus ibana maradophon anakna si Absalom.",
			"2": "<sup>2</sup> Iale Jahowa, lan situtu do angka na manosak ahu, angka na hehe tumahi ahu.",
			"3": "<sup>3</sup> Angka na mandok taringot tu hosangku: “Ndang adong be hangoluan ni i sian Debata.” Sela.",
			"4": "<sup>4</sup> Alai Ho do, ale Jahowa, lombulombungku, hasahalonku, dohot na + padirgak ulungku.",
			"5": "<sup>5</sup> Joujou do soarangku tu Jahowa, jadi dialusi Ibana ahu jalojalo sian dolok habadiaonna. Sela.",
			"6": "<sup>6</sup> Hupapeak do ahu, jadi laos nok matangku, dungo ahu muse, ai Jahowa do manande ahu.",
			"7": "<sup>7</sup> Ndang huhabiari nang riburibu loksa halak, angka na manungkum ahu humaliang.",
			"8": "<sup>8</sup> Hehe ma Ho, ale Jahowa, palua ahu, ale Debatangku, ai dipastapi Ho do sude angka musungku, ipon ni angka na geduk marroha diropangi Ho do.",
			"9": "<sup>9</sup> Matua gok di Jahowa do * haluaon, di atas ni bangsom do tongtong + pasupasum. Sela."
		},
		"4": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Sai alusi ma ahu, ale Debata ni * hatigoranku, ia hujou Ho, jala palumbang ahu jumpa hagogotan, asi ma roham di ahu, jala tangihon ma tangiangki.",
			"3": "<sup>3</sup> Ia hamu, * pinompar ni jolma, sadia leleng on do lea rohamu di hasahalaonki, sadia leleng on do haholongan ni rohamuna + na so hasea, jala dioronmuna gabus. Sela.",
			"4": "<sup>4</sup> Unang so boto hamu: * Marhasurungan do dibahen Jahowa angka hasianna, matua ditangihon Jahowa do, molo hujou Ibana.",
			"5": "<sup>5</sup> Holsohon hamu hian ma, asa * unang dapotan dosa, ** marhusari ma rohamuna, dung ro + di podoman hamu, asa sonang hamu. Sela.",
			"6": "<sup>6</sup> Pelehon hamu ma * pelean hatigoran, jala + marhaposan tu Jahowa ma hamu. II.",
			"7": "<sup>7</sup> * Lan do angka ma mandok: Tung ise ma manumpakkon na denggan tu hita? Alai ale Jahowa, sai + pasondangkon ma tu hami sondang ni bohim!",
			"8": "<sup>8</sup> Gumodang do las ni rohangku dilehon Ho, sian di nasida di hamamasa ni gotilon * eme dohot anggur na gabe situtu.",
			"9": "<sup>9</sup> Sonang do ahu * hupapeak huhut mamintor nok; ai sasada Ho do, ale Jahowa, pasonang ahu maringanan."
		},
		"5": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Sai * tangihon ma, ale Jahowa, angka hatangki, sai timbang ma ho i ni rohangku.",
			"3": "<sup>3</sup> Sai patinggil ma pinggolmu * ale Rajangku dohot Debatangku, tumangi soara ni anggukkon, ai tu Ho do ahu martangiang.",
			"4": "<sup>4</sup> Sogot ma, ale Jahowa, tangihon soarangku, sogot do ahu marhobas manopot Ho, jala manatapnatap ahu.",
			"5": "<sup>5</sup> Ai ndang lomo roham mida hageduhon, ale Debata, jala ndang tarsorang na geduk marroha i Ho.",
			"6": "<sup>6</sup> Ndang manahan * angka na ginjang marroha maradophon pamerengmu, dihosom roham do nasa siulahon na so uhum.",
			"7": "<sup>7</sup> Matua * diago Ho do, ale Jahowa, angka sidon gabus, jala dihagigihon roham do halak angka na + tumahi mudar dohot sipaotooto.",
			"8": "<sup>8</sup> Alai ianggo ahu, sian godang ni asi ni roham sai bongotanku do bagasmu, marsomba dompak bagas ni habadiaonmi, mangkabiari Ho.",
			"9": "<sup>9</sup> Ale Jahowa, sai * togu ma ahu marhitehite hatigoranmu + ala ni angka na mangonggop ahu, sai pahornop ma dalanmu di jolongku.",
			"10": "<sup>10</sup> Ai ndang pos roha di hatanasida i, sai hamagoan do tahi ni rohanasida di bagasan, * godung na talak do tolonnasida i, + dipalanditlandit do ia dilana.",
			"11": "<sup>11</sup> Torui ma nasida, ale Debata, sai ambalhon ma tahi ni rohanasida i, ambolongkon ma nasida ala hinadeak ni pangalaosionnasida i, ai dompak Ho do nasida manenganenga.",
			"12": "<sup>12</sup> Sai marlas ni roha ma sude angka na marhaposan tu Ho, sai marendei ma nasida ro di salelenglelengna ala ni ondinganmu nasida, sai marolopolop ma mida Ho angka na holong roha di goarmu.",
			"13": "<sup>13</sup> Ai Ho do, ale Jahowa, mamasumasu na tigor marroha i, songon lombulombu do * dihaliangkon Ho asi ni rohami tu ibana."
		},
		"6": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Ale Jahowa unang uhumi ahu di bagasan rimasmu, jala unang ajari ahu di bagasan parpiar ni murukmu.",
			"3": "<sup>3</sup> Asi ma roham di ahu, ale Jahowa, ai mauas do huhilala; pamalum ahu, ale Jahowa, ai angka hitir do sude holiholingku.",
			"4": "<sup>4</sup> Rohangku di bagasan pe mansai mallobuk do, sadia leleng on Ho, ale Jahowa?",
			"5": "<sup>5</sup> Sai marpangulahi ma roham, ale Jahowa! Malua ma hosangku! Urupi ahu ala ni denggan ni basam.",
			"6": "<sup>6</sup> Ai anggo di hamatean ndang adong be parningotan tu Ho; jala tung ise mamuji Ho, dung ro di banua toru?",
			"7": "<sup>7</sup> Maheu do huhilala dibahen ponjot ni rohangku, ganup borngin do huhembangi lagengku, mansai maraek do nang bulusanku dibahen iluilungku.",
			"8": "<sup>8</sup> Pola do lotop matangku sian marsak ni rohangku, pola naung gabe matua, dibahen sude angka na manosak ahu. II.",
			"9": "<sup>9</sup> Pasurut ma sian ahu, sude hamu angka na mangulahon na so uhum, ai nunga ditangihon Jahowa soara ni angukkon.",
			"10": "<sup>10</sup> Nunga ditangihon Jahowa hoingkon, dijangkon do ia tangiangkon.",
			"11": "<sup>11</sup> Tarurak jala tarsonggot situtu do sogot sude angka musungku; hapogan do nasida laho sumurut, jala tarurak so pangkiriman."
		},
		"7": {
			"1": "<sup>1</sup> Ende sian si Daud, na niendehonna tu Jahowa, ala ni hatahata ni si Kus, marga Benjamin i. I.",
			"2": "<sup>2</sup> Ale Jahowa, Debatangku, * marhaposan tu Ho do ahu, tumpahi ma ahu maradophon sude angka na mangalele ahu, jala palua ahu!",
			"3": "<sup>3</sup> Asa unang disoro hosangku, songon panoro ni * singa, jala diparsurage, soada na paluahon.",
			"4": "<sup>4</sup> Ale Jahowa, Debatangku, molo tung hubahen angka indi on: Molo tung hajahatan diulahon tanganku.",
			"5": "<sup>5</sup> Molo tung hubahen na roa tu angka alealengku jala hupupusi na manosak ahu, soada alana:",
			"6": "<sup>6</sup> Sai * dilutlut musu i ma hosangku, jala dapotsa, diluntakluntak ma dohot ngolungku tu tano, jala margulu di orbuk hamuliaonku dibahen. Sela.",
			"7": "<sup>7</sup> * Hehe ma Ho, ale Jahowa, di bagasan rimasmu! Borhat ma Ho mangalo roharoha ni angka na manosak ahu, jala dungo ma Ho mandapothon ahu, ai Ho do umpatik uhum.",
			"8": "<sup>8</sup> Sai dihaliangi luhutan ni angka bangso ma Ho sogot jala sian * atasnasida ma Ho mulak tu ginjang.",
			"9": "<sup>9</sup> Jahowa do manguhum angka bangso; sai luluhon ahu, ale Jahowa, * hombar tu hatigoranku dohot halidangon ni rohangku di bagasan.",
			"10": "<sup>10</sup> Aut mansohot ma nian * hajahaton ni angka parjahat! Sai pargogoi ma na tigor roha i! Ai + Ho do sidodo roha dohot pia, bonar do Debata. II.",
			"11": "<sup>11</sup> Mangasahon Debata do lombulombungku, Ibana do manumpahi angka na tigor roha i.",
			"12": "<sup>12</sup> * Panguhum na tigor do Debata, jala mangalumbai do Ibana ganup ari.",
			"13": "<sup>13</sup> Molo so muba rohaniba, * garutonna ma podangna, + sintahonna ma dohot siorna manuju.",
			"14": "<sup>14</sup> Angka pangalo hamatean do ditujuhon dompak iba, mantat api do angka * sumbiana i dibahen.",
			"15": "<sup>15</sup> Ida ma! Dirianrianhon rohana do hajahaton; gabe dapotan hamagoan ibana, jala ditubuhon sipaotooto.",
			"16": "<sup>16</sup> Dihali do sada godung jala bagas dibahen, hape laos ibana sandiri madabu tu godung, na binahenna i.",
			"17": "<sup>17</sup> Mulak tu uluna do hamagoanna i, jala songgop tu pakpak ni uluna do hajahatonna i.",
			"18": "<sup>18</sup> Pujionku do Jahowa hombar tu hatigoranna i, jala endehononku do Jahowa Natumimbul i."
		},
		"8": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Ale Jahowa, Sigomgom hami. Mansai sangap do goarmu di liat portibi on, dipatimbul Ho do hamuliaonmu ro di atas ni angka langit.",
			"3": "<sup>3</sup> Gari * sian pamangan ni angka dakdanak dohot angka posoposo dijadihon Ho do paranganmu, ala ni angka na mangalo Ho, asa paonjaphon musu dohot sitahi sudolsudol.",
			"4": "<sup>4</sup> Molo * hutailihon ** langitmi, angka jadijadian ni + jarijarim, bulan dohot bintang, angka na pinaulim.",
			"5": "<sup>5</sup> * Tung aha ma nian jolma i, umbahen pola ditaringoti roham ibana? Jala anak ni jolma i, umbahen pola diebati Ho?",
			"6": "<sup>6</sup> Humurang apala otik do ibana sian Debata dibahen Ho, alai ditalitalihon Ho muse hamuliaon dohot hatongamon tu ibana.",
			"7": "<sup>7</sup> Dipabangkit Ho do ibana gumomgom angka jadijadian ni tanganmu, sude do tahe dipatunduk Ho tu ibana:",
			"8": "<sup>8</sup> Angka birubiru dohot lombu sudena ro di binatang angka na di harangan.",
			"9": "<sup>9</sup> Pidong angka na di toru ni langit dohot angka dengke di laut, ro di sude na manginsir di laut.",
			"10": "<sup>10</sup> Ale Jahowa, Sigomgom hami, mansai sangap do goarmu di liat portibi on."
		},
		"9": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Pujionku ma Jahowa sian nasa rohangku, pajojoronku ma sude halongangan angka na binahenmu.",
			"3": "<sup>3</sup> Marlas ni roha jala marolopolop ma ahu mida Ho, endehononku ma goarmu, ale Natumimbul!",
			"4": "<sup>4</sup> Ala naung mundar tu pudi angka masungku; martinggangan do nasida jala marragean maradophon bohim.",
			"5": "<sup>5</sup> Ai dipasintong Ho do uhum dohot parjambaran di ahu, hundul tu habangsa do Ho, ale * Panguhum na tigor.",
			"6": "<sup>6</sup> * Mangonai hata do Ho tu angka parbegu, + diago Ho do parjahat i, siap do goarnasida dibahen Ho ro di salelenglelengna.",
			"7": "<sup>7</sup> Sun do hasisiap ni musu i salelenglelengna, jala tarulang do * angka huta dibahen Ho, + pesan do nasida rap dohot baritana i.",
			"8": "<sup>8</sup> Alai anggo Jahowa marhabangsa do salelenglelengna, nunga dipajongjong habangsana laho manguhum.",
			"9": "<sup>9</sup> Jala Ibana manguhum sogot portibi on marhitehite hatigoran, pagostangonna ma uhum tu angka bangso.",
			"10": "<sup>10</sup> Sai olo ma Ho, ale Jahowa, haporusan di angka tingki hagogotan!",
			"11": "<sup>11</sup> Asa marhaposan tu Ho angka na * tumanda goarmu, ai ndang ditadingkon Ho angka na usouso di Ho, ale Jahowa.",
			"12": "<sup>12</sup> Endehon hamu ma Jahowa, na marhabangsa di Sion, baritahon hamu ma angka pambahenanna tu angka bangso.",
			"13": "<sup>13</sup> Ai parlulu do Ibana di * sapata ni mudar, angka dipaingotingot do, ndang dihalupahon + angguhangguk ni angka na dangol. II.",
			"14": "<sup>14</sup> Asi ma roham di ahu, ale Jahowa, tatap ma dangolhon binahen ni angka na mangkosom ahu, Ho do sihindati ahu sian * angka harbangan hamatean.",
			"15": "<sup>15</sup> Asa * hubaritahon sude angka baritam di angka bahal ni ** boru Sion, asa + marolopolop ahu mida hatuaonmi.",
			"16": "<sup>16</sup> Nunga lonong angka parbegu tubagasan godung na binahennasida i, taralit do patnasida i tu jorgong, na buni tinaonnasida i.",
			"17": "<sup>17</sup> Sar do barita ni Jahowa, paboa sidabu uhum Ibana, laos di pambahenan ni tanganna sandiri do taralit parjahat i. Pingkiri ma i! Sela.",
			"18": "<sup>18</sup> Ingkon runsur tu banuatoru ma nian angka parjahat i, sude * parbegu, angka na mangkalupahon Debata.",
			"19": "<sup>19</sup> Ai ndang tagamon tongtong halupahononna na pogos i, ndang tagamon tongtong mago na hinirimhirim ni angka na dangol.",
			"20": "<sup>20</sup> Hehe ma Ho, ale Jahowa, asa unang mangasahon gogo jolma i, sai uhumi ma sogot di jolom angka parbegu!",
			"21": "<sup>21</sup> Sai ampehon ma sipasonggot tu nasida, ale Jahowa, asa ditanda angka parbegu, jolma na gale do nasida hape. Sela."
		},
		"10": {
			"1": "<sup>1</sup> I. Boasa tung sai mandaodao Ho jongjong, ale Jahowa, sai martabuni Ho di angka tingki hagogotan?",
			"2": "<sup>2</sup> Mosok ma dihilala na dangol dibahen hajungkaton ni parjahat, tardapot do nasida dibahen tahi, angka na sinangkapnasida i.",
			"3": "<sup>3</sup> Ai ditengatengahon parjahat i do sangkap ni rohana, jala dipartuanihon pangalansum, dilesanlesan do ia Jahowa.",
			"4": "<sup>4</sup> Ninna roha ni parjahat i do di bausbaus ni igungna: * “Ndang tagamon marlulu Ibana! Ndang adong Debata!” I do pangarimpunan ni angka sangkapna sudena.",
			"5": "<sup>5</sup> Sai na manjadi do angka langkana tongtong; * dao do tu ginjang angka uhummu sian jolona, + dibuasi rohana do angka alona i sudena.",
			"6": "<sup>6</sup> * Ninna do di bagasan rohana: “Pantangna do tung sumurut ahu, ndang + tagamon adong parmaraanku ro di na hupompar.”",
			"7": "<sup>7</sup> * Gok pamulasion dohot sipaotooto dohot hadoboon pamangannai; halojaon dohot hajahaton do + ditoru ni dilana.",
			"8": "<sup>8</sup> Sai marparonggopan do ibana di angka huta, sai dibunui do na so marpipot di sihabunian, sai dimatamatahon do na mandate.",
			"9": "<sup>9</sup> Sai mangonggop do ibana di pangaropan, songon babiat di ramba; mangonggop do ibana laho manoro na dangol, disoro ma na dangol i, pinadapotna di bagasan jorgongna.",
			"10": "<sup>10</sup> Dipabungkuk do ibana manisipi, jadi dapot sisilonna ma angka na mandate i.",
			"11": "<sup>11</sup> * Ninna do di bagasan rohana: + “Nunga dihalupahon Debata, nunga ditabunihon bohina i, ndang be idaonna salelenglelengna.” II.",
			"12": "<sup>12</sup> Hehe ma Ho, ale Jahowa! Patoltol ma tanganmu, ale Debata! Sai unang * halupahon angka na dangol i!",
			"13": "<sup>13</sup> Boasa ma tung lesanlesanon ni parjahat i Debata, tung dohononna di bagasan rohana: Ndang marlulu Ho!",
			"14": "<sup>14</sup> * Diida Ho do tahe, ai ditatap Ho do halojaon dohot haporsuhon mambahen tubagasan tanganmu, tu Ho do dipasahat na mandate i, Ho do partumpak tu na sopot so marama.",
			"15": "<sup>15</sup> Sai * ponggolhon ma botohon ni parjahat i, + jala luluhon hajahaton ni parjahat i, asa ndang jumpang be.",
			"16": "<sup>16</sup> * Jahowa do raja salelenglelengna; siap do angka parbegu sian + tanona.",
			"17": "<sup>17</sup> Nunga ditangihon Ho, ale Jahowa, pinangido ni angka na dangol i, * dipatogu Ho do rohanasida, dipatinggil Ho do pinggolmu;",
			"18": "<sup>18</sup> Laho * patingkoskon uhum tu nasopot so marama dohot tu na tarsosak, asa unang be didatdati ** jolma na + sian tano i manenganenga."
		},
		"11": {
			"1": "<sup>1</sup> I. Ende sian si Daud. * Marhaposan tu Jahowa do ahu, boasa ma tung dohononmuna mandok tondingku: “Maporus hian ma tu + dolokmuna, ale pidong, na meat di handang.”",
			"2": "<sup>2</sup> Ai ida ma, nunga pola disintak angka parjahat sior i, nunga pola diampehon nasida sumbiana tu ihotihot i, laho maniorhon di na holom tu angka na tigor marroha.",
			"3": "<sup>3</sup> Ai ia dung sanga marompas angka tiang ojahan, hahuaon ni partigor i be? II.",
			"4": "<sup>4</sup> * Di bagasan bagasna na badia i pe Jahowa, jala ** banua ginjang habangsana, sai mangaranapi do matana, sai didodoi + imbulu ni matana do jolma manisia.",
			"5": "<sup>5</sup> Ditanda Jahowa do na tigor roha i, alai dihosom rohana do parjahat i dohot na mangkaholongi hajahaton.",
			"6": "<sup>6</sup> Udanudanhononna do tu angka parjahat i porhas, api, barerang dohot alogo, na mohop do jambar siinumonnasida.",
			"7": "<sup>7</sup> Ai na tigor do Jahowa, jala * dihaholongi do angka hatigoran, + idaon ni na tigor roha i ma sogot bohina."
		},
		"12": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Sai manumpak ma Ho, ale Jahowa, ai nunga lam moru angka na daulat marroha i, lam otik do manisia, angka na burju marroha.",
			"3": "<sup>3</sup> Na so hasea i do dihata i be dohot donganna, marbibir na landit, jala * mardua roha nasida mangkatai.",
			"4": "<sup>4</sup> Sai diginsir Jahowa ma sude bibir angka na landit i, dohot angka dila, na jungkat marpangkuling.",
			"5": "<sup>5</sup> Angka na mandok: Sai monang do hami dibahen dilanami, bibirnami do mandongani hami, tung ise ma rajanami? II.",
			"6": "<sup>6</sup> Mida hamamago ni angka na dangol dohot mida andung ni angka na pogos, * hehe ma Ahu nuaeng, ninna Jahowa, ampehononku ma tua tu angka na mangkalungunhonsa.",
			"7": "<sup>7</sup> * Na sintong do angka hata ni Jahowa, songon perak naung nilala di bagasan balanga, pola + pitu hali tinapis.",
			"8": "<sup>8</sup> Ho do, ale Jahowa, mangondingi nasida, paluaonmu do ibana sian halak na * sansundut on, ro di salelenglelengna.",
			"9": "<sup>9</sup> Nang pe monsong humaliang angka parjahat i dibahen panimbuk ni hajungkaton ni jolma manisia."
		},
		"13": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Sadia leleng on do, ale Jahowa, sai halupahononmu ahu tongtong? Sadia leleng on do tabunihononmu bohim sian ahu?",
			"3": "<sup>3</sup> Sadia leleng on sai mardondami rohangku, sai humasusa rohangku di bagasan manipat ari? Sadia leleng on sai angatan ni alongku ahu?",
			"4": "<sup>4</sup> Tatap tu on, jala alusi ahu, ale Jahowa, Debatangku; sai * patiur ma parnidaanku, asa unang laos + mate modom boti ahu.",
			"5": "<sup>5</sup> Asa unang dohonon ni musungku: Nunga tung hupatunduk ibana, gabe marsurak angka alongku maon, molo tung reberebe ahu.",
			"6": "<sup>6</sup> Alai anggo ahu, marhaposan tu asi ni roham do ahu, ingkon * marolopolop rohangku mida pangurupim, marende ma ahu tu Jahowa, ai denggan do uhumna tu ahu."
		},
		"14": {
			"1": "<sup>1</sup> I. Ende sian si Daud. Ninna * na oto i do di bagasan rohana: Ndang adong Debata; jahat jala sogir do nasida marpangalaho, ndang adong sibahen na denggan.",
			"2": "<sup>2</sup> * Manatapnatap do Jahowa sian banua ginjang, paidaida jolma manisia, marnida manang na adong na marroha, na + usouso di Debata.",
			"3": "<sup>3</sup> Hape tung saluhut do nasida sumurut, tung sange do nasida marroha mago, ndang adong sibahen na denggan, nanggo sahalak. II.",
			"4": "<sup>4</sup> Tung na so mananda do ulaning sude angka sibahen hajahaton? Angka na manganhon bangsongku songon na mangan roti, ia Jahowa ndang dijou nasida.",
			"5": "<sup>5</sup> Alai tarsonggot situtu do nasida disi sogot, ai matua didongani Debata do * pinompar ni na tigor roha i.",
			"6": "<sup>6</sup> Ditungkol hamu pe tahi ni na dangol, hape sai Jahowa do parsigantunganna.",
			"7": "<sup>7</sup> Ise ma ulaning sian Sion mangalehon haluaon di Israel? Molo disuhe Jahowa habuangan ni bangsona, marolopolop ma ho, ale Jakkob, marlas ni roha ma ia Israel."
		},
		"15": {
			"1": "<sup>1</sup> Ende sian si Daud. Ale Jahowa, ise do na jadi * sorang di bagasan undungundungmu? Ise do na jadi mian di dolok ni habadiaonmi?",
			"2": "<sup>2</sup> Halak na * sun burju marpangalaho dohot siulahon hatigoran, jala + sidon na sintong sian bagasan rohana.",
			"3": "<sup>3</sup> Halak na so olo * mangkata tundal, na so olo mambahen hajahaton tu donganna, jala na so olo mambahen haurahon tu sisolhotna.",
			"4": "<sup>4</sup> Halak na * mansoadahon na lea, jala dipasangap do angka na mangkabiari Jahowa; halak na so olo manguba naung sinumpahonna, nang tung + marharugian ibana.",
			"5": "<sup>5</sup> Halak na * so olo paanakkon hepengna, jala na so olo + manjalo sisip mangalo na lidang roha i. Halak na mangulahon sisongon i, ndang tagamon humordit salelenglelengna."
		},
		"16": {
			"1": "<sup>1</sup> Ende sieheteheton sian si Daud. I. Sai ramoti ma ahu, ale Debata, ai marhaposan tu Ho do ahu.",
			"2": "<sup>2</sup> * Ningku do mandok Jahowa: ** Ho do Tuhanku, ndang adong hasonanganku + dungkon ni Ho.",
			"3": "<sup>3</sup> Taringot tu nabadia angka na di tano on: Nasida do angka na sangap jala apala * hasudungan ni rohangku situtu.",
			"4": "<sup>4</sup> * Godang do sitaonon ni angka na hapogan ** paimbarhon Debata, ndang olo ahu mangusehon peleannasida sian mudar, jala + subang do rohangku mandok angka goarnasida.",
			"5": "<sup>5</sup> Jahowa do partalianku dohot panginumanki, Ho do pasintong jambarhu.",
			"6": "<sup>6</sup> Jadi tano na lunak do partalianku, tongon tahe, na uli situtu do jambarhu.",
			"7": "<sup>7</sup> Papujipujionku ma Jahowa, * na marrohaihon ahu, dohot do puangku palumba ahu + bornginna i. II.",
			"8": "<sup>8</sup> Tongtong do hubahen Jahowa tu jolongku, ai molo * di siamunhu Ibana, ndang tagamon humordit ahu.",
			"9": "<sup>9</sup> Ala ni las ma rohangku jala marolopolop * tondingku, ** dagingku pe + sinok do maringanan dibahen.",
			"10": "<sup>10</sup> Ai ndang tagamon * pasombuonmu tondingku di banua toru, ndang tagamon loasonmu hasianmu + marnida habusukon.",
			"11": "<sup>11</sup> Sai pabotohononmu do tu ahu * dalan hangoluan, sun ma las ni roha + di adopan ni bohim, angka hasudungan ni roha masa di siamunmu salelenglelengna."
		},
		"17": {
			"1": "<sup>1</sup> Tangiang sian si Daud. Sai tangi ma hasintongan, ale Jahowa, tangihon ma * alualungkon! Sai tarehon ma pinggolmu tu tangiangkon sian bibir na so marpangansi!",
			"2": "<sup>2</sup> Sai dapotan uhum ma ahu sian bohim, sai ditatap matam ma hasintongan.",
			"3": "<sup>3</sup> Nunga * didodo Ho rohangki, ditingkir Ho bornginna i, dilala Ho do ahu, hape ndang adong jumpang Ho, hupompangi do angka pingkiranku, asa unang mangalaosi pamanganku.",
			"4": "<sup>4</sup> Sai marjaga do ahu di langkalangka ni jolma sipangarupa, di angka pambahenan ni jolma dompak hata ni pamanganmu.",
			"5": "<sup>5</sup> Sai diihutihut langkalangkangku do angka bogasmu, ndang maoraor pangalangkangku.",
			"6": "<sup>6</sup> Sai Ho do hupajoujou, ai dialusi Ho do ahu, ale Debata! Sai tarehon ma pinggolmu tu ahu, tangihon ma hatangkon!",
			"7": "<sup>7</sup> Sai * marhasurungan ma bahen angka asi ni roham, Ho ale Sipartumpak, tu angka na marhaporusan tu Ho maradophon angka na + mangalo tanganmu siamun i.",
			"8": "<sup>8</sup> Sai ramoti ma ahu, songon anak ni mata, sai ondingi ma ahu di linggoman ni angka habongmi.",
			"9": "<sup>9</sup> Moradophon parjahat, angka na naeng mangago ahu, maradophon musungku, * angka na monsong mangarohai ahu.",
			"10": "<sup>10</sup> Sai di hunsi nasida do tabotabona, sai hajungkaton do dihatahatahon pamanganna.",
			"11": "<sup>11</sup> Sai diiraniran nasida do nuaeng langkanami, sai dimatamatahon do mangompashon hami tu tano.",
			"12": "<sup>12</sup> Tudoshon babiat, na naeng manoro do ibana, jala sobokkon anak ni babiat na mangonggop di aropan.",
			"13": "<sup>13</sup> Hehe ma Ho, ale Jahowa, joloani ma, ompashon ibana! Sai palua ma hosangku sian parjahat i hinorhon ni podangmu.",
			"14": "<sup>14</sup> Palua ahu, ale Jahowa, marhitehite tanganmu sian angka jolma * parroha portibi on, angka na manjalo jambarna di hangoluan on, ** gok butuhanasida dibahen Ho dohot artam, + gabean do nasida di anak, jala tading di pinomparnasida do lobilobinasida i.",
			"15": "<sup>15</sup> Alai anggo ahu sai * idaonku do sogot bohim, marhitehite hatigoran, pamahaponku ma rohangku marnida rupam, ia dung + tarsunggul ahu muse."
		},
		"18": {
			"1": "<sup>1</sup> Ende sian si Daud, naposo ni Jahowa, na mandok hata ni ende on tu Jahowa, dung malua ibana dibahen sian tangan ni angka musuna sudena dohot sian tangan ni si Saul, ninna ma:",
			"2": "<sup>2</sup> Holong situtu do rohangku di Ho, ale Jahowa, Sipargogoi ahu.",
			"3": "<sup>3</sup> Jahowa do * partanobatoanku dohot haporusanku, jala Sipalua ahu, Debatangku. Sitiopanku, marhaposan tu Ibana do ahu, ** lombulombungku dohot + tanduk ni partuaonku, haporusanku.",
			"4": "<sup>4</sup> Sai * hupajoujou do Jahowa, Sipujion i, jadi malua ma ahu sian angka musungku.",
			"5": "<sup>5</sup> Nunga nian dihaliangi angka * jorat ni hamateani ahu, jala disonggoti angka + sunge ni hajahaton ahu.",
			"6": "<sup>6</sup> Nunga nian dihaliangi rante ni banuatorui ahu, dilungkupi angka * jorgong ni hamateani ahu.",
			"7": "<sup>7</sup> Jadi di na targogot i ahu, hujou do Jahowa jala hupangiar do anggukku tu Debatangku; jadi dibege ma soarangki sian * jorona, jala tolhas do angguk i tu pinggolna.",
			"8": "<sup>8</sup> Jadi humuntalhuntal ma tano on jala lumpat angka ojahan ni dolok jala lalolalo, ai tarrimas do Ibana.",
			"9": "<sup>9</sup> Martimpul do timus sian igungna, jala rungkar do api na mandilatdilat sian pamanganna, gara ni api na marnalanala ruar sian Ibana.",
			"10": "<sup>10</sup> Dung i dipajomba Ibana ma angka langit, gabe tuat Ibana, * holom marimpotimpot di toru ni patna.",
			"11": "<sup>11</sup> * Marsihundul di kerubim ma Ibana huhut habang, jala mangareapreap di atas habong ni alogo.",
			"12": "<sup>12</sup> Haholomon do dibahen pangondinganna humaliang Ibana, parhobot ni udan dohot ombun do lapelapena.",
			"13": "<sup>13</sup> Mamolus do sian angka ombunna i ambolas dohot gara ni api, dibahen sinondang na di jolona i.",
			"14": "<sup>14</sup> Mangkuling do ronggur di angka langit dibahen Jahowa, jala dipalu na Tumimbul i do soarana. Ambolas dohot gara ni api do mangihut.",
			"15": "<sup>15</sup> Dung i disiorhon ma angka sumbiana, jala dipaserak angka musu, dijotjoti ma maniorhon angka hilap, manggunturi nasida.",
			"16": "<sup>16</sup> Jadi tarida ma angka lubuk ni aek, gabe mullop ma dohot angka ojahan ni portibi on maradophon pangasupim, ale Jahowa, maradophon pangunsong ni hosa ni igungmu.",
			"17": "<sup>17</sup> * Disurdukkon do tanganna sian ginjang manangkup ahu, manait ahu sian + angka aek magodang.",
			"18": "<sup>18</sup> Dipalua do ahu sian musungku na gogo i dohot sian angka na mangkosom ahu, ala gumogo do nasida sian ahu.",
			"19": "<sup>19</sup> Dirampok nasida do ahu di ari hinamagongki, jadi Jahowa ma pangunsandeanku.",
			"20": "<sup>20</sup> Jala ditogihon do ahu tu * halambason, dipalua do ahu, ai lomo do rohana mida ahu.",
			"21": "<sup>21</sup> Hombar tu hatigoranku do dibaloshon Jahowa tu ahu; hombar tu * habontoron ni tanganku do dipasuang tu ahu.",
			"22": "<sup>22</sup> Ai hujujur do angka dalan ni Jahowa, jala ndang manjahati ahu marbalik sian Debatangku.",
			"23": "<sup>23</sup> Ai sai tong di jolongku sude angka uhumna, jala ndang hupaholang angka patikna i sian ahu.",
			"24": "<sup>24</sup> Sai * sun do lidang ni rohangku mardonganhon Ibana, jala sai hujaga do diringku maradophon + hajahatonku.",
			"25": "<sup>25</sup> Jadi dibaloshon Jahowa ma tu ahu hombar tu hatigoranku, hombar tu halidangon ni tanganku, na niidana i.",
			"26": "<sup>26</sup> Asi do roham tu na asi roha i, tobok do Ho maradophon halak na tobok i.",
			"27": "<sup>27</sup> Bontor do Ho dompak na bontor roha i, jala pulos do roham tu pargeduk i.",
			"28": "<sup>28</sup> Ai ditumpahi Ho do jolma na dangol i, jala dipajimput Ho do jolma * parmata na elak.",
			"29": "<sup>29</sup> Ai marsinondang do * parpalitoanku dibahen Ho, dipatiur Jahowa, Debatangku, do holom ni parnidaanku.",
			"30": "<sup>30</sup> Ai mardonganhon Ho tartondong ahu do parduan ni parangan, jala mangasahon Debatangku tartimbung ahu do parik na timbo.",
			"31": "<sup>31</sup> * Sisangunjur do dalan ni Debata, ** pita do hata ni Jahowa, Ibana do + lombulombu ni sude angka na marhaposan tu Ibana.",
			"32": "<sup>32</sup> Ai tung ise ma Debata, dungkon ni Jahowa, jala tung ise tau partanobatoan, dungkon ni Debatanta.",
			"33": "<sup>33</sup> Debata do mangkohoshon pargogo tu ahu, jala dipatiur do dalanku.",
			"34": "<sup>34</sup> Doshon doras ni tini do pathu dibahen, jala dipajongjong do ahu tu angka * habuntulonku.",
			"35": "<sup>35</sup> Ibana mangajari tanganku mangula hamusuan, asa tarbahen botohonku manintak sior haksa.",
			"36": "<sup>36</sup> Jala dilehon Ho do tu ahu lombulombu ni hatuaonmi, jala ditungkol siamunmu do ahu, jala habasaonmu do patimbul ahu.",
			"37": "<sup>37</sup> Dipalumbang Ho do langkangku, jadi ndang tarbaliksu mata ni ari ni tothu.",
			"38": "<sup>38</sup> Sai hulotongi do angka musungku, gabe dapot ahu do nasida, jala ndang mulak ahu paima siap nasida hubahen.",
			"39": "<sup>39</sup> Huropuhi do nasida, jadi ndang tarbahen nasida be hehe, marragean do nasida tu toru ni tothu.",
			"40": "<sup>40</sup> Dihohoshon Ho do pargogo tu ahu, mangula hamusuan, dipapatu Ho do angka alongku tu ahu.",
			"41": "<sup>41</sup> * Dipaunduk Ho do angka musungku, gabe siap hubahen angka na mangkosom ahu.",
			"42": "<sup>42</sup> Mangangguhi do nasida, hape ndang adong na paluahon, tu Jahowa pe, hape ndang olo Ibana mangalusi nasida.",
			"43": "<sup>43</sup> Jadi hulamoti ma nasida songon orbuk maradophon alogo, hulutluti ma nasida songon gambo di alaman.",
			"44": "<sup>44</sup> Dipalua Ho do ahu sian angka parbadaan ni bangso, dipabangkit Ho do ahu, gabe * pandapotan ni angka parbegu, gari halak na so hutanda mangoloi ahu.",
			"45": "<sup>45</sup> Guru dokku do nasida, halak na pulik marga pe mangalesemlesem ahu.",
			"46": "<sup>46</sup> Merus do anak ni na pulik margai, jala angka hitir do nasida ruar sian partanobatoannasida.",
			"47": "<sup>47</sup> Mangolu do Jahowa, jala pujion ma partanobatoanki, jala timbul do Debata ni hatuaonku.",
			"48": "<sup>48</sup> Debata do Silehon angka partubolon tu ahu dohot papatuhon angka bangso tu ahu.",
			"49": "<sup>49</sup> Ibana sipalua ahu sian angka musungku, Ho do tongon patimbul ahu maralohon angka alongku, dipalua Ho do ahu sian jolma sibahen gogo.",
			"50": "<sup>50</sup> Dibahen i pujionku ma Ho, ale Jahowa, di tongatonga ni angka parbegu, jala endehononku ma goarmu.",
			"51": "<sup>51</sup> Ibana Sipatimbul angka hatuaon ni rajana, jala Sibahen asi ni roha tu miniahanna i, tu si Daud dohot tu pinomparna i ro di salelenglelengna."
		},
		"19": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> * Angka langit do mamaritahon hamuliaon ni Debata, jala jadijadian ni tanganna do pinaboa ni + na ratarata ni langit.",
			"3": "<sup>3</sup> Masipaboaan do angka ari, jala masilehonan parbinotoan do angka borngin.",
			"4": "<sup>4</sup> Ndada barita manang hatahata na so binege soarana i di bagasan.",
			"5": "<sup>5</sup> Tolhas tu liat portibi on tali pangungkurna, jala ro di topi ni tano on do baritana. Dibahen do disi soposopo ni mata ni ari.",
			"6": "<sup>6</sup> Jadi songon * bajo pangoli do ibana ruar sian bilutna; las do rohana songon ulubalang na manopot sitopotonna.",
			"7": "<sup>7</sup> Sian topi ni langit do habibinsarna, jala tolhas ro di angka topina muse pangkusorna i, jala ndang adong na buni maradophon mohopna i. II.",
			"8": "<sup>8</sup> Sun denggan do patik ni Jahowa, tau sipasabam roha; sintong do * panindangion ni Jahowa, dipabisuk do na tobok marroha.",
			"9": "<sup>9</sup> Tigor do patik ni Jahowa, angka sipalas roha; pita do patik ni Jahowa, dipatiur do parnidaan.",
			"10": "<sup>10</sup> Pita ni parsombaon tu Jahowa do na hot tongtong, hasintongan do angka uhum ni Jahowa, tigor do sudena.",
			"11": "<sup>11</sup> Ummarga do angka i sian mas dohot sian sere palangki na godang situtu, tumonggi do angka i sian situak ni loba dohot tanggule.",
			"12": "<sup>12</sup> Naposom pe dapotan sipaingot do hinorhon ni, godang do upa ni na mangaradoti angka i. III.",
			"13": "<sup>13</sup> Tung ise ma umboto angka haliluon? Sai sesa ma dohot dosa, angka na so huboto.",
			"14": "<sup>14</sup> Palua ma huhut naposom sian angka haginjangon ni roha, asa unang ahu dirajai! * Disi pe asa lias jala bontor ahu sian pangalaosion na godang i.",
			"15": "<sup>15</sup> On pe, sai * lomo ma roham di angka hata ni pamanganki dohot di pangkataion ni rohangki tu jolo ni bohim, ale Jahowa, partanobatoanku dohot siluluhon ahu."
		},
		"20": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Sai * dialusi Jahowa ma ho di ari hagogotan, sai dipatimbul + goar ni Debata ni si Jakkob ma ho!",
			"3": "<sup>3</sup> Ditongoshon ma tu ho panumpahion sian bagas habadiaon, jala ditungkol ho sian Sion!",
			"4": "<sup>4</sup> Sai marningot ma Ibana di sude angka peleanmu sipanganon, sai talmis ma di rohana angka peleanmu situtungon! Sela.",
			"5": "<sup>5</sup> Sai dilehon ma tu ho sisubut roham, jala dipasaut nasa sangkapmi.",
			"6": "<sup>6</sup> Asa mariaia hita mida hatuaonmi, jala mamiorhon * tonggol, mangasahon goar ni Debatanta i. Sai dipasaut Jahowa ma nasa pangidoanmu.",
			"7": "<sup>7</sup> Nuaeng pe huboto tangkas, na tinumpahan ni Jahowa miniahanna i, sai alusanna do ibana sian angka langit habadiaonna i marhitehite angka pangabahan ni hatuaon ni siamunna.",
			"8": "<sup>8</sup> Mangasahon hureta dohot hoda do ianggo nasida, alai anggo hita goar ni Jahowa, Debatanta i do itaingot.",
			"9": "<sup>9</sup> Martungkapan jala martinggangan ianggo nasida, alai anggo hita tong do marsihohot jongjong.",
			"10": "<sup>10</sup> Sai tumpahi ma rajai, ale Jahowa, sai alusi ma hami di ari pangalualuannami!"
		},
		"21": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Ale Jahowa, marlas ni roha do rajai mida gogom, jala marolopolop situtu do ibana mida panumpahim.",
			"3": "<sup>3</sup> Dilehon Ho do tu ibana pinangido ni rohana, jala ndang dijua Ho pinangido ni hatana. Sela.",
			"4": "<sup>4</sup> Ai ditomutomuhon Ho do tu ibana angka pasupasu ni hadoharon, ditalitalihon Ho do tu uluna tumpal sere palangki.",
			"5": "<sup>5</sup> Hangoluan do dipangido sian Ho, dilehon Ho do tu ibana, diudut Ho do ariarina ro di salelenglelengna.",
			"6": "<sup>6</sup> Timbul do hamuliaonna dibahen panumpahim; hatongamon dohot hatimbulon diampehon Ho tu ibana.",
			"7": "<sup>7</sup> Ai * parhitean ni angka pasupasu do ibana dibahen Ho salelenglelengna, dipasabam Ho do rohana marhitehite + las ni roha mida bohim.",
			"8": "<sup>8</sup> Ai marhaposan tu Jahowa do rajai, jala ndang humordit ibana dibahen asi ni roha ni Natumimbul i. II.",
			"9": "<sup>9</sup> Sai jumpang tanganmu do sogot sude angka musum, jumpang siamunmu do sogot sude angka na mangkosom Ho.",
			"10": "<sup>10</sup> Doshon pamurunan do nasida bahenonmu di tingki pangaluluhonmu, sai polgahan ni Jahowa do nasida di bagasan rimasna, jala api manganhon nasida.",
			"11": "<sup>11</sup> Siaphononmu do sogot tubunasida sian tano on ro di pinomparnasida sian jolma manisia.",
			"12": "<sup>12</sup> Ai tahi mangago do rohanasida dompak ho, sai disangkapi do angkal, hape matua so tuk.",
			"13": "<sup>13</sup> Ai lumindak do nasida bahenonmu, tujuonmu do bohinasida i marhitehite tali ni siormu.",
			"14": "<sup>14</sup> Hehe ma Ho, ale Jahowa, mangasahon antuMu! Asa hupuji jala huendehon hami hagogoonmi."
		},
		"22": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Ale Debatangku, Debatangku! Boasa tung tadingkononmu ahu? Sai mandaodao do angka hata ni anggukkon sian hatuaonku.",
			"3": "<sup>3</sup> Ale Debatangku, sai joujou do ahu arian, alai ndang mangalusi Ho, jala borngin pe ndang jumpang ahu hasonangan.",
			"4": "<sup>4</sup> Alai nabadia do anggo Ho, marhabangsahon angka pujipujian ni Israel.",
			"5": "<sup>5</sup> Marhaposan tu Ho do angka ompunami, pos do rohanasida, jadi dipalua Ho do nasida.",
			"6": "<sup>6</sup> Tu Ho do nasida * mangangguhi, jadi malua ma nasida, marhaposan tu Ho do nasida, jadi + ndang tarurak.",
			"7": "<sup>7</sup> Alai * gea nama ianggo ahu, ndada jolma, + haeleson ni halak jala parbilean ni natorop.",
			"8": "<sup>8</sup> Sude angka na marnida ahu marengkelengkelihon ahu, dipangangang do babana huhut mangupirupir.",
			"9": "<sup>9</sup> “Tu Jahowa ma nian dipasahat, asa dipalua ibana, dipangolu ma nian ibana, ai * lomo do rohana mida ibana.”",
			"10": "<sup>10</sup> Ho do tongon na manait ahu sian ampuan, sipapos rohangku, mangonsop bagot ni dainang.",
			"11": "<sup>11</sup> Dung tubu ahu, sai Ho do parsigantunganku, sian butuha ni dainang dope sai Ho do Debatangku.",
			"12": "<sup>12</sup> Unang mandaodao Ho sian ahu, ai donok nama parmaraan, ai soadong sipartumpak.",
			"13": "<sup>13</sup> Sai dihaliangi angka horbo panguge do ahu, jala torop do angka jonggi Basan mangalele ahu.",
			"14": "<sup>14</sup> Angka dipangangang be do babana dompak ahu songon babiat panoro, jala na patungoromon.",
			"15": "<sup>15</sup> * Durus do ahu songon aek, pasitik be do sude holiholingku ditangging, songon pantis na malala do ateatengku di bagasan dagingku.",
			"16": "<sup>16</sup> Merus do gogongku songon ngarngar, jala lohot do dilangku di langitlangit ni pamanganku, jala tu orbuk ni hamatean dipapodom * Ho ahu.",
			"17": "<sup>17</sup> Ai dihaliangi angka biang do ahu, luhutan ni angka parjahat do mangonsongi ahu, * diturai do tanganku dohot tothu.",
			"18": "<sup>18</sup> Habilangan ahu do sude holiholingku, martilla be do ianggo nasida mida ahu.",
			"19": "<sup>19</sup> * Dibagi nasida do angka uloshu, mandabu tondung do nasida taringot tu bajubajungku.",
			"20": "<sup>20</sup> Alai sai unang mandaodao ianggo Ho, ale Jahowa, parsigantunganku, hapogani ma mangurupi ahu.",
			"21": "<sup>21</sup> Sai palua ma hosangku sian * podang, sian sisilon ni biang + hosangku na tarpunjung.",
			"22": "<sup>22</sup> Sai palua ma ahu sian baba ni babiat, jala alusi ahu maradophon tanduk ni angka horbo jalang. II.",
			"23": "<sup>23</sup> Sai * jamitahononku ma goarmu tu angka + hahanggingku, jala pujionku ma Ho di tongatonga ni huria, na marluhut i.",
			"24": "<sup>24</sup> Puji ma Jahowa, hamu ale angka na mangkabiari Ibana, sude pinompar ni si Jakkob pasangaphon Ibana, jala sude pinompar ni Israel mangkormat Ibana!",
			"25": "<sup>25</sup> Ai ndang lea rohana manang marbiasbias mida pardangolan ni na dangol, jala ndang ditabunihon bohina maradophon ibana, jala ditangihon do anggukna i tu Ibana.",
			"26": "<sup>26</sup> Asa Ho do haroroan ni pujipujianku di tongatonga ni huria na ria i, * gararonku ma angka bagabagangku di jolo ni angka na mangkabiari Ibana.",
			"27": "<sup>27</sup> Sai * mangan do sogot angka na dangol i jala butongan, ingkon mamujimuji Jahowa do angka na + usouso di Ibana, sai huminsa do rohamuna salelenglelengna.",
			"28": "<sup>28</sup> Ingoton ni isi ni liat portibi on ma i, gabe mulak ma nasida tu Jahowa, jala marsomba tu jolom do sogot sude angka marga ni parbegu.",
			"29": "<sup>29</sup> Ai Jahowa do nampuna harajaon, jala panggomgom di angka parbegu.",
			"30": "<sup>30</sup> Mangan jala marsomba do sogot sude angka na gok na hum di tano on, marsinggang tu jolona do sogot sude angka na marsingkor ro di na mate gasing.",
			"31": "<sup>31</sup> Sai adong do pinompar ni manisia, na mangoloi Ibana, angka na manaringoti Tuhan i tu pinompar na sogot.",
			"32": "<sup>32</sup> Ro do angka nasida sogot, manjamitahon hatigoranna tu * halak na tubu muse, paboa + Ibana do pasunhon."
		},
		"23": {
			"1": "<sup>1</sup> Ende sian si Daud. Jahowa do * Siparmahan ahu, ndang tagamon hurangan ahu.",
			"2": "<sup>2</sup> Dipatongon do ahu tu jampalan angka na lomak, ditogutogu do ahu di lambung aek hasonangan.",
			"3": "<sup>3</sup> * Dipasabam do rohangku, ditogu do ahu di dalan hatigoran, + ala ni goarna i.",
			"4": "<sup>4</sup> Ai nang pe mardalan ahu di * rura linggoman ni hamatean, ndang huhabiari parmaraan, ai Ho do mandongani ahu + tungkotmu dohot batahim mangapuli ahu.",
			"5": "<sup>5</sup> Ho do manutup * meja di jolongku maradophon angka musungku, + dimiahi Ho do ulungku, suksuk do panginumanki.",
			"6": "<sup>6</sup> Tongon tahe denggan basa dohot asi ni roha mangihutihut ahu saleleng ahu mangolu, jala dung mulak ahu masuhanku ma bagas ni Jahowa salelenglelengna."
		},
		"24": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Gok di Jahowa do tano on ro di isina, portibi on dohot pangisina.",
			"2": "<sup>2</sup> Ai Ibana do paojakkonsa di atas ni angka laut, jala dipahot di atas ni angka batang aek.",
			"3": "<sup>3</sup> Ise do na jadi nangkok tu dolok ni Jahowa? Jala ise do na hum jongjong sogot di hajongjongan ni habadiaonna i?",
			"4": "<sup>4</sup> Halak partangan na lidang dohot na ias roha, parroha na so paihuthon na so hasea, jala na so olo margana laho mangansi.",
			"5": "<sup>5</sup> I ma halak na maruli pasupasu sian Jahowa, dohot hatigoran sian Debata ni hatuaonna i.",
			"6": "<sup>6</sup> I ma sundut ni angka na usouso di Ibana, angka na mangalului bohim, Jakkob. Sela. II.",
			"7": "<sup>7</sup> Patuginjang ma tohangmuna, hamu ale angka harbangan, patuginjang ma hamu, ale angka pintu sian na robi, asa bongot Raja ni hamuliaon!",
			"8": "<sup>8</sup> Ise ulaning Raja ni hamuliaon i? I ma Jahowa, na gogo jala Ulubalang, Jahowa Ulubalang di hamusuon.",
			"9": "<sup>9</sup> Patuginjang ma tohangmuna, hamu ale angka harbangan, jala patuginjang ma hamu, ale angka pintu sian na robi, asa bongot Raja ni hamuliaon i!",
			"10": "<sup>10</sup> Ise ulaning Ibana, Raja ni hamuliaon i? I ma Jahowa Zebaot, Ibana do Raja ni hamuliaon i. Sela."
		},
		"25": {
			"1": "<sup>1</sup> Ende sian si Daud. Ho do, ale Jahowa, dihalungunhon rohangku.",
			"2": "<sup>2</sup> Ale Debatangku, marhaposan tu Ho do ahu, unang tung paila ahu, asa unang marsuraksurak angka musungku mida ahu.",
			"3": "<sup>3</sup> * Ndang tahe tagamon tarurak sude angka na mangkaposi Ho, sai maila do sogot angka pangose soada alana.",
			"4": "<sup>4</sup> Ale Jahowa, sai pabotohon ma tu ahu angka dalanmu, jala ajarhon tu ahu angka bogasmu.",
			"5": "<sup>5</sup> Sai togutogu ma ahu tubagasan hasintonganmu, jala ajari ahu, ai Ho do Debata ni hatuaonku, Ho do na huhaposi ganup ari.",
			"6": "<sup>6</sup> Sai ingot ma, ale Jahowa, angka denggan ni basam dohot asi ni roham, ai sian na robi do angka i.",
			"7": "<sup>7</sup> Sai unang paingotingot angka dosa ni haposoonku dohot pangalaosingku, sai ingot ma ahu, ale Jahowa, hombar tu asi ni roham, ala ni denggan ni basam.",
			"8": "<sup>8</sup> Pardengganbasa jala na * bonar do Jahowa, ala ni + dipodahon do dalan na tigor i tu angka pardosa.",
			"9": "<sup>9</sup> Diparnonohon do uhum tu angka na dangol jala diajarhon dalanna tu angka na tarjepol.",
			"10": "<sup>10</sup> Asi ni roha dohot hasintongan do sude dalan ni Jahowa di angka na mangaradoti padanna dohot angka panindangionna.",
			"11": "<sup>11</sup> Ala ni goarmu, ale Jahowa, sai marpamuati ma roham di dosangku, ai tung na balga do i.",
			"12": "<sup>12</sup> Ise ulaning baoa na mangkabiari Jahowa? Sai na * ajarhononna do tu ibana dalan sipillitonna.",
			"13": "<sup>13</sup> Sorang di hasonangan do tondina i, jala pinomparna i * tumean tano on sogot.",
			"14": "<sup>14</sup> Hasudungan ni Jahowa do angka na mangkabiari Ibana, jala dipabotohon tu nasida padanna.",
			"15": "<sup>15</sup> Sai tong do * mangaranap matangku tu Jahowa, ai Ibana do + mangenet tothu sian jorgong.",
			"16": "<sup>16</sup> Sai dompakkon ma ahu, jala asi roham di ahu, ai * punjung jala na dangol do ahu.",
			"17": "<sup>17</sup> Lam ganda do hagogotan ni rohangku, sai palua ma ahu sian angka hasosahanku.",
			"18": "<sup>18</sup> Sai tatap ma dangolhon dohot ngaluthon, jala marpamuati ma roham di angka dosangku sudena.",
			"19": "<sup>19</sup> Ida ma angka musungku, ai lan do nasida, jala hosomhosom pangarupaon dibahen nasida mangkosom ahu.",
			"20": "<sup>20</sup> Sai ramoti ma tondingki jala palua ahu, unang tung paurak ahu, ai marhaposan tu Ho do ahu.",
			"21": "<sup>21</sup> Halidangon dohot hatigoran ma mangaramoti ahu, ai marhaporusan tu Ho do ahu.",
			"22": "<sup>22</sup> Ale Debata, sai palua ma Israel sian angka hagogotanna sudena."
		},
		"26": {
			"1": "<sup>1</sup> Ende sian si Daud. * Luluhon ahu, ale Jahowa, ai marpangalaho di bagasan hadaulatonku do ahu, jala tu Jahowa do ahu marhaposan, ndang meoleol ahu.",
			"2": "<sup>2</sup> Uji ma ahu, ale Jahowa, jala sulingkit rohangkon, sai lala ma angka piangki dohot rohangki.",
			"3": "<sup>3</sup> Ai sai solpa do di matangku denggan basam, jala * marparange ahu di bagasan hasintonganmi.",
			"4": "<sup>4</sup> Ndang dung sahundulan ahu dohot halak sineang roha, jala ndang huparangkupi angka parsibuni.",
			"5": "<sup>5</sup> Huhagigihon do luhutan ni angka panggetegete, jala ndang sahundulan ahu dohot angka parjahat.",
			"6": "<sup>6</sup> Sai * hupaburiburi do tanganku di bagasan halidangon, jala sai naeng halianganku + langgatanmi, ale Jahowa!",
			"7": "<sup>7</sup> Laho patubegehon soara pujipujian dohot pajojorhon sude halongangan, angka na binahenmi.",
			"8": "<sup>8</sup> Ale Jahowa, huhaholongi do hajongjongan ni bagasmu dohot hasonggopan ni hamuliaonmu.",
			"9": "<sup>9</sup> Sai unang sarat tondingku rap dohot angka pardosa, manang ngolungku tu angka * jolma sisopsop mudar.",
			"10": "<sup>10</sup> Angka na paulaula hajahaton, jala * gok sisip siamunnasida i.",
			"11": "<sup>11</sup> Alai anggo ahu sai marpangalaho di bagasan halidangonhon, palua ahu jala asi ma roham di ahu!",
			"12": "<sup>12</sup> Jongjong di dalan na tigor do tothu, pujionku ma Jahowa * di bagasan angka luhutan."
		},
		"27": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Jahowa do * panondangingku dohot hatuaonku, tung ise ma habiaranku? Jahowa do + partanobatoan ni ngolungku, tung mida ise ma ahu biahaton?",
			"2": "<sup>2</sup> Molo tung ro angka parjahat mangarongrong ahu naeng manganhon sibukku, angka sisosak ahu dohot angka musungku, gabe martinggangan do nasida, jala marragean.",
			"3": "<sup>3</sup> Nang pe * marhoronhoron parangan angka na manungkum ahu, ndang dihabiari rohangku, nang pe hehe parmusuon dompak ahu, + sai pos do rohangku disi. II.",
			"4": "<sup>4</sup> Sada do naung hupangidohon sian Jahowa, sai i do hulului! Naeng mian ahu di bagasan joro ni Jahowa saleleng mangolu ahu, paidaida hinadenggan ni Jahowa dohot mamingkiri ganup sogot di bagasan jorona i.",
			"5": "<sup>5</sup> Ai * diondingi do ahu di bagasan undungundungna di ari hinamago, ditabunihon do ahu di partabunian ni undungundungna, tu + dolok partanobatoan do ahu dipanangkok.",
			"6": "<sup>6</sup> Asa mandirgak ulungku mida musungku, angka na humaliang ahu; jadi pelehononku ma di bagasan undungundungna i angka pelean pujipujian, marende ma ahu huhut mamalu parhinaloan mamuji Jahowa. III.",
			"7": "<sup>7</sup> Sai tangihon ma soarangku, ale Jahowa, molo joujou ahu, asi ma roham mida ahu, jala alusi ahu.",
			"8": "<sup>8</sup> Ninna rohangku do mandok Ho: lulu i hamu ma bohingku! Antong bohim ma na hulului, ale Jahowa.",
			"9": "<sup>9</sup> Unang tung tabunihon bohim maradophon ahu, unang tung tulak naposom di bagasan rimasmu, matua Ho do pangurupingku, unang tung ambolongkon ahu, jala unang tadingkon ahu, ale Debata ni hatuaonku!",
			"10": "<sup>10</sup> Ai nunga ditadingkon damang dohot dainang ahu, alai dijangkon Jahowa do ahu.",
			"11": "<sup>11</sup> Sai podahon ma tu ahu dalanmu, ale Jahowa, jala togu ahu di dalan hatigoran, ala ni angka alongku.",
			"12": "<sup>12</sup> Unang tung pasahat ahu * guru roharoha ni angka musungku, ai hehe do dompak ahu angka sitindangi pargabus, jala + dibuashon hajahaton.",
			"13": "<sup>13</sup> Aut unang huhaporseai paidaidaonku sogot * hinadenggan ni Jahowa di + tano hangoluan on!",
			"14": "<sup>14</sup> Parhanalom ma Jahowa, pagomos jala patogu roham jala parhanalom Jahowa!"
		},
		"28": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Tu Ho do ahu joujou, ale Jahowa, partanobatoanku, unang sai sip Ho, manundali ahu, asa unang ahu molo tung laos sip Ho manundali ahu, doshon halak angka na manuruk tanoman.",
			"2": "<sup>2</sup> Sai tangihon ma soara ni sombasombangku, molo mangangguhi ahu tu Ho, molo hupaherbang tanganku tu bilut ni habadiaonmu.",
			"3": "<sup>3</sup> Unang tung * sarat ahu rap dohot angka parjahat dohot angka siulahon hajahaton, angka + parhata lesem tu donganna, hape hajahaton do di bagasan rohanasida.",
			"4": "<sup>4</sup> Sai baloshon ma tu nasida hombar tu pambahenannasida dohot tu hinajahat ni pangalahonasida; hombar tu parulaon ni tangannasida baloshon tu nasida, tubolhon tu nasida pambahenannasida i.",
			"5": "<sup>5</sup> Ai ndang pardulina mangantusi angka jadijadian ni Jahowa manang parulaon ni tanganna; lohaonna ma nasida sogot jala ndang be paulionna nasida. II.",
			"6": "<sup>6</sup> Pinuji ma Jahowa, ai nunga ditangihon soara ni sombasombangki.",
			"7": "<sup>7</sup> * Jahowa do pargogongku dohot lombulombungku, marhaposan tu Ibana do rohangku, jadi dapotan pangurupion ahu; asa + marolopolop ma rohangku jala pujion ni endengku ma Ibana.",
			"8": "<sup>8</sup> Jahowa do pargogonasida jala * partanobatoan ni angka hatuaon ni Messiasna i do Ibana.",
			"9": "<sup>9</sup> Sai tumpahi ma * bangsomi jala pasupasu bangso na niainmi, sai parmahan i jala + usungi ma nasida ro di salelenglelengna."
		},
		"29": {
			"1": "<sup>1</sup> Ende sian si Daud. * Lehon ma tu Jahowa, hamu ale angka + anak ni Debata, lehon ma tu Jahowa hamuliaon dohot hagogoon.",
			"2": "<sup>2</sup> Lehon ma tu Jahowa hamuliaon ni goarna, marsomba ma hamu tu Jahowa mamangke * pangkean parhadohoan.",
			"3": "<sup>3</sup> * Soara ni Jahowa do di atas ni + angka aek, Debata ni hamuliaon parohon ronggur, Jahowa do di atas aek angka na bolon.",
			"4": "<sup>4</sup> Soara ni Jahowa do mardongan hagogoon, soara ni Jahowa mardongan hatongamon.",
			"5": "<sup>5</sup> Soara ni Jahowa do umpunokkon angka hau ares jala dipunokkon Jahowa do angka hau ares ni Libanon.",
			"6": "<sup>6</sup> Huhut * panihalnihalon nasida dibahen, songon anak ni lombu, nang Libanon nang + Sirion songon anak ni horbo jalang.",
			"7": "<sup>7</sup> Soara ni Jahowa do manggurasahon jilam ni api.",
			"8": "<sup>8</sup> Soara ni Jahowa do mambahen humuntal halongonan, dihuntal Jahowa do * halongonan Kades.",
			"9": "<sup>9</sup> Soara ni Jahowa do mambahen marasar angka tini, jala dipalanga do angka tombak, jala sude na di bagasan jorona i mandok: Hamuliaon!",
			"10": "<sup>10</sup> Marhabangsa do Jahowa mangkorhon aek na sumar, jala marhabangsa do Jahowa, paboa raja ro di salelenglelengna.",
			"11": "<sup>11</sup> * Lehonon ni Jahowa do sogot pargogo tu bangsona i, + tumpahan ni Jahowa do sogot bangsona mardamedame."
		},
		"30": {
			"1": "<sup>1</sup> Ende sian si Daud laho pasahathon bagas i tu Debata. I.",
			"2": "<sup>2</sup> Patimbulonku ma Ho, ale Jahowa, ai Ho do mangenet ahu sian godung, jala ndang dipalas Ho roha ni angka musungku mida ahu.",
			"3": "<sup>3</sup> Ale Jahowa, Debatangku, tu Ho do ahu mangangguhi, jadi dipamalum Ho ahu.",
			"4": "<sup>4</sup> Ale Jahowa, nunga dipanangkok Ho tondingku sian banua toru, nunga dipangolu Ho ahu sian angka na manuruki hinambor.",
			"5": "<sup>5</sup> Puji ma Jahowa, hamu ale angka na niasianna, jala endehon hamu ma barita ni habadiaonna i!",
			"6": "<sup>6</sup> Ai * tongkin do panombo ni rimasna, alai saleleng mangolu do ianggo asi ni rohana; botarina i sorang partangison, hape + manogotna i masa parolopolopon. II.",
			"7": "<sup>7</sup> Alai anggo ahu ningku do, saleleng sonang ahu: ndang tagamon humordit ahu salelenglelengna.",
			"8": "<sup>8</sup> Ho do, ale Jahowa, pagonting dolokku sian denggan ni basam; ditabunihon Ho do bohim, jadi tarhatotong ahu.",
			"9": "<sup>9</sup> Tu Ho do ahu joujou ale Jahowa, jala tu Jahowa do ahu marhuraja.",
			"10": "<sup>10</sup> Tung aha ma labam di mudarhi, di hatutuathu tu godung? Tung tagamon ma pujion ni orbuk Ho, manang manjamitahon hasintonganmi?",
			"11": "<sup>11</sup> Sai tangihon ma, ale Jahowa, jala asi roham mida ahu! Sai Ho ma Sipartumpak di ahu ale Jahowa!",
			"12": "<sup>12</sup> Nunga dihosing Ho andungku gabe endengku, nunga ditanggal Ho horingku, dung i dihohoshon Ho do tu ahu las ni roha.",
			"13": "<sup>13</sup> Asa pujion ni hamuliaon tondingku Ho, ndang marpansadian. Sai pujionku do Ho, ale Jahowa, Debatangku salelenglelengna."
		},
		"31": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Tu Ho do, ale Jahowa, ahu marhaposan, unang tung paurak ahu salelenglelengna, sai palua ma ahu marhitehite hatigoranmu!",
			"3": "<sup>3</sup> Sai paeleng ma pinggolmu tu ahu, hapogani paluahon ahu; sai Ho ma gabe dolok batu partanobatoan di ahu, gabe huta na gonting laho pangoluhon ahu.",
			"4": "<sup>4</sup> Ai Ho do partanobatoanku hian dohot pangondianku, jala ala ni goarmu sai iringiringonmu jala toguonmu ahu.",
			"5": "<sup>5</sup> Sai tanggalanmu do ahu sian jorgong, na buni tinaonnasida i mambuat ahu, ai Ho do partanobatoanku.",
			"6": "<sup>6</sup> Tubagasan tanganmu do hupasahat * tondingku, nunga ditobus Ho ahu, ale Jahowa, + Debata ni hasintongan i.",
			"7": "<sup>7</sup> Sai huhagigihon do angka na marsomba * ganaganaan na so marniula, alai anggo ahu, Jahowa do na huhaposi.",
			"8": "<sup>8</sup> Sai marolopolop jala marlas ni roha ma ahu bahen mida asi ni roham, na tinatapmu dangolhon, na marbinoto i Ho di angka hagogotan ni tondingki.",
			"9": "<sup>9</sup> Jala ndang * dipadapot Ho ahu tu tangan ni musu, + dipajongjong Ho do pathu di halambason.",
			"10": "<sup>10</sup> Asi ma roham di ahu, ale Jahowa, ai hagogotan do ahu, * pola do lotop matangku binahen ni haarsahon, maras do rohangku dohot dagingku.",
			"11": "<sup>11</sup> Ai nunga suda ngolungku dibahen hamarason, suda dohot angka taonhu dibahen angguhangguk, * merus do gogongku dibahen dosangki, jala ndang mangalo be holiholingku.",
			"12": "<sup>12</sup> Jadi gabe parbilean do ahu maradophon sude angka alongku dohot hombarhu hundul, jala tarsonggot situtu do angka donganku magodang; marsidingsiding be do angka na marnida ahu di balian.",
			"13": "<sup>13</sup> Nunga tung * lupa ahu sian roha, songon halak na mate, + sobokkon ngarngar na ambolongan nama ahu.",
			"14": "<sup>14</sup> Ai sai hupabegebege do husiphusip ni torop halak, habiaran humaliang; sai marluhut i do nasida martuptup i ahu, mambuat hosangku do dipingkiri nasida.",
			"15": "<sup>15</sup> Alai anggo ahu, tu Ho do ahu marhaposan, ale Jahowa, ningku do: * Ho do Debatangku.",
			"16": "<sup>16</sup> Marguru tu tanganmu do angka parsoriongki, sai palua ma ahu sian tangan ni angka musungku dohot sian angka na mangalotongi ahu.",
			"17": "<sup>17</sup> Sai * pasondangkon ma bohim tu naposom, jala tumpahi ahu marhitehite asi ni roham.",
			"18": "<sup>18</sup> Ale Jahowa, sai unang paurak ahu, ai Ho do na hujou; sai tarurak ma nian sogot angka parjahat jala hohomhohom di bagasan banua toru.",
			"19": "<sup>19</sup> Ingkon mangungu ma nian angka bibir pargabus, angka na jungkat marpangkuling tu partigor mangasahon hajungkaton dohot haelakon. II.",
			"20": "<sup>20</sup> Tung na godang situtu do denggan basam, na pineopmu di angka na mangkabiari Ho, na binahenmi tu angka na mangkaposi Ho di adopan ni manisia.",
			"21": "<sup>21</sup> Diondingi Ho do nasida marhitehite pangondingan ni bohim maradophon pandoboon ni jolma, ditabunihon Ho do nasida di bagasan undungundung maradophon pamodaion ni angka bibir.",
			"22": "<sup>22</sup> Pinuji ma Jahowa, ai tung na * sumurung do asi ni rohana di ahu di bagasan + huta na gonting.",
			"23": "<sup>23</sup> Ianggo ahu nunga pola * hudok ni hatahutonku: nunga sirang ahu sian adopan ni matam! — Hape ditangihon Ho do soara di angguk i uju + mangangguhi ahu tu Ho.",
			"24": "<sup>24</sup> Sai * haholongi ma Jahowa, sude hamu angka na niasianna, dijaga Jahowa do angka na porsea, alai mardapotdapot do + dibaloshon tu angka sibahen hajungkaton.",
			"25": "<sup>25</sup> Sai marsihohot ma rohamuna jala togu, sude hamu angka na mangkalungunhon Jahowa!"
		},
		"32": {
			"1": "<sup>1</sup> Ende sipodaon sian si Daud. I. Martua ma manang ise naung sinesaan pangalaosina, naung hinungkupan dosana.",
			"2": "<sup>2</sup> Martua ma jolma, ia so * dijujur Jahowa tu ibana hajahaton, jala ndang + marpangalensem tondina di bagasan.",
			"3": "<sup>3</sup> Ai saleleng huhasiphon dosangku reung do holiholingku, dibahen anggukku ganup ari.",
			"4": "<sup>4</sup> Ai sai * didondoni tanganmu do ahu arian dohot borngin, jadi marsik do mudarhu songon di hamamasa ni logo ni ari. Sela.",
			"5": "<sup>5</sup> Jadi hupabotohon ma tu Ho dosangku jala ndang huhungkupi salangku; ningku do: * Topotanku ma angka pangalaosingku tu Jahowa, jadi marpamuati do roham di utang ni dosangki.",
			"6": "<sup>6</sup> Ala ni martangiang ma tu Ho sude na lidang marroha di * tingki parsaulian; tongon do, nang pe ro tahop angka aek magodang, + ndang tagamon sampe ianggo tu ibana.",
			"7": "<sup>7</sup> Ho do pangondianku, sai jagaonmu do ahu sian parmaraon, sai * haliangkononmu do tu ahu olopolop ni haluaon. Sela. II.",
			"8": "<sup>8</sup> Huparrohai jala hupodai pe ho taringot tu dalan sidalananmu, huiringiring pe ho dohot pamereng ni matangku.",
			"9": "<sup>9</sup> Unang tung songon hoda hamu, manang songon halode na so marroha, ndang olo dumonok tu ho, nda pinatunduk ni kongkang.",
			"10": "<sup>10</sup> Tung na lan do parniahapan ni parjahat, alai manang ise na marhaposan tu Jahowa, haliangkononna tusi asi ni roha.",
			"11": "<sup>11</sup> Marlas ni roha ma hamu mida Jahowa, jala marolopolop ma hamu, ale angka partigor, jala marende ma sude hamu angka parsihohot marroha."
		},
		"33": {
			"1": "<sup>1</sup> I. Marolopolop ma hamu, ale angka partigor, mangasahon Jahowa, talup do marende angka na unjur marroha.",
			"2": "<sup>2</sup> Puji hamu ma Jahowa mardongan hasapi, marende ma hamu umpuji Ibana, mardongan hasapi na martali sampulu.",
			"3": "<sup>3</sup> Endehon hamu ma * ende na imbaru tu Ibana, padenggan hamu ma soara ni sarune.",
			"4": "<sup>4</sup> Ai na sintong do hata ni Jahowa, jala marhaburjuon do sude pambahenanna.",
			"5": "<sup>5</sup> Ibana mangkaholongi hatigoran dohot uhum, * gok asi ni roha ni Jahowa do tano on.",
			"6": "<sup>6</sup> Marhitehite hata ni Jahowa do manjadi angka langit, jala marhitehite hosa ni pamanganna sude angka paranganna.",
			"7": "<sup>7</sup> Ibana papunguhon * aek ni laut i, songon timbunan, angka parartaanna do angka lung i dibahen.",
			"8": "<sup>8</sup> Sai marhabiaran maradophon Jahowa ma sude tano on, jala marsomba tu Ibana ma sude pangisi ni portibi on.",
			"9": "<sup>9</sup> Ai mangkuling Ibana, gabe manjadi do, mandokkon do Ibana, jadi jongjong ma.",
			"10": "<sup>10</sup> Jahowa do * pahusorhon tahi ni angka parbegu, ditulaktulak do pingkiran ni angka bangso.",
			"11": "<sup>11</sup> Ianggo sangkap ni Jahowa sai na hot do salelenglelengna, pingkiran ni rohana pe marsundutsundut do. II.",
			"12": "<sup>12</sup> Martua ma bangso na mardebatahon Jahowa, bangso na pinillitna laho ainonna.",
			"13": "<sup>13</sup> Manatapnatap do Jahowa sian banua ginjang marnida jolma manisia sudena.",
			"14": "<sup>14</sup> Manatapnatap do Ibana sian ojahan ni habangsana dompak sude pangisi ni tano on.",
			"15": "<sup>15</sup> Ibana do * manjadihon rohanasida sudena, + diantoi do sude pambahenannasida i.",
			"16": "<sup>16</sup> Ndada hinadeak ni parangan pamonangkon raja, ndada hinatimbul ni gogo paluahon na begu.",
			"17": "<sup>17</sup> Pangalensem do nang hoda panumpahi, jala ndang hinatimbul ni gogona paluahon ibana.",
			"18": "<sup>18</sup> Ida ma, sai nolnol do mata ni Jahowa tu angka na mangkabiari Ibana, angka na mangkalungunhon asi ni rohana.",
			"19": "<sup>19</sup> Asa dipalua tondinasida sian hamatean, jala dipangolu nasida di haleon.",
			"20": "<sup>20</sup> Sai dihalungunhon rohanami do Jahowa, * Ibana do panumpahi dohot lombulombunami.",
			"21": "<sup>21</sup> Ai mangasahon Ibana marlas ni roha do hami, marhaposan tu goarna na badia i do hami.",
			"22": "<sup>22</sup> Sai pasonggop ma asi ni roham tu hami, ale Jahowa, hombar tu pangkalungunhonnami di Ho."
		},
		"34": {
			"1": "<sup>1</sup> Ende sian si Daud, uju nalalaen ibana dipaula di jolo ni raja Abimelek, na palahohon ibana, gabe muli ibana. I.",
			"2": "<sup>2</sup> Pujionku ma Jahowa sipatsipat ni ari, sai tong ma pujipujianna di bagasan pamanganku.",
			"3": "<sup>3</sup> Jahowa do dipartanggulhon rohangku, begeon ni angka * na dangol ma i, jadi las ma rohanasida.",
			"4": "<sup>4</sup> Dongani hamu ma ahu * pasangaphon Jahowa, rap ma hita patimbulhon goarna i.",
			"5": "<sup>5</sup> Hulului do Jahowa, jadi dialusi ahu, jala dipalua ahu sian angka hagogotanku sudena.",
			"6": "<sup>6</sup> Sai manatapnatap nasida tu Ibana, jadi sihar ma panailinasida, jala na so tupa tarila bohinasida i.",
			"7": "<sup>7</sup> Joujou do na dangol on, gabe ditangihon Jahowa, jala dipalua do ibana sian hagogotanna sudena.",
			"8": "<sup>8</sup> Marsaro do suruan ni Jahowa humaliang angka na mangkabiari Ibana, jala dipalua nasida.",
			"9": "<sup>9</sup> * Dai jala ida hamu denggan basa ni Jahowa, + martua ma baoa na marhaposan tu Ibana.",
			"10": "<sup>10</sup> Habiari ma Jahowa, hamu ale angka na badiana! * Ai ndang hurangan angka na mangkabiari Ibana.",
			"11": "<sup>11</sup> Anturaparon jala haleon on do angka anak ni singa, alai ndang hurangan di nasa na denggan angka na mangalului Jahowa. II.",
			"12": "<sup>12</sup> * Ro ma hamu, ale angka anaha, manangihon hatangkon, asa + huajarhon tu hamu parture ni biar mida Jahowa.",
			"13": "<sup>13</sup> Ise do baoa na mangkalomohon hangoluan on, mangkaholongi ariari marnida na denggan.",
			"14": "<sup>14</sup> Sai jaga ma dilam maradophon hajahaton, jala bibirmu maradophon pangkuling sipaotooto.",
			"15": "<sup>15</sup> Sumurut ma ho sian hajahaton, jala ulahon na denggan, lulu i hasonangan jala pareak ma i.",
			"16": "<sup>16</sup> Sai manatap do mata ni Jahowa tu angka partigor, jala pinggolna tu angguknasida.",
			"17": "<sup>17</sup> Matua alo ni angka sibahen na jat do bohi ni Jahowa, asa * disiaphon sian tano on baritanasida i.",
			"18": "<sup>18</sup> Mangangguhi do angka partigor, gabe ditangihon Jahowa do, jala dipalua nasida sian hagogotannasida sudena.",
			"19": "<sup>19</sup> Donok do Jahowa di angka na bojok marroha, jala ditumpahi do angka na pogos tondi.",
			"20": "<sup>20</sup> Lan pe parniahapan ni partigor, alai dipalua Jahowa do ibana sian sudena i.",
			"21": "<sup>21</sup> Ibana mangaramoti holiholina sudena, ndang maponggol nanggo sada.",
			"22": "<sup>22</sup> Sai hamatehonon ni parjahat do hajahaton, jala sai marutang do sogot angka na mangkosom partigor.",
			"23": "<sup>23</sup> Ditobus Jahowa do hosa ni angka naposona, jala ndang marutang sogot sude na marhaposan tu Ibana."
		},
		"35": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Badai, ale Jahowa, angka na mambadai ahu, musu i angka na mamusui ahu.",
			"2": "<sup>2</sup> Sintak ma lombulombu na bidang dohot na metmet, jala hehe ma Ho mangurupi ahu.",
			"3": "<sup>3</sup> Hitir i ma hujur, jala ambat angka na mangalele ahu, dok ma tu rohangku: Ahu do hatuaonmi.",
			"4": "<sup>4</sup> Ingkon maila jala murak ma nian sogot angka na mangalotongi hosangki, sai sumurut tu pudi jala tarjimput ma angka na marsangkapi hamagoanku.",
			"5": "<sup>5</sup> Ingkon sobokkon rapanrapan ma nasida maradophon alogo, jala suruan ni Jahowa ma mamonsa nasida.",
			"6": "<sup>6</sup> Sai gabe haholomon dohot hamororon ma dalannasida i, jala suruan ni Jahowa mangalotongi nasida.",
			"7": "<sup>7</sup> Ai * buni do ditaon nasida jorgongna dompak ahu soada alana, ** dihali do sada godung padapot hosangku nian, + soada alana.",
			"8": "<sup>8</sup> Sai ro ma tu ibana hadodobur, so pangkirimanna, jala * jorgongna, na tinaonna i buni padapot ibana, mardobur ma ibana tubagasan.",
			"9": "<sup>9</sup> Asa marolopolop rohangku mida Jahowa, jala marhinsa mida hatuaon na sian Ibana.",
			"10": "<sup>10</sup> Ingkon sude angka holiholingku mandok: Ale Jahowa, * ise ma songon Ho, na paluahon na dangol sian na gumogo sian ibana, nang na dangol dohot na pogos sian na mandobo ibana!",
			"11": "<sup>11</sup> * Hehe do angka sitindangi hajahaton, + na so hupabotoboto do diusousoi tu ahu.",
			"12": "<sup>12</sup> * Najat do dibahen nasida tu ahu balos ni na denggan; tarduru do hosangku dibahen.",
			"13": "<sup>13</sup> Ianggo ahu nian, hori do abithu * jumpa marsahit nasida, hupapeak do rohangku marpuasa, jala mulak tu ampuanku do tangiangku.",
			"14": "<sup>14</sup> Sobokkon aleale, sobokkon dahahang ibana pangalahongku hubahen, tungki jala donda do pangalangkangku, songon na marhinamagohon ina.",
			"15": "<sup>15</sup> Hape marlas ni roha jala marpungupungu do nasida di hadadapothon, marpungupungu pallampusung, angka na so hutanda tumahi ahu, sai marlesanlesan do nasida, ndang marpansohotan.",
			"16": "<sup>16</sup> Udur do nasida dohot angka simanggoanggo patungoripon dompak ahu. II.",
			"17": "<sup>17</sup> Ale Tuhan, sadia leleng on do paidaidaonmu? Sai paulak ma hosangku sian hamagoan binahennasida, sian anak ni singa * hosangku na tarpunjung.",
			"18": "<sup>18</sup> Pujionku ma Ho di luhutan na balga, jala baritahononku ma Ho di hatorapan.",
			"19": "<sup>19</sup> Sai unang ma marlas ni roha angka musungku pangansi mida ahu, * angka na mangkasomorhon ahu, soada dalanna, + angka na masihidopan.",
			"20": "<sup>20</sup> Ai ndada hadameon dihatahata nasida, sai ditubutubui do hata sipaotooto dompak angka partobok isi ni tano i.",
			"21": "<sup>21</sup> Jala sai dipangangang do babanasida dompak ahu, angka ninna do: E, debai, e, debai! Ndi nunga tung huida hami!",
			"22": "<sup>22</sup> Diida Ho do i, ale Jahowa, unang sai sip Ho! Unang mandaodao Ho sian ahu, ale Tuhan!",
			"23": "<sup>23</sup> Sai ngot ma Ho jala tarsunggul mangaluluhon uhum di ahu di parbadaankon, ale Debatangku jala Tuhanku.",
			"24": "<sup>24</sup> Sai uhumi ma ahu hombar tu hatigoranmu, ale Jahowa, Debatangku, asa unang marlas ni roha nasida mida ahu.",
			"25": "<sup>25</sup> Asa unang angka didok di bagasan rohanasida: E, debai, i ma lomo ni rohanami! Unang tardok nasida; nunga hupolgaki hami ibana.",
			"26": "<sup>26</sup> Ingkon maila ma nian jala murak saluhut angka na mangkalashon hinamagongki, maruloshon * hailaon dohot haurahon ma angka na manggakgak dompak ahu.",
			"27": "<sup>27</sup> Sai marolopolop jala marlas ni roha ma angka na mangkalomohon hatigoranki, angka na tongtong mandok: Timbul do Jahowa, na lomo roha di hasonangan ni naposona!",
			"28": "<sup>28</sup> Jala sai paboaboaon ni dilangku do hatigoranmi, sipatsipat ni ari pujionna Ho."
		},
		"36": {
			"1": "<sup>1</sup> Ende sian si Daud, naposo ni Jahowa. I.",
			"2": "<sup>2</sup> Di bagasan rohangku do pangkuling ni pangalaosion tu parjahat i: Ndang marhabiaran tu Debata rohana.",
			"3": "<sup>3</sup> Laos i do mangela ibana paimpolimpol matana mangulahon hajahatonna, sunisunian i.",
			"4": "<sup>4</sup> Getegete dohot pangansion do hatahata ni pamanganna, nunga mansadi ibana mamingkiri mangulahon na denggan.",
			"5": "<sup>5</sup> Getegete nama dipingkiri di atas podomanna i, dalan na so ture i nama ditopot, ndang be dihabiashon najat i. II.",
			"6": "<sup>6</sup> * Tolhas ro di langit do angka asi ni roham, ale Jahowa, tolhas ro di angka ombun do hasintonganmu.",
			"7": "<sup>7</sup> Sobokkon angka * dolok ni Debata do hatigoranmu, doshon + aek na sumar do angka panguhummu, diparmudu Ho do jolma dohot pinahan ale Jahowa.",
			"8": "<sup>8</sup> Tung na arga situtu do asi ni roham, ale Debata! Jadi marhaporusan di * parlinggoman ni habongmu do angka anak ni jolma.",
			"9": "<sup>9</sup> Dihamahaphon nasida do tabotabo ni bagasmu, jala dipainumhon Ho do tu nasida sian batang aek ni angka hahinsaonmi Edenmi.",
			"10": "<sup>10</sup> Ai di lambungmi do * mual hangoluan, di bagasan + hatiuronmi huida hami hatiuron.",
			"11": "<sup>11</sup> Sai panene ma asi ni roham tu angka * na tumanda Ho jala hatigoranmu tu angka na unjur marroha.",
			"12": "<sup>12</sup> Sai unang ditunjang tot ni haginjangon ahu, jala sai unang dilotongi tangan ni angka parjahat i ahu.",
			"13": "<sup>13</sup> Marragean ma disi angka siulahon hajahaton, diompashon do nasida, jadi ndang tarbahen nasida be hehe."
		},
		"37": {
			"1": "<sup>1</sup> Ende sian si Daud. Sai unang ma mohop ateatem mida angka parjahat i, jala unang mangiburu Ho mida angka siulahon hajungkingon.",
			"2": "<sup>2</sup> Ai doras do nasida sabion songon duhutduhut, jala marmalosan nasida songon tumbur ni duhutduhut.",
			"3": "<sup>3</sup> Sai marhaposan tu Jahowa ma ho jala ulahon na denggan; inganhon ma tano i jala radoti haburjuon.",
			"4": "<sup>4</sup> Jala halomohon Jahowa, jadi lehononna ma tu ho pinangido ni roham.",
			"5": "<sup>5</sup> Pasahat ma dalanmu tu Jahowa jala haposi Ibana, asa Ibana paturehon.",
			"6": "<sup>6</sup> Jadi paulloponna ma hatigoranmu, songon hatiuron dohot hapintoronmi songon tingkos ni ari.",
			"7": "<sup>7</sup> * Pasombu ma Jahowa, jala Ibana paimaima; sai + unang mohop roham mida jolma na mardohar dalanna, mida baoa siulahon getegete.",
			"8": "<sup>8</sup> Otapi rimas jala tadingkon mohopmohop; unang sai hamohophon tu roham, ai laho tu najat do i.",
			"9": "<sup>9</sup> Ai sai na siap do sogot angka parjahat i, alai sai na * teanon ni angka na mangkaposi Jahowa do tano i sogot.",
			"10": "<sup>10</sup> Tongkinnari ndang disi be parjahat i, jala ia ditingkir ho ingananna, ndang be jumpang.",
			"11": "<sup>11</sup> Alai sai na teanon ni angka parlambohi do sogot tano i, jala hahilashononna hinadeak ni hadameon.",
			"12": "<sup>12</sup> Sai ditahii parjahat i do partigor i jala * dipaturonsiti iponna dompak ibana.",
			"13": "<sup>13</sup> Alai * diengkelengkel Tuhan i do ibana, ai diida do + haroro ni arina.",
			"14": "<sup>14</sup> Diumpat angka parjahat i do podang jala disintak siornasida i pagadaphon na dangol dohot na pogos * mamotongi angka na burju marpangalaho.",
			"15": "<sup>15</sup> Hape ateatenasida sandiri do * ditopot podangnasida i, jala angka + ponggol do siornasida i.",
			"16": "<sup>16</sup> Tagonan do na otik pineop ni partigor sian hamoraon jong ni torop angka parjahat.",
			"17": "<sup>17</sup> Ai angka ripuk do sogot botohon ni angka parjahat i, alai ditungkol Jahowa do angka partigor i.",
			"18": "<sup>18</sup> Diboto Jahowa do angka ari ni parlidang i, jala saleleng ni lelengna do teanteanonnasida.",
			"19": "<sup>19</sup> Ndang tagamon murak nasida di tingki hagogotan, jala sai butong do nasida di hamamasa ni haleon.",
			"20": "<sup>20</sup> Ai sai na siap do sogot angka parjahat i, jala sobokkon hajagaron ni ladang do angka musu ni Jahowa, sai * na gabe timus do nasida muse.",
			"21": "<sup>21</sup> Marsali do parjahat i, hape ndang digarar; alai marasi roha jala mardenggan basa ianggo partigor i.",
			"22": "<sup>22</sup> Ai angka na tinumpakna i do * tumean tano i sogot, jala sai na siap do sogot angka + na tinoruanna i.",
			"23": "<sup>23</sup> Jahowa do pahothon langkalangka ni baoa, jala dihalomohon do dalanna i.",
			"24": "<sup>24</sup> Tinggang pe ibana, ndada laos sarat, ai ditungkol Jahowa do tanganna.",
			"25": "<sup>25</sup> Dakdanak ahu jolo, nunga pola matua ahu, ndang dung dope huida tartading partigor manang mangidoido sipanganon pinomparna i.",
			"26": "<sup>26</sup> Sai mardenggan basa do ibana jala pasalihonsa ganup ari, jadi parhitean ni pasupasu do pinomparna i.",
			"27": "<sup>27</sup> Sumurut ma ho sian najat i, jala ulahon na denggan, asa maringanan ho salelenglelengna.",
			"28": "<sup>28</sup> Ai holong do roha ni Jahowa mida uhum jala ndang tagamon tadingkononna angka na niasianna; sai ramotanna do nasida salelenglelengna, alai anggo pinompar ni angka parjahat i siap do sogot.",
			"29": "<sup>29</sup> Teanon ni angka partigor i do sogot tano i, jala tongtong do nasida maringanan disi.",
			"30": "<sup>30</sup> Mamodahon habisuhon do pamangan ni partigor i, jala mangkatahon uhum do dilanai.",
			"31": "<sup>31</sup> Dipeop rohana do patik ni Debatana, ndang tagamon humordit angka langkana i.",
			"32": "<sup>32</sup> Sai mangonggop do parjahat dompak partigor i, naeng bunuonna ibana ditahi rohana.",
			"33": "<sup>33</sup> Alai ndang tagamon lehonon ni Jahowa ibana tu tanganna, manang tung toruanna ibana, di na hona uhum ibana.",
			"34": "<sup>34</sup> Haposi ma Jahowa jala paihutihut dalanna i, jadi patimbulonna ma ho tumean tano i, idaidaonmu ma hasisiap ni angka parjahat.",
			"35": "<sup>35</sup> Huida ma sada parjahat na sumalin jala manurumbun ibana songon hau na rugun di hatubuanna.",
			"36": "<sup>36</sup> Jadi mamolus iba, hape ndang disi be; pola do hulului ibana, hape ndang jumpang.",
			"37": "<sup>37</sup> Sai matahon na lidang i jala bereng na tigor i, ai sai hadameon do ujung ni halak sisongon i.",
			"38": "<sup>38</sup> Alai sai siap do sogot angka pangalaosi sudena, pinompar ni angka parjahat pe siap do.",
			"39": "<sup>39</sup> Sian Jahowa do ianggo hatuaon ni angka partigor, Ibana do partanobatoannasida di tingki hagogotan.",
			"40": "<sup>40</sup> Ditumpak jala * dipalua Jahowa do nasida dipalua do nasida sian angka parjahat i, jala ditumpahi nasida, ai marhaposan tu ibana do nasida."
		},
		"38": {
			"1": "<sup>1</sup> Ende sipaingot sian si Daud.",
			"2": "<sup>2</sup> Ale Jahowa, unang ahu pinsang di bagasan rimasmu, jala unang ajari ahu di parpiarpiar ni murukmu.",
			"3": "<sup>3</sup> Ai nunga * pantik tu ahu angka sumbiam, jala + didondoni tanganmu ahu.",
			"4": "<sup>4</sup> Ndang adong be na hisar di dagingku binahen ni rimasmu, ndang be marhasonangan holiholingku dibahen dosangku.",
			"5": "<sup>5</sup> Ai disalpui angka dosangki do ulungku, madokdokhu do angka huhilala, songon siboanon na dokdok situtu.",
			"6": "<sup>6</sup> Nunga pola bau jala malala angka barongki dibahen otongku.",
			"7": "<sup>7</sup> Puhung jala tungki situtu do ahu, sai martujungtujung do ahu mardalan manipat ari.",
			"8": "<sup>8</sup> Ai gok gara do huhilala angka haehaengku, jala ndang adong be na hisar di dagingku.",
			"9": "<sup>9</sup> Jogal jala lampot situtu do dagingku huhilala, sai mangangguk badar do ahu dibahen ponjot ni rohangku.",
			"10": "<sup>10</sup> Iale Tuhan, peak di jolom do sude na pinangido ni rohangku, jala ndang buni sian Ho parhoingki.",
			"11": "<sup>11</sup> Sai mulbahulbak do pusupusungku, ndang margogo be ahu, jala hatiuron ni matangku pe ndang disi be.",
			"12": "<sup>12</sup> Sai * mandaodao do jongjong angka na marhamaolhon ahu, angka donganku pe ro di angka na solhot tu ahu marnida parniahapanku.",
			"13": "<sup>13</sup> Jala bostang do ditaon angka na tumahi hosangku, jala sai patahitahi parhilangon do angka na mangalului hamagoanku, jala pangansion do dipahatahata ganup ari.",
			"14": "<sup>14</sup> Alai songon halak na nengel do ianggo ahu, ndang hupatangitangi, jala songon halak na ngungu, na so pabuha pamanganna.",
			"15": "<sup>15</sup> Jala songon halak na so marbinege do ahu, jala na so marpaminsang pamanganna.",
			"16": "<sup>16</sup> Ai marhaposan tu Ho do ahu, ale Jahowa, sai Ho ma mangalusi, ale Tuhan Debatangku.",
			"17": "<sup>17</sup> Ai ninna rohangku do: Sai unang ma marlas ni roha nasida mida ahu, nasida angka na mangunteas dompak ahu di na tarsulandit i pathu.",
			"18": "<sup>18</sup> Ai naengnaeng tinggang do ahu, jala sai tong sonson di jolongku parniahapanki.",
			"19": "<sup>19</sup> Ai hutopoti do dosangku, jala holsoan ahu ala ni dosangku.",
			"20": "<sup>20</sup> Alai anggo angka musungku haroro ni gogona do, jala torop do nasida angka na mangkosom ahu, soada alana.",
			"21": "<sup>21</sup> Jala dipambahen do na jat balos ni na denggan, jala dimusui do ahu ala na hupareak na denggan i.",
			"22": "<sup>22</sup> Sai unang ma tadingkon ahu, ale Jahowa, Debatangku! Sai unang paholang Ho sian ahu!",
			"23": "<sup>23</sup> Sai hapogani ma mangurupi ahu, ale Tuhan, hatuaonku."
		},
		"39": {
			"1": "<sup>1</sup> Ende sian si Daud siendehonon ni * si Jedutun. I.",
			"2": "<sup>2</sup> Ninna rohangku do: Sai jagaonku do angka pangalahongku maradophon dosa marhite sian dilangku, jagaonku do huntam ni pamanganku, saleleng di jolongku dope parjahat i.",
			"3": "<sup>3</sup> Sai * mangungu do ahu mangkohomhohom, sai sip do ahu maradophon hauntungon, alai sai + gunsang do ianggo parniahapanki.",
			"4": "<sup>4</sup> * Sai mohop do ateatengku di bagasan ahu, lam hupingkiri, lam marjimbur do api, gabe mangkuling ma dilangku:",
			"5": "<sup>5</sup> Sai * pabotohon ma tu ahu, ale Jahowa, ajalhu sogot dohot suhatsuhat ni ariaringku na otik i, asa huboto na gale do ahu hape.",
			"6": "<sup>6</sup> Ida ma, marsasantopap do angka ariaringku dibahen Ho, jala sobokkon soada na ma adamhu di jolom, alogo sambing do sude jolma, nang pe hot jongjong. Sela.",
			"7": "<sup>7</sup> Halinu sambing do jolma i mardalani, alogo sambing do digulutgulut, sai * papunguhon do ibana, hape ndang diboto, manang ise na mangahuti muse. II.",
			"8": "<sup>8</sup> On pe ale Tuhan, aha nama sihaposangku? Marhaposan tu Ho nama ahu.",
			"9": "<sup>9</sup> Sai palua ma ahu sian angka pangalaosingku sudena, unang ahu bahen sieleseleson ni na oto.",
			"10": "<sup>10</sup> Sai hohom nama ahu, ndang hubungka be pamanganku, ai Ho do * mambahensa.",
			"11": "<sup>11</sup> Sai paholang ma sian ahu linsinglinsingmi, nunga pola madamor ahu dibahen pangonai ni tanganmu.",
			"12": "<sup>12</sup> Molo dilinsingkon Ho angka linsinglinsingi tu jolma, ala ni dosa, gabe mabaor ma hinaulina songon pinangan ni ngitngit; alogo sambing do jolma i sudena. Sela.",
			"13": "<sup>13</sup> Sai * tangihon ma tangiangku, ale Jahowa, jala pinggol anggukkon! Unang sai sip Ho mida iluilungku, ai + pardagang do ahu di lambungmi, paisolat songon angka daompung sudena.",
			"14": "<sup>14</sup> Sai padao ma pamerengmu sian ahu, asa hupasihar ahu, tagan so laho dope ahu gabe pidom."
		},
		"40": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Sai tong do huhaposi Jahowa, jadi dipaeleng Ibana dirina tu ahu, jala ditangihon alualungku.",
			"3": "<sup>3</sup> Jala dienet ahu tu ginjang sian * godung halonongan, sian dore na pilhot, jala dipajongjong tothu tu atas ni + dolok batu, marsihohot langkalangkangku dibahen.",
			"4": "<sup>4</sup> Dung i dilehon muse * ende na imbaru tubagasan pamanganku, pujipujian tu Debatanta. Lan do na marnidasa, gabe mabiar nasida, jala marhaposan tu Jahowa.",
			"5": "<sup>5</sup> Martua ma baoa na mambahen Jahowa haposanna, jala na so olo marbalik paihuthon siginjang roha i, angka na paulaula gabus.",
			"6": "<sup>6</sup> Torop do angka halongangan dohot sangkapsangkap dibahen Ho humongkop hami, ale Jahowa, Debatangku, ndang tarpajojor tu Ho, nang pe naeng baritahononku jala paboaonku, ndang tarpajojor tahe dibahen toropna.",
			"7": "<sup>7</sup> Ndang lomo roham di * pelean sipotongon dohot sipanganon, ditura Ho + pinggolhu duansa, ndang dipangido Ho pelean situtungon dohot pardosaon.",
			"8": "<sup>8</sup> Jadi ningku ma: Ida ma, nunga ro ahu mamboan buku, * na sinurat taringot tu ahu.",
			"9": "<sup>9</sup> Dipangido rohangku do patupahon lomo ni roham, ale Debatangku, jala di parsitongaan ni rohangku do patikmi.",
			"10": "<sup>10</sup> Hubaritahon do hatigoran di * luhutan na bolon i; ida ma, ndang + hututup bibirhu, diboto Ho do i, ale Jahowa.",
			"11": "<sup>11</sup> Ndang hutabunihon hatigoranmu di bagasan rohangku; sai hupaboaboa do hasintonganmu dohot hatuaonmi; * ndang huporso asi ni roham dohot habonaronmi tu luhutan na bolon. II.",
			"12": "<sup>12</sup> Ho, ale Jahowa, sai unang polpol angka asi ni roham sian ahu: * Denggan basam dohot habonaronmi ma mangaramoti ahu tongtong.",
			"13": "<sup>13</sup> Ai tuk do humaliang ahu angka parsorion, maradu so habilangan, disoro * angka dosangku do ahu, gabe so malo ahu marnida, + tumorop do angka i sian obuk ni ulungku, jala diparsitadingi rohangku do ahu.",
			"14": "<sup>14</sup> Sai lomo ma roham, ale Jahowa, paluahon ahu! Hapogani ma, ale Jahowa, mangurupi ahu!",
			"15": "<sup>15</sup> Ingkon maila nian jala murak sude angka na paburuburu hosangku laho maniaphon nian. Ingkon sumurut tu pudi jala murak nian angka na mangkalomohon hinamagongki.",
			"16": "<sup>16</sup> Ingkon tarhatotong nian nasida ala ni haurahonnasida i, angka na mandok tu ahu: E, debai! E, debai!",
			"17": "<sup>17</sup> Ingkon marolopolop nian jala marlas ni roha di bagasan Ho sude angka na mangalului Ho, ingkon tongtong ma dohonon ni angka na mangkaholongi hatuaonmi: Timbul do Jahowa!",
			"18": "<sup>18</sup> Dangol pe ahu jala pogos, Tuhan i do sumarihon ahu. Ho do pangurupingku dohot sipalua ahu! Ale Debatangku, sai unang pabenda!"
		},
		"41": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Martua ma halak na manatap uhum tu na soro ni ari on, sai paluaon ni Jahowa do ibana di * ari hinamago.",
			"3": "<sup>3</sup> Ramotan jala pangoluon ni Jahowa do ibana, martua do ibana bahenonna di tano on, jala ndang tagamon lehononmu ibana ripe rupaon ni musuna.",
			"4": "<sup>4</sup> Sandeon ni Jahowa ma ibana di podoman parsahiton, dipahosing Ho do lagena sudena di parsahitonna i. II.",
			"5": "<sup>5</sup> Ianggo ahu ningku do: Asi ma roham di ahu, ale Jahowa, sai pamalum rohangki, ai dompak Ho do ahu mardosa.",
			"6": "<sup>6</sup> Roa do ianggo pandok ni angka musungku tu ahu: Sadihari ma ibana mate, asa pesan nian goarna i?",
			"7": "<sup>7</sup> Jala ia ro ibana mandulo, gabus do dipangkatahatahon; papungupungu hajahaton do rohana di ibana, ruar tu balian ibana, dihatahon ma i.",
			"8": "<sup>8</sup> Masihusipan do sude angka na mangkasomorhon ahu laho tumahi ahu, roa do sangkapnasida dompak ahu.",
			"9": "<sup>9</sup> Dituangkon do tu ibana hata na jahat sahali, jala ndang be tagamon * hehe na peakon.",
			"10": "<sup>10</sup> Gari * bajo hasudungan ni rohangki, na huhaposi, + na manganhon indahanku manandakkon tambihul dompak ahu. III.",
			"11": "<sup>11</sup> Alai anggo Ho, ale Jahowa, sai asi ma roham di ahu, jala pahehe ahu, * asa hubaloshon tu nasida.",
			"12": "<sup>12</sup> Sian i do hutanda lomo ni roham mida ahu: Na so tarbahen i musungku martillahon ahu.",
			"13": "<sup>13</sup> Ianggo ahu, Ho do maniop ahu di * haburjuonku, jala dipajongjong Ho do ahu tu jolo ni bohim salelenglelengna.",
			"14": "<sup>14</sup> Pinuji ma Jahowa, Debata ni Israel olat ni narobi ro di saleleng ni lelengna! Amen, Amen!"
		},
		"42": {
			"1": "<sup>1</sup> Ende sipodaon sian angka anak ni si Kora. I.",
			"2": "<sup>2</sup> Songon pangkalungunhon ni ursa di angka guluan, songon i do pangkalungunhon ni tondingku tu Ho, ale Debata.",
			"3": "<sup>3</sup> Mauas do tondingku * di Debata, ni Debata na mangolu i, andigan pe tolhas ahu, asa huida bohi ni Debata?",
			"4": "<sup>4</sup> Sai iluilungku do sipanganonku arian dohot borngin, ai manipat ari do dipandok tu ahu: * Didia do Debatam?",
			"5": "<sup>5</sup> Molo sapala marningot ahu disi, jadi * use ma huhilala rohangku di bagasan: + Na udur i ahu najolo rap dohot angka natorop manopot bagas ni Debata, huhut marsoara olopolop dohot pujipujian rap dohot angka na laho marari raya.",
			"6": "<sup>6</sup> Boasa sai tungki ho, ale tondingku, jala boasa sai rusak ho di bagasan ahu? Haposi ma Debata, ai sai na pujionku dope Ibana, hatuaon ni bohingku jala Debatangku. II.",
			"7": "<sup>7</sup> Tungki do rohangku di bagasan, dibahen i marningot do ahu di Ho sian luat martopihon Jordan, dohot sian Hermon, sian dolok Misar.",
			"8": "<sup>8</sup> Sai masiharaan do angka sampuran dibahen soara ni hasakmu, sude angka ombakmu dohot galumbangmu manghungkupi ahu.",
			"9": "<sup>9</sup> Alai diparbagabaga Jahowa do asi ni rohana arian, * borngin pe sai mamuji jala martangiang do ahu tu Debata ni hangoluanku.",
			"10": "<sup>10</sup> Jadi ningku do mandok Debata, * partanobatoanki: Boasa tung dihalupahon ho ahu? + Boasa ingkon sai martujungtujung ahu mardalan dibahen pangarsahi ni musu?",
			"11": "<sup>11</sup> Nunga magopu hian holiholingku, lam diinsahi angka musungku do ahu, ai dipandatdati nasida do ganup ari mandok tu ahu: Didia do Debatam?",
			"12": "<sup>12</sup> Boasa sai tungki ho, ale tondingku, jala boasa sai rusak ho di bagasan ahu? Haposi ma Debata, ai sai na pujionku dope Ibana, hatuaon ni bohingku jala Debatangku."
		},
		"43": {
			"1": "<sup>1</sup> III. * Luluhon ahu, ale Debata, jala badahon badangku dompak bangso na so daulat, sai palua ma ahu sian baoa siulahon sipaotooto dohot hajengkelon.",
			"2": "<sup>2</sup> Ai Ho do Debata ni hagogoonku, boasa tung ambolongkononmu ahu? Boasa ingkon sai martujungtujung ahu mardalan binahen ni pangarsahi ni musu?",
			"3": "<sup>3</sup> Tongoshon ma hatoranganmu dohot hatigoranmu, angka na manogu ahu, pataruhon ahu tu dolok ni habadiaonmu dohot tu ingananmu.",
			"4": "<sup>4</sup> Asa tung masuk ahu tu langgatan ni Debata, tu Debata * silas ni rohangku, asa hupuji Ho mardongan parhinaloan, ale Debata, Debatangku tongon.",
			"5": "<sup>5</sup> Boasa sai tungki ho, ale tondingku, jala sai rusak di bagasan ahu? Haposi ma Debata, ai sai na pujionku dope Ibana, hatuaon ni bohingku jala Debatangku."
		},
		"44": {
			"1": "<sup>1</sup> Ende sipaingot sian angka anak ni si Kora. I.",
			"2": "<sup>2</sup> Ale Debata, nunga sar dibege pinggolnami, dipajojor angka ompunami tu hami, pambahenan na binahenmi di ngolunasida, di angka ari na robi.",
			"3": "<sup>3</sup> Dipabali Ho do marhitehite tanganmu angka parbegu asa mangalopokkon ianggo nasida; disiaphon Ho do angka bangso, alai dipararat Ho do ianggo nasida.",
			"4": "<sup>4</sup> Ai ndada marhitehite * podangnasida disoluk nasida tano i, jala ndada botohonnasida mambahen marantu nasida; tangan siamunmi dohot botohonmi dohot hatiuron ni bohim do tahe, ai + dihalomohon Ho do nasida.",
			"5": "<sup>5</sup> Apala Ho sandiri do * rajangku, ale Debata! Sai paborhat ma angka + hatuaon ni si Jakkob.",
			"6": "<sup>6</sup> Mangasahon Ho duguduguhononnami ma angka musunami, mangasahon goarmi luntahonnami ma angka alonami.",
			"7": "<sup>7</sup> Ai ndada siorhu na huhaposi jala ndada podangki pamonang ahu.",
			"8": "<sup>8</sup> Ho do tahe pamonang hami maradophon musunami, Ho do mambahen tarurak angka na mangkasomorhon hami.",
			"9": "<sup>9</sup> Mangasahon Debata hami mamuji manipat ari, jala mandok mauliate hami di goarmi salelenglelengna. Sela! II.",
			"10": "<sup>10</sup> Hape diambolongkon jala dipaurak Ho do hami nuaeng, jala ndang borhat Ho mandongani parangannami.",
			"11": "<sup>11</sup> Dipaundarundar Ho do hami maradophon musu, gabe dipupusi angka na mangkasomorhon hami do hami.",
			"12": "<sup>12</sup> Dilehon Ho hami songon birubiru sipanganon, jala dipaserak Ho do hami tu tongatonga ni angka parbegu.",
			"13": "<sup>13</sup> Diseaseahon Ho do bangsom manggadissa, jala ndang dipanaeknaek Ho asamnasida.",
			"14": "<sup>14</sup> Dibahen ho do hami sieleseleson ni hombar hundulnami, parbilean dohot marhaurahon di angka na humaliang hami.",
			"15": "<sup>15</sup> Dibahen Ho do hami * parumpamaan di tongatonga ni angka parbegu, + paregolegolan ni ulu di tongatonga ni angka bangso.",
			"16": "<sup>16</sup> Sai solpa do di jolongku haurahonku ganup ari, jala hailaon ni bohingku manghungkupi ahu.",
			"17": "<sup>17</sup> Maradophon soara ni pangelesi dohot panginsahi, maradophon musu dohot panuboli. III.",
			"18": "<sup>18</sup> Ro pe sudena i tu hami, laos so huhalupahon hami Ho, jala ndang huose hami padan binahenmu.",
			"19": "<sup>19</sup> Ndang sumurut tu pudi rohanami, jala ndang manimbil langkanami sian dalanmi.",
			"20": "<sup>20</sup> Hape diropuhi Ho do hami di parbueaan, jala dilungkuphon Ho do tu hami linggoman hamatean.",
			"21": "<sup>21</sup> Tung sura huhalupahon hami goar ni Debatanami, jala * hupaherbang hami tangannami tu Debata sileban:",
			"22": "<sup>22</sup> Tung so sisiran ni Debata i? Ai Ibana do tumanda angka sibunian ni roha.",
			"23": "<sup>23</sup> Ai humongkop Ho do umbahen dibunui hami ganup ari, doshon birubiru sipotongon do hami di rohanasida.",
			"24": "<sup>24</sup> Ngot ma Ho! Boasa sai modom Ho, ale Tuhan? Tarsunggul ma Ho, unang ambolongkon hami salelenglelengna.",
			"25": "<sup>25</sup> Boasa tung tabunihononmu bohim, halupahononmu pardangolan dohot hagogotannami?",
			"26": "<sup>26</sup> Ai tungki do rohanami ro di sumanggo, lohot tu tano do butuhanami.",
			"27": "<sup>27</sup> Sai hehe ma Ho mangurupi hami, jala palua hami, ala asi ni roham!"
		},
		"45": {
			"1": "<sup>1</sup> Ende sipaingot sian angka anak ni si Kora, taringot tu holong ni roha. I.",
			"2": "<sup>2</sup> Gurgur do rohangku dibahen hata na denggan ningku do: Rajai do nampuna angka pambahenanki angka endengki, panurat ni na pande manurat do dilangku.",
			"3": "<sup>3</sup> Ummuli do Ho sian angka anak ni jolma, janggaleman do use tu bibirmu, ala ni do umbahen dipasupasu Debata ho salelenglelengna.",
			"4": "<sup>4</sup> Hohoshon ma podangmu tu gontingmu, ale ulubalang, ro di hamuliaonmu dohot hatongamonmu.",
			"5": "<sup>5</sup> Sai marantu ma hamuliaonmu, borhat ma Ho marhureta humongkop hasintongan dohot haserepon ni hatigoran, jadi ajaron ni siamunmu ma Ho mambahen angka halongangan.",
			"6": "<sup>6</sup> * Tajom do angka sumbiami, marraggean ma + angka bangso tu toru ni patmu; ditorusi do angka ateate ni musu ni rajai.",
			"7": "<sup>7</sup> * Ia habangsami ale Debata, hot do ro di salelenglelengna, tungkot hatigoran do tungkot ni harajaonmi.",
			"8": "<sup>8</sup> Dihaholongi Ho do hatigoran, jala dihagigihon roham do hajahaton, ala ni do umbahen dimiakkon Debatam * miak halalas ni roha tu Ho + sumurung sian na tu angka donganmu.",
			"9": "<sup>9</sup> Gota Mir dohot Aloe, Cendana do angka ulosmu sudena las do roham dibahen parhinaloan na piniltihan sian angka * bagas gading. II.",
			"10": "<sup>10</sup> Angka boru ni raja do di tongatonga ni angka haholonganmu, * jongjong di siamunmu do oroan i marpangkean sere sian Opir.",
			"11": "<sup>11</sup> Tangihon, ale boru hasian, ida jala paeleng pinggolmu, jala halupahon bangsomu dohot bagas ni amangmu.",
			"12": "<sup>12</sup> Asa dihalomohon rajai hinaulim, ai Ibana do Tuhanmu jala ingkon marsomba tu Ibana ho.",
			"13": "<sup>13</sup> Dohot do boru Tirus, angka na mora ni bangso i, marhasiholhon bohim mardongan silua.",
			"14": "<sup>14</sup> Marmulia situtu do boru ni rajai di bagasan bilut, na pinunsa dohot sere do pangkeanna.",
			"15": "<sup>15</sup> Marpangkean na niangit do ibana ditogihon tu rajai, angka namarbaju alealena i ihut sian pudina, ditogihon tu Ho.",
			"16": "<sup>16</sup> Marlas ni roha jala marolopolop do nasida ditogihon laho masuk tu bagas ni rajai.",
			"17": "<sup>17</sup> Angka anakmu ma sumingkat amamu, * pabangkitonmu ma nasida gabe pangarajai di liat portibi on.",
			"18": "<sup>18</sup> Sai pujionku do goarmu marsundutsundut, ala ni pujion ni angka bangso ma Ho salelenglelengna."
		},
		"46": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora.",
			"2": "<sup>2</sup> Debata do haporusanta dohot hagogoanta, pangurupion situtu di hagogotan, angka na mangonai tu hita.",
			"3": "<sup>3</sup> Dibahen i ndang mabiar hita, nang pe balik tano on, jala lalolalo angka dolok laho marongrong tu tongatonga ni laut.",
			"4": "<sup>4</sup> Nang pe gasagasaon jala margumogumo angka aekna, pola humuntal angka dolok dibahen pasangnai. Sela!",
			"5": "<sup>5</sup> * Sada batang aek, ro di sungena palas roha ni + huta ni Debata, inganan na badia ni Natumimbul.",
			"6": "<sup>6</sup> Debata do di tongatongana, ndang tagamon humordit, andostorang dope, nunga diurupi Debata ibana.",
			"7": "<sup>7</sup> Guntur pe angka parbegu, lonong angka harajaon, molo mangkuling Ibana, malala do tano on.",
			"8": "<sup>8</sup> * Jahowa Zebaot do donganta, + Debata ni si Jakkob do partanobatoanta. Sela!",
			"9": "<sup>9</sup> * Sai ro ma hamu marnida halongangan angka na binahen ni Jahowa, Ibana mambahen angka panonggoti di tano on.",
			"10": "<sup>10</sup> Ibana do * pasohothon hamusuon ro di ujung ni tano on; Ibana do umponggolhon sior jala ditallihi hujur, dipuruni do angka hureta di bagasan api.",
			"11": "<sup>11</sup> Pasohot hamu ma jala tanda hamu Ahu do Debata, sai timbul do Ahu sogot di tongatonga ni angka bangso, timbul di tano on.",
			"12": "<sup>12</sup> Jahowa Zebaot do donganta, Debata ni si Jakkob do partanobatoanta. Sela!"
		},
		"47": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora.",
			"2": "<sup>2</sup> Martopaptopap tangan ma sude hamu angka bangso! Puji hamu ma Debata mardongan soara olopolop!",
			"3": "<sup>3</sup> Ai Jahowa do na tumimbul, na songkal, Raja bolon do Ibana gumomgom liat portibi on.",
			"4": "<sup>4</sup> Papatuonna do angka bangso tu hita dohot angka marga tu toru ni patta.",
			"5": "<sup>5</sup> Ibana do mamillit di hita pargolatanta, hatimbulon ni si Jakkob, na hinaholonganna i. Sela.",
			"6": "<sup>6</sup> Manaek do Debata mardongan parolopolopon, Jahowa mardongan soara ni sarune.",
			"7": "<sup>7</sup> Sai endehon hamu ma Debata! Sai endehon hamu ma Rajanta i! Endehon ma tutu!",
			"8": "<sup>8</sup> Ai Debata do Raja ni liat portibi on, endehon hamu ma ende sipodaon.",
			"9": "<sup>9</sup> Debata do mangarajai angka parbegu, hundul do Debata di atas habangsa habadiaonna i.",
			"10": "<sup>10</sup> Marpungu do angka na sangap ni angka bangso tu * bangso ni Debata ni si Abraham, ai Debata do nampuna angka + lombulombu raja ni tano on, timbul situtu Ibana."
		},
		"48": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora. I.",
			"2": "<sup>2</sup> Timbul do Jahowa jala pujion situtu di bagasan * huta ni Debatanta, di atas + dolok habadiaonna i.",
			"3": "<sup>3</sup> Denggan do martagahambing, * silas ni roha ni liat portibi on do dolok Sion i, suhi na tungkan utara, + huta ni Raja na timbul i.",
			"4": "<sup>4</sup> Tau partanobatoan do Debata, tartanda di angka bagasnasida.",
			"5": "<sup>5</sup> Ai ida ma, marluhut do angka raja mandapothon.",
			"6": "<sup>6</sup> Hape dung diida nasida, pintor tarhatotong do, mabuk be do nasida maporus.",
			"7": "<sup>7</sup> Angka hitir do nasida disi, mangae songon boruboru na laho mangintubu.",
			"8": "<sup>8</sup> Diropuhi Ho do angka parau Tarsis marhitehite * alogo sian habinsaran.",
			"9": "<sup>9</sup> Suman do tu barita na hubege hami do huida hami di bagasan huta ni Jahowa Zebaot, di bagasan huta ni Debatanta i, sai pahoton ni Debata do i ro di salelenglelengna. Sela. II.",
			"10": "<sup>10</sup> Ditimbang rohanami do, ale Debata, asi ni roham di parsitongaan ni * joromi.",
			"11": "<sup>11</sup> Suman tu goarmu do baritam, ale Debata, ro di ujung ni tano on, gok hatigoran do siamunmi.",
			"12": "<sup>12</sup> Marlas ni roha ma dolok Sion, marolopolop ma angka * boru Juda ala ni panguhummu.",
			"13": "<sup>13</sup> Haliangi hamu ma Sion i jala liati hamu, bilangi hamu ma angka partanobatoanna i.",
			"14": "<sup>14</sup> Tangkasi hamu ma parikna i, sigati hamu ma angka bagasna i, asa tarpajojor hamu tu pinomparmu sogot.",
			"15": "<sup>15</sup> Paboa Debata on do Debatanta ro di salelenglelengna, Ibana * manogu hita ro di hamatean."
		},
		"49": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora.",
			"2": "<sup>2</sup> Tangihon ma on, sude hamu angka bangso, tarehon ma pinggolmu, sude hamu pangisi ni hasiangan on.",
			"3": "<sup>3</sup> Nang hamu situan natorop, nang raja, ro di na mora dohot na pogos!",
			"4": "<sup>4</sup> Hatahonon ni pamanganku ma habisuhon, jala hapistaran do pingkiran ni rohangku.",
			"5": "<sup>5</sup> Paelengonku ma pinggolhu tu umpama, papataronku ma * hulingkulinganku mardongan parhinaloan.",
			"6": "<sup>6</sup> Boasa ma tung tahuton ahu di * angka ari parhinamagoan, di na hinaliangan ni hajengkelon ni angka na mangarupa ahu?",
			"7": "<sup>7</sup> Angka na marhaposan tu sinamotna, jala dihaginjangkon hinagok ni hamoraonnasida.",
			"8": "<sup>8</sup> So manang tartobus manang ise donganna manang tarlehonsa partobusna tu Debata.",
			"9": "<sup>9</sup> Maargahu do partobus ni tondina i, ingkon pasohotonna do salelenglelengna.",
			"10": "<sup>10</sup> Tung mangolu ma ibana ro di salelenglelengna, so idaonna tanoman?",
			"11": "<sup>11</sup> Ingkon idaonna do marmatean angka na bisuk i, rap mago do na oto dohot na londongon, jadi tading di na asing ma sinamotna.",
			"12": "<sup>12</sup> Ianggo rohanasida nian di bagasan: Salelenglelengna do bagasnasida i, inganannasida pe marsundutsundut, goarnasida do dibahen pambuatan ni goar ni angka golat.",
			"13": "<sup>13</sup> Hape ndang mangulon jolma di hadoharonna i * doshon pinahan do nasida diragehon.",
			"14": "<sup>14</sup> I ma pangalaho ni angka na mangasahon haotoonna, dohot angka na mangihuthon nasida, angka na mangkalomohon hatanasida i. Sela!",
			"15": "<sup>15</sup> Sobokkon birubiru do nasida dipabara tu banuatoru, * hamatean do marmahan nasida, jala rajaan ni angka na tigor roha i ma nasida di na sansogot i, turtaran ni banuatoru ma pinangasahonnasida i, gabe ndang adong be + inganannasida.",
			"16": "<sup>16</sup> Alai anggo tondingki, sai * tobuson ni Debata do sian tangan ni banuatorui, ai + jangkononna do ahu. Sela!",
			"17": "<sup>17</sup> Unang ma ho tahuton, molo lam mamora sahalak, molo ganda hamuliaon ni bagasna i.",
			"18": "<sup>18</sup> Ai ndang boanonna sudena i di hamamatena i, ndang ihuthonon ni hamuliaonna i ibana laho tuat.",
			"19": "<sup>19</sup> Ai nang pe diparhatua tondina i di ngoluna jala dipapujipuji halak ho, ala dibahen ho na denggan i tu ho:",
			"20": "<sup>20</sup> Sai topotonna do sundut ni ompuna, angka na so * marnida hatiuron salelenglelengna.",
			"21": "<sup>21</sup> Sobokkon pinahan do rage jolma di hadoharon, molo so marroha ibana."
		},
		"50": {
			"1": "<sup>1</sup> Ende sian si Asap. Mangkuling do Debata Jahowa, jala martingting tu tano on sian habinsaran tolhas ro di hasundutan.",
			"2": "<sup>2</sup> Sian Sion, situan ni hinadenggan marsinondang Debata.",
			"3": "<sup>3</sup> Sai na ro Debatanta, jala ndang tagamon hohom Ibana, di jolona do api mandilatdilat, jala ronggur na gogo situtu humaliang Ibana.",
			"4": "<sup>4</sup> Dipio do angka langit sian ginjang, ro di tano on, asa diuhum bangsona.",
			"5": "<sup>5</sup> * Papungu hamu ma tu Ahu angka na daulat marroha + angka na marpadan dohot Ahu marhitehite pelean.",
			"6": "<sup>6</sup> Jadi dibaritahon angka langit ma hatigoranna, ai apala Debata do panguhum. Sela!",
			"7": "<sup>7</sup> Sai tangihon ma, ale bangsongku, asa mangkuling Ahu: Ho ale Israel, asa huhatindangkon tu ho: * Ahu Debata do Debatam.",
			"8": "<sup>8</sup> Ndada ala ni peleanmi umbahen hupinsang ho, manang ala ni peleanmi situtungon, angka na tongtong di jolongku.",
			"9": "<sup>9</sup> Ndang nian pola sian jabum Ahu mambuat lombu, manang hambing sian angka baram.",
			"10": "<sup>10</sup> Ai guru di Ahu do sude binatang ni harangan, pinahan na marriburibu angka na di dolok pe.",
			"11": "<sup>11</sup> Hutanda do sude pidong angka na di dolok, ro di angka na manggulmit di ladang guru di Ahu do.",
			"12": "<sup>12</sup> Tung sura male Ahu, ndang pola tu ho Ahu mangalualu, ai * guru di Ahu do liat portibi on ro di isina.",
			"13": "<sup>13</sup> Tung panganonku ma juhut horbo tunggal manang inumonku mudar ni angka hambing?",
			"14": "<sup>14</sup> * Pelehon ma tu Debata hamauliateon, jala + garari ma angka bagabagami tu Natumimbul.",
			"15": "<sup>15</sup> Jala jou ma Ahu jumpa di ari hagogotan, asa hupalua ho, asa dipuji ho Ahu.",
			"16": "<sup>16</sup> Alai anggo tu parjahat i ninna Debata do: Boasa tung hum ho jumamitahon angka patikki, jala leap di bagasan pamanganmu padan na hubahen i?",
			"17": "<sup>17</sup> Hape * dihagigihon roham do sipaingot, jala + ditundalhon ho do angka hatangki.",
			"18": "<sup>18</sup> Ia adong diida ho panangko, laos * lomo do roham mandongani ibana, jala + satahi do ho dohot angka pangalangkup.",
			"19": "<sup>19</sup> Dipasombu ho do roharoha ni pamanganmu mandok najat dohot dilam mandandani sipaotooto.",
			"20": "<sup>20</sup> Sai hundulhundul do ho pahatahata donganmu, sai disuan ho do gasa tu anak ni inangmu.",
			"21": "<sup>21</sup> Sai songon i do dibahen ho, jala sai * sip do Ahu, jadi ninna roham ma tudoshon ho do Ahu. Sai pinsangonku do ho tahe, jala rujionku do apala di jolo ni matam.",
			"22": "<sup>22</sup> Sai timbang ma i hamu, ale angka na mangkalupahon Debata, asa unang sanga * husoro hamu, soadadong na paluahon.",
			"23": "<sup>23</sup> Manang ise na mamelehon hamauliateon, i do na pasangap Ahu, jala mambahen lapang, asa hupatuduhon di ibana * hatuaon ni Debata."
		},
		"51": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Uju na ro panurirang si Natan manopot ibana, dung diparjolma Nai Batseba. I.",
			"3": "<sup>3</sup> Asi ma roham di ahu, ale Debata, hombar tu denggan ni basam, sai sesa ma angka pangalaosingku hombar tu godang ni asi ni roham.",
			"4": "<sup>4</sup> Ias situtu ma ahu buri sian hajahatonku, jala paias ma ahu sian dosangku.",
			"5": "<sup>5</sup> Ai nunga huboto angka pangalaosingku, jala sai tong do sonson di jolongku dosangku.",
			"6": "<sup>6</sup> Dompak Ho sambing do ahu mardosa, jala * najat situtu do di matam na huulahon, asa tung + bonar Ho di bagasan pandohanmu, pita di bagasan panguhummu.",
			"7": "<sup>7</sup> Tongon do di bagasan hajahaton do ahu tubu, jala di bagasan dosa dijangkon dainang ahu.",
			"8": "<sup>8</sup> Sintong ni roha di bagasan do tongon lomo ni roham, antong pabotohon ma * habisuhon tubagasan rohangku.",
			"9": "<sup>9</sup> Sai urasi ma ahu sian dosangku marhitehite * sanggul, asa tung ias ahu; sai buri ma ahu, asa + sumaksak ahu sian itak.",
			"10": "<sup>10</sup> Sai patubegehon ma tu ahu hasonangan dohot las ni roha, asa marolopolop holiholi, angka naung ginopuanmu.",
			"11": "<sup>11</sup> Sai hungkupi ma bohim mida angka dosangki, jala sesa ma angka hajahatonku sudena. II.",
			"12": "<sup>12</sup> Tompa ma roha na ias di bagasan ahu, ale Debata, jala paimbaru ma tondi na marsihohot di bagasan ahu.",
			"13": "<sup>13</sup> Sai unang pabali ahu sian jolom, jala unang unsati tondim na badia i sian ahu.",
			"14": "<sup>14</sup> Sai pasuang ma tu ahu halalas ni hatuaonmu, jala togu ma ahu marhitehite tondi ni haringgason.",
			"15": "<sup>15</sup> Asa huajarhon * angka dalanmu tu angka parjahat, asa mulak angka pardosa tu Ho.",
			"16": "<sup>16</sup> Sai palua ma ahu sian angka * parsapataon mudar, ale Debata, Debata ni hatuaonku, asa dipuji dilangku + hatigoranmu.",
			"17": "<sup>17</sup> Sai pabuha ma bibirhu, ale Tuhan, asa dibaritahon pamanganku pujipujianmu.",
			"18": "<sup>18</sup> Ai ndang dihalomohon roham pelean sipanganon, sai na lehononku do nian, jala ndang lomo roham di pelean situtungon.",
			"19": "<sup>19</sup> Angka pelean tu Debata: I ma tondi na magopu, tongon do roha na magopu dohot na bojok, ndang ditulakkon roham, ale Debata.",
			"20": "<sup>20</sup> Sai bahen ma na denggan tu Sion marningot denggan ni basam, sai pauli ma angka parik ni Jerusalem.",
			"21": "<sup>21</sup> Dung i disi ma halomohononmu * angka pelean hatigoran, pelean situtungon dohot ** pelean na sun denggan, disi ma pelehononhon + angka lombu di atas langgatanmu."
		},
		"52": {
			"1": "<sup>1</sup> Ende sipodaon sian si Daud.",
			"2": "<sup>2</sup> Di na ro i si Doeg, halak Edom i, mangalualuhon tu si Saul paboahon tu ibana: Nunga dibongoti si Daud jabu ni si Ahimelek.",
			"3": "<sup>3</sup> Boasa manenganenga dirim di bagasan hajahaton, * ho ale ulubalang? Manipat ari do ianggo asi ni roha ni Debata.",
			"4": "<sup>4</sup> Hamagoan do ditahitahi dilam, ho ale siulahon sipaotooto, sobokkon raut parnabung.",
			"5": "<sup>5</sup> Godangan do dihaholongi roham najat asa na denggan gabus sian na mandok hatigoran. Sela!",
			"6": "<sup>6</sup> Dihaholongi roham nasa hata simangan mangere laho mangago, ale dila pangansi!",
			"7": "<sup>7</sup> Antong, ho pe siaphonon ni Debata do ro di salelenglelengna, tangkuponna ma ho manaratnarat ho sian undungundung, jala uratanna ma ho sian tano hangoluan i. Sela!",
			"8": "<sup>8</sup> Jadi idaon ni angka partigor ma i, gabe mabiar nasida jala engkelengkelonnasida ma ibana:",
			"9": "<sup>9</sup> Ida ma, indi bajoi, na so mambahen Debata partanobatoanna, jala * marhaposan tu hinadeak ni hamoraonna, hajengkelonna do dipangasahon.",
			"10": "<sup>10</sup> Alai anggo ahu, sobokkon hau jetun na rata do di bagasan bagas ni Debata, asi ni roha ni Debata do na huhaposi ro di salelenglelengna.",
			"11": "<sup>11</sup> Sai pujionku do Ho ro di salelenglelengna, ai * Ho do sibahensa, jala sai parhanalomonku do goarmu, ai + haleaon do i maradophon angka na niasianmu."
		},
		"53": {
			"1": "<sup>1</sup> Ende sipodaon sian si Daud. I.",
			"2": "<sup>2</sup> Ninna na oto i do di bagasan rohana: Ndang adong Debata; jahat jala sogir do nasida marpangalahohon hajahaton, ndang adong siulahon na denggan.",
			"3": "<sup>3</sup> Manatap manonggor Debata sian banua ginjang, marnida jolma manisia, manang na adong na marroha, na usouso di Debata.",
			"4": "<sup>4</sup> Alai tung saluhut do nasida sumurut tu pudi, tung sange do nasida marroha mago: Ndang adong siulahon na denggan, nanggo sahalak.",
			"5": "<sup>5</sup> Tung na so mananda do ulaning angka siulahon hajahaton, angka na manganhon bangsongku, songon na mangan roti? Ia Debata ndang dijou nasida. II.",
			"6": "<sup>6</sup> Alai * tarsonggot situtu do nasida disi sogot, nang so adong habiaran; ai paserahon ni Debata do holiholi ni na tumungkum ho; + tarurak do nasida bahenonmu, ai nunga diambolongkon Debata nasida.",
			"7": "<sup>7</sup> Ise do ulaning sian Sion mangalehon hatuaon di Israel? Molo mulak sogot boanon ni Debata angka na tarbuang sian bangsona, marolopolop ma Jakkob jala marlas ni roha ma Israel."
		},
		"54": {
			"1": "<sup>1</sup> Ende sipodaon sian si Daud.",
			"2": "<sup>2</sup> Di na ro i pangisi ni Sip, angka na mandok tu si Saul: Nda di lambungnami do martabuni si Daud?",
			"3": "<sup>3</sup> Sai tumpahi ma ahu, ale Debata, marhitehite goarmu, jala * pasintong uhum di ahu marhitehite hagogoonmu.",
			"4": "<sup>4</sup> Sai tangihon ma tangiangki, ale Debata, paeleng ma pinggolmu, tumangi pangkataion ni pamanganku.",
			"5": "<sup>5</sup> Ai halak na pulik marga do hehe mangalo ahu, jala angka sibahen gogo mangiran hosangki, ndang dibahen nasida Debata tu jolonasida i. Sela!",
			"6": "<sup>6</sup> Ida ma Debata do situmpak ahu, Tuhan i do di tongatonga ni angka sitiopi hosangki.",
			"7": "<sup>7</sup> Pasuangonna do najat i tu angka na manosak ahu, sai siaphon ma nasida marhitehite hasintonganmi.",
			"8": "<sup>8</sup> * Marroha habinsaon ma ahu mamele tu Ho, pujionku ma goarmu, ale Jahowa, ai + haleaon do i.",
			"9": "<sup>9</sup> Ai dipalua do ahu sian nasa hagogotan, jadi * sombu ma matangku marnida angka musungku."
		},
		"55": {
			"1": "<sup>1</sup> Ende sipodaon sian si Daud. I.",
			"2": "<sup>2</sup> Sai tangi ma tangiangku, ale Debata, jala unang martabuni Ho maradophon parhurajaionku.",
			"3": "<sup>3</sup> Tangihon ahu jala alusi ahu, sai monsong do pingkiranku jala marhoi ahu.",
			"4": "<sup>4</sup> Ala ni pangkuling ni musu i, ala ni panosak ni parjahat i; ai sai * manggulang hamagoan do nasida tu ahu, jala marmurukmuruk situtu nasida mangkasomorhon ahu.",
			"5": "<sup>5</sup> Mamalingi do rohangku di bagasan ahu, jala * hasosonggot ni hamatean maninggang ahu.",
			"6": "<sup>6</sup> Dironron habiaran jala panonditnonditon ahu jala dihungkupi hatahuton do ahu.",
			"7": "<sup>7</sup> Jadi ningku ma: Ise ulaning mangalehon tu ahu habong songon darapati! Asa habang ahu jala mangulon manang didia.",
			"8": "<sup>8</sup> Ida ma, dao ma ahu jaur, marmalammalam di halongonan. Sela!",
			"9": "<sup>9</sup> Halaputanku ma haporusan sada di ahu maradophon alogo maruohok, maradophon habahaba.",
			"10": "<sup>10</sup> Siaphon ma nasida ale Tuhan, * bolabola ma dilanasida i! Ai uhum gogo dohot parsalisian huida di bagasan huta i.",
			"11": "<sup>11</sup> Arian dohot borngin diliati nasida pariknasida i, jala hajahaton dohot pardangolan masa di bagasan.",
			"12": "<sup>12</sup> Hajungkaton do di bagasan, jala ndang meret pangarupaon dohot sipaotooto sian onannasida i.",
			"13": "<sup>13</sup> Ai ndada musu na mangelesi ahu, taononku do i nian, ndada parsomor hian di ahu manenganenga dompak ahu, ua martabuni ahu anggo maradophon ibana.",
			"14": "<sup>14</sup> Hape jolma doshon ahu do ho, partogingku jala hasudungan ni rohangku.",
			"15": "<sup>15</sup> Rosu situtu do itabahen paralealeon, * rap mardalan do hita di hatorapan tu bagas ni Debata.",
			"16": "<sup>16</sup> Sai ditompuhon hamatean ma nian nasida, mangolu * songon i ma nian nasida tuat tu banuatoru, ai hajahaton do masa di bagasan inganannasida, di bagasan rohanasida. II.",
			"17": "<sup>17</sup> Ianggo ahu; tu Debata do ahu mangalualu, jadi sai tumpahan ni Jahowa ma ahu.",
			"18": "<sup>18</sup> Bodarina i dohot manogotna i, nang di hos ni ari, sai mangalualu jala mariale ahu, jadi tangihononna ma soarangki.",
			"19": "<sup>19</sup> Mardamedame hosangki ditobus Ibana, asa unang tarhahua nasida ahu, ai torop situtu do nasida mangalo ahu.",
			"20": "<sup>20</sup> Martinangi do Debata, jala pajepolonna do nasida, * jala marhabangsa Ibana sian na robi. Sela! + Nasida na so olo muba, jala na so mangkabiari Debata.",
			"21": "<sup>21</sup> Mangonai do tanganna tu angka alealena, diose do padanna i.",
			"22": "<sup>22</sup> Landitan do hata ni pamangannai sian miak susu, hape parbadaan do ditahi rohana; lumambok do hatahatana sian miak, hape baba ni podang do angka nasida.",
			"23": "<sup>23</sup> Sai tu Jahowa ma pasahat parsorionmi, jadi Ibana ma pangoluhon ho, ndang tagamon loasonna partigor i humasusa ro di salelenglelengna.",
			"24": "<sup>24</sup> Ianggo Ho, ale Debata, pangonjarhononmu do nasida tubagasan godung hamagoan, ndang eahon ni angka jolma sisopsop mudar dohot parjehe ariarinasida * satonga tubu; alai anggo ahu, Ho do na huhaposi."
		},
		"56": {
			"1": "<sup>1</sup> Ende sieheteheton sian si Daud uju na tinangkup ni halak Palistim ibana di huta Gad.",
			"2": "<sup>2</sup> Asi ma roham di ahu, ale Debata, ai * naeng polgahan ni jolma na gale i do ahu, ganup ari disosak musu i ahu.",
			"3": "<sup>3</sup> Ganup ari do naeng polgahan ni angka alongku ahu, ai torop do musu mangalo ahu sian ginjang ni roha.",
			"4": "<sup>4</sup> Di ari hatahutanku, sai tu Ho do ahu marhaposan.",
			"5": "<sup>5</sup> Mangasahon Debata, sai pujionku do hatana, Debata do na huhaposi, ndang tahuton ahu, tung hahuaon ni sibuk ma ahu?",
			"6": "<sup>6</sup> Ganup ari do dipabalikbalik nasida angka hatangku, sai tu najat do pingkirannasida sudena mangalo ahu.",
			"7": "<sup>7</sup> Sai marpungupungu do nasida mangaropi, dihampungi nasida do angka langkalangkangku, songon angka na marbajo hosangki.",
			"8": "<sup>8</sup> Tung dapotan haluaon ma nasida tagamon di hajahatonna i? * Tinggangkon ma angka bangso di bagasan rimas, ale Debata!",
			"9": "<sup>9</sup> Dibilangi Ho do paraotaotanku, sai bahen ma iluilungku tubagasan tabutabumu! Tung so * tarsurat angka i di bagasan bukumu?",
			"10": "<sup>10</sup> Ingkon sumurut tu pudi sogot angka musungku, di ari pangalualuanku; tangkas do huboto on: Debata do mandongani ahu.",
			"11": "<sup>11</sup> Mangasahon Debata, pujionku do hata i, mangasahon Jahowa, pujionku do hata i.",
			"12": "<sup>12</sup> Marhaposan tu Debata do ahu, ndang tahuton ahu, tung hahuaon ni jolma i ahu?",
			"13": "<sup>13</sup> Sai dondon do tu ahu angka bagabaga tu Ho, ale Debata, sai gararonku do tu Ho angka * pelean hamauliateon.",
			"14": "<sup>14</sup> Ai nunga * dipalua Ho dosangku sian hamatean, pathu pe sian partuktuhan, asa marpangalaho ahu di jolo ni Debata, di bagasan + hatiuron ni hangoluan."
		},
		"57": {
			"1": "<sup>1</sup> Ende sieheteheton sian si Daud, di hapoporusna maradophon si Saul tubagasan liang. I.",
			"2": "<sup>2</sup> Sai asi ma roham di ahu, ale Debata, asi ma roham di ahu, ai marhaporusan tu Ho do rohangku, jala di * linggom ni habongmi do ahu marondingonding, paima + salpu parmaraan i.",
			"3": "<sup>3</sup> Sai mangalualu tu Debata na tumimbul i do ahu, tu Debata, siluluhon ahu.",
			"4": "<sup>4</sup> Tongoshononna do sian banua ginjang, asa manumpahi ahu, paurahonna do na naeng mamolgak ahu. Sela! * Tongoshonon ni Debata do asi ni rohana dohot hasintonganna.",
			"5": "<sup>5</sup> Di tongatonga ni angka singa do hosangki, marsaro do ahu di tongatonga ni angka na gara marroha, angka jolma manisia, doshon hujur dohot sumbia do iponnasida, jala doshon podang na tajom do dilanasida i.",
			"6": "<sup>6</sup> Sai patimbul ma dirim, ale Debata, tu atas ni langit, hamuliaonmu, tu sandok tano on.",
			"7": "<sup>7</sup> Nunga ditaon nasida jorgong di langkalangkangku, nunga tarjimput rohangku; nunga dihali nasida di jolongku sada godung, hape nasida sandiri madabu tubagasan. Sela! II.",
			"8": "<sup>8</sup> * Nalom do rohangku, ale Debata, nalom do rohangku, sai marende ma ahu huhut umpalu parhinaloan.",
			"9": "<sup>9</sup> Ngot ma ho, ale saudarangki tondingki, ngot ma ho ale parhinaloan! Tarsunggul ma ahu buha siang ari.",
			"10": "<sup>10</sup> * Pujionku ma Ho, di tongatonga ni angka bangso, ale Tuhan, endehononku ma Ho di tongatonga ni angka marga.",
			"11": "<sup>11</sup> Ai timbul do sahat ro di langit asi ni roham, jala tolhas ro di auangauang do hasintonganmu.",
			"12": "<sup>12</sup> Sai patimbul ma dirim tu atas ni langit, ale Debata, hamuliaonmu tu sandok tano on."
		},
		"58": {
			"1": "<sup>1</sup> Ende sieheteheton sian si Daud. I.",
			"2": "<sup>2</sup> Tung na tutu do ulaning mangkajongjongkon * hatigoran na pinompoman hamu, mandabu uhum hasintongan hamu, + ale anak ni jolma?",
			"3": "<sup>3</sup> Ndangana, lam hageduhan do dipajadijadi rohamuna di bagasan, uhum gogo na niula ni tanganmuna disagihon hamu di tano on.",
			"4": "<sup>4</sup> Sian bortian dope, sai marbalik do angka parjahat i, olat ni dung tubu, sai lilu do angka sidok gabus.",
			"5": "<sup>5</sup> Tudoshon bisa ni ulok do bisanasida i, songon ulok dari na ngungu, na sumongsong pinggolna.",
			"6": "<sup>6</sup> Asa unang dibege soara ni panubuti, angka na pande martabas i. II.",
			"7": "<sup>7</sup> Sai ropangi ma iponnasida di bagasan pamangannasidai, ale Debata, ponggolhon ma ngadol ni angka singa na bajar, ale Jahowa!",
			"8": "<sup>8</sup> Sai * mabaor ma nasida, songon aek na laho moru, ditujuhon pe sumbiana i, hape songon angka na tinamtaman do.",
			"9": "<sup>9</sup> Songon ansisibang na pisar nidege do ibana mago, * songon silumaksaijur ni boruboru, na so sanga mida mata ni ari.",
			"10": "<sup>10</sup> Tagan so dihirimhirim hudonmuna dope sampilpil, nunga dipurpurhon Debata nang na tata nang na masak.",
			"11": "<sup>11</sup> Marlas ni roha ma partigor i sogot, ia dung diida partubolon i, * marsapu mudar ma patna di bagasan mudar ni parjahat i.",
			"12": "<sup>12</sup> Jadi dohonon ni jolma ma: * dapotan laba do hape partigor i, tongon do adong Debata + na manguhum portibi on."
		},
		"59": {
			"1": "<sup>1</sup> Ende sieheteheton sian si Daud, uju disuru si Saul marhal bagasna i naeng mambunu ibana. I.",
			"2": "<sup>2</sup> Sai palua ma ahu sian angka musungku, ale Debatangku, sai bahen ma partanobatoanku maradophon angka alongku.",
			"3": "<sup>3</sup> Sai palua ma ahu sian angka siulahon hajahaton, jala tumpahi ahu maradophon angka halak sisopsop mudar.",
			"4": "<sup>4</sup> Ai ida ma, diarop nasida do hosangku, sai marpungupungu do angka na begu mangalo ahu, so manang adong utangku manang dosangku, ale Jahowa.",
			"5": "<sup>5</sup> Sai marlojongi do nasida jala marhontas, so manang adong hajahatonku; * ngot ma Ho, manjumpangkon ahu jala tatap!",
			"6": "<sup>6</sup> Ngot ma Ho tutu, ale Jahowa Debata Zebaot, Debata ni Israel, maminsang sude angka parbegu i, sai unang ma marpamuati roham mida angka panggetegete sudena. Sela!",
			"7": "<sup>7</sup> Sai mulahulak do nasida bodarina i, mangorongi songon biang mangkaliangi huta i.",
			"8": "<sup>8</sup> Ida ma margumogumo do pamangannasida, mantat podang do bibirnasida i, ai tung ise ma umbegesa?",
			"9": "<sup>9</sup> Alai anggo Ho, ale Jahowa, marengkelengkelihon nasida, dilesanlesan Ho do angka parbegu sudena.",
			"10": "<sup>10</sup> Ale pargogongku, sai Ho do pangasahononku, ai Debata do partanobatoanku.",
			"11": "<sup>11</sup> Sai tomutomuon ni Debatangku do asi ni rohana tu ahu, * sombu ma matangku mida angka alongku bahenon ni Debata. II.",
			"12": "<sup>12</sup> Sai unang tompu bunu nasida, asa unang bangsongku mangkalupahon i, sai paundarundar ma nasida hinorhon ni gogom, dung i * ragehon nasida, ale Tuhan, lombulombunami!",
			"13": "<sup>13</sup> * Dosa ni pamangannasida do hata ni bibirnasida i, sai tardapot ma nasida di haginjangonnasida i, ala ni pamuraion pe dohot gabus, na hinatahonnasida i.",
			"14": "<sup>14</sup> Sai siaphon ma nasida di panombo ni rimasmu, sai siaphon ma, asa pidom nasida, asa diboto nasida Debata do hape panggomgom di Jakkob ro di ujung ni tano on. Sela!",
			"15": "<sup>15</sup> Sai mulahulak do nasida botarina i, mangorongi songon biang, huhut dihaliangi huta i.",
			"16": "<sup>16</sup> Sai maotaot do nasida mangalului sisohalon, molo so mahap nasida, laos marmalam nasida.",
			"17": "<sup>17</sup> Alai anggo ahu, sai endehononku do hagogoonmu jala olophononku do * manogotna i asi ni roham, ai Ho do partanobatoanku jala haporusanku di ari hagogotanku.",
			"18": "<sup>18</sup> Endehononku ma Ho, ale pargogongku, ai Debata do partanobatoanku, Debata parasi roha di ahu."
		},
		"60": {
			"1": "<sup>1</sup> Ende sieheteheton dohot sipodaon sian si Daud.",
			"2": "<sup>2</sup> Uju na marmusu ibana dompak Ram di Mesopotamia dohot dompak Ram Zoba, di na mulak i si Joab, dung ditaluhon halak Edom di rura parsiraan, sampulu dua ribu halak toropna.",
			"3": "<sup>3</sup> Ale Debata, nunga dibolongkon jala dipaserak Ho hami, tarrimas do Ho, sai marpangulahi ma roham tu hami.",
			"4": "<sup>4</sup> Nunga digunsang jala dibola Ho tano on; sai padomu ma bolabolana i, ai nunga lalolalo.",
			"5": "<sup>5</sup> Nunga dipatuduhon Ho na bernit tu bangsom nunga dipainumhon Ho tu hami * anggur hagodoron.",
			"6": "<sup>6</sup> Alai dilehon Ho do muse tu angka na mangkabiari Ho sada * partonggol, pahinsa nasida ala ni hatigoran. Sela!",
			"7": "<sup>7</sup> Asa malua angka na niasianmi, sai manumpak ma siamunmi jala alusi hami!",
			"8": "<sup>8</sup> Nunga * marbagabaga Debata di bagasan habadiaonna i: Ingkon marolopolop ahu, marsagihon Sikem dohot manali rura Sukot.",
			"9": "<sup>9</sup> Ahu do nampuna Gilead jala ahu nampuna Manasse, jala Epraim do partanobatoan ni ulungku, * Juda do tungkot ni harajaonku.",
			"10": "<sup>10</sup> Moab do mangkuk parburianku, tu Edom hureongkon sipatungku, olophon ma ahu ale luat Palistim.",
			"11": "<sup>11</sup> Ise ulaning manogihon ahu tu * huta na gonting i? Ise ulaning pataruhon ahu tolhas ro di Edom?",
			"12": "<sup>12</sup> Nda Ho do, ale Debata, Ho naung mambolongkon hami, jala * na so ruar, ale Debata mandongani parangannami?",
			"13": "<sup>13</sup> Sai patupa ma haluaon di hami sian hagogotan, ai ndang marnosan ianggo pangurupion ni jolma.",
			"14": "<sup>14</sup> Mangasahon Debata sai hamonangan do ulahononta, jala Ibana sandiri mangalotlot alontai."
		},
		"61": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Sai tangihon ma, ale Debata, alualungkon, sai parateatehon tangiangkon!",
			"3": "<sup>3</sup> Sian ujung ni tano on do ahu joujou tu Ho di hagogondok ni rohangkon; sai togihon ma ahu tu atas dolok batu, na so tardongdong anggo ahu.",
			"4": "<sup>4</sup> Ai Ho do haporusanku, partanobatoan na gonting maradophon musu.",
			"5": "<sup>5</sup> Sai loas ma ahu * maringan di bagasan undungundungmi salelenglelengna, sai + marondingonding tu linggom ni habongmi ma ahu. Sela!",
			"6": "<sup>6</sup> Ai ianggo Ho, ale Debata, nunga dibege Ho angka bagabagangku, nunga dilehon Ho tu ahu jambar ni angka na mangkabiari goarmu.",
			"7": "<sup>7</sup> Sai ambai ariari tu ariari ni Rajai, asa marsundutsundut angka taonna i.",
			"8": "<sup>8</sup> Sai * marhabangso ma ibana salelenglelengna di jolo ni Debata, sai padiri ma + asi ni roha dohot hasintongan mangaramoti ibana.",
			"9": "<sup>9</sup> Asa huendehon goarmu salelenglelengna, manggarari angka bagabagangku ganup ari."
		},
		"62": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Tu Debata sambing do marhuraja rohangku, sian Ibana ro hatuaonku.",
			"3": "<sup>3</sup> Holan Ibana do partanobatoanku dohot hatuaonku, haporusanku ndang pola sadia humordit ahu.",
			"4": "<sup>4</sup> Sadia leleng on do hamu martahop dompak sada baoa, tung luhut hamu naeng mangarumpakkon ibana * songon dorpi ni jomba, songon parik na matompas?",
			"5": "<sup>5</sup> Sai martuptup i nasida naeng mangonjarhon ibana sian hatimbulonna i, mangapian di gabus, mamasumasu ia pamanganna, hape mamburai do ianggo rohanasida di bagasan. Sela!",
			"6": "<sup>6</sup> Holan tu Debata ma ho marhuraja, ale tondingki, ai sian Ibana ro sihirimonku.",
			"7": "<sup>7</sup> Holan Ibana do partanobatoanku dohot hatuaonku, haporusanku, ndang tagamon humordit ahu.",
			"8": "<sup>8</sup> Guru di Debata do hatuaonku dohot hamuliaonku, partanobatoan ni hagogoonku, marhaposan tu Debata do ahu.",
			"9": "<sup>9</sup> Sai marhaposan tu Ibana ma tongtong nang hamu, ale dongan jolma! * Usehon hamu ma rohamuna tu jolona, Debata do haposanta. Sela! II.",
			"10": "<sup>10</sup> Hosa sambing do ianggo jolma manisia, gabus do * anak ni baoa nang nasangap, mungkal tu ginjang di bagasan timbangan, sian hosa do nasida luhutna.",
			"11": "<sup>11</sup> Unang ma pangasahon hamu pangarupaon, jala unang haginjangkon hamu na nidobo, * unang ma mangapian rohamuna di gandaganda ni sinamot.",
			"12": "<sup>12</sup> Sahali do mangkuling Debata, dua hali do i hubege: Saguru di Debata do hagogoon.",
			"13": "<sup>13</sup> Jala gok di Ho do, ale Tuhan, asi ni roha, ai dibaloshon Ho do tu ganup jolma hombar tu pambahenanna."
		},
		"63": {
			"1": "<sup>1</sup> Ende sian si Daud, * uju di halongonan Juda ibana.",
			"2": "<sup>2</sup> Ale Debata, Ho do Debatangku, sogot do manogotna i dilului rohangku Ho, * mauas do rohangku di Ho, dihalungunhon nang dagingku Ho di tano na dangaron dohot na uasan, soada aek.",
			"3": "<sup>3</sup> Songon i do panataphu tu Ho di bagasan * bagas na badia i, + naeng marnida hagogoonmu dohot hamuliaonmu.",
			"4": "<sup>4</sup> Ai dengganan do asi ni roham sian hangoluan, sai pujion ni bibirhu ma Ho.",
			"5": "<sup>5</sup> Sai songon i ma pamujingku di Ho * saleleng ahu mangolu, mangasahon goarmu + paherbangonku ma tanganku tu ginjang.",
			"6": "<sup>6</sup> Mahap ma disi tondingku, songon na mangan tabotabo dohot na talmis, jala las roha ni bibir ni pamanganku mamujimuji.",
			"7": "<sup>7</sup> Molo sapala diingot rohangku Ho di atas podomanku, laos torus sabornginna i marhusari ahu taringot tu Ho.",
			"8": "<sup>8</sup> Ai Ho do manjadi pangurupion di ahu, jala tarbahen ahu marolopolop di linggom ni angka habongmu.",
			"9": "<sup>9</sup> Sai lohot tu Ho do rohangku, sai ditiop tanganmu siamun i do ahu.",
			"10": "<sup>10</sup> Alai anggo nasida, angka na mangalului hamagoan ni hosangku, sai tolhas do nasida sogot tu banuatoru.",
			"11": "<sup>11</sup> Sai buaton ni podang do nasida sogot, gabe jambar ni angka gompul do nasida.",
			"12": "<sup>12</sup> Alai ianggo Rajai sai marlas ni roha do mangasahon Debata, sai marolopolop do sude * na marmangmang tu Ibana ai hona huntam do sogot pamangan ni angka sidon gabus."
		},
		"64": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Ale Debata, sai tangihon ma soarangku di alualungkon, sai ramoti ma ngolungkon maradophon hasosonge ni musu.",
			"3": "<sup>3</sup> Sai ondingi ma ahu maradophon partuptupan na buni ni angka parjahat i, maradophon hagunturon ni angka siulahon hajahaton.",
			"4": "<sup>4</sup> Angka na patajom dilanasida songon podang, angka na manujuhon sumbianasida mandok hata na sogir.",
			"5": "<sup>5</sup> Asa * disior na lidang roha i di sibunian, tompu ibana disior, so pangkirimanna, jala ndang maralang rohanasida.",
			"6": "<sup>6</sup> Tung dipirhon nasida do * jat ni tahina i, dipatarhon do laho manabunihon jorgong, + angka ninna do: Tung ise ma marnida angka i?",
			"7": "<sup>7</sup> Sai * angka hajahaton do dipingkiri nasida, marujung do dibahen sangkap piningkiranna i, tung lung na bagas do roha ni baoa i di bagasan. II.",
			"8": "<sup>8</sup> Alai sioron ni Debata do nasida, sumbia so pangkiriman mambugangi nasida.",
			"9": "<sup>9</sup> Tardapot ma nasida dibahen * dilanasida i, + mangupir be do sude na marnida nasida.",
			"10": "<sup>10</sup> Jadi mabiar ma sude manisia, jala dibaritahon pambahen ni Debata, jala diantusi ulaonna i.",
			"11": "<sup>11</sup> Marlas ni roha ma ianggo partigor i mangasahon Jahowa, jala marhaposan tu Ibana, jala mamujimuji ma sude na tigor roha i."
		},
		"65": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> * Ingkon nalom ni roha di Ho do pujipujian, ale Debata di Sion, jala + gararon do tu Ho bagabaga.",
			"3": "<sup>3</sup> Ale sitangihon tangiang! Tu Ho do ro nasa sibuk.",
			"4": "<sup>4</sup> Gumogo do angka alualu ni hajahaton asa ahu, sai Ho ma manesa angka pangalaosionnami.",
			"5": "<sup>5</sup> Martua ma halak na pinillitmi, jala niloasmi dumonok, * manginganhon angka alamanmi! Sai pasabam ma rohanami binahen ni ** hinadenggan ni bagasmu, + jorom na badia i.",
			"6": "<sup>6</sup> Tung na songkal do pangalusim tu hami di bagasan hatigoran, ale Debata ni hatuaonnami, haposan ni saluhut ujung ni tano on dohot laut, angka na dao i.",
			"7": "<sup>7</sup> Ho do sipaojak angka dolok marhitehite gogom, marhohos hagogoon.",
			"8": "<sup>8</sup> Ho do sipaso hasak di angka laut, hasak ni angka galumbangna i dohot ogaoga ni angka bangso.",
			"9": "<sup>9</sup> Jadi mabiar ma angka partopi laut maradophon tanda angka na binahenmi, marolopolop ma dibahen Ho angka parmulaan ni habinsaran dohot hasundutan. II.",
			"10": "<sup>10</sup> Ditingkir Ho do tano on, * jadi sirnip ma, jala gabe situtu. Gok aek do mual ni Debata, manjadi do emenasida dibahen Ho, ai songon on do parpaulim:",
			"11": "<sup>11</sup> Sirnip ma angka baruranna dibahen Ho, jadi buruk ma angka golena; ro muse udan na por, jadi sarge ma, jala dipasupasu Ho do na tubu disi.",
			"12": "<sup>12</sup> Nunga martumpal denggan ni basam partaonan i dibahen Ho, gok miak do angka bogasmi.",
			"13": "<sup>13</sup> Lomak situtu do panjampalan di halongonan, jala marhohos olopolop do angka robean.",
			"14": "<sup>14</sup> Hona tutup do angka panjampalan dibahen birubiru, angka rura pe dibahen eme; marolopolop huhut marende do angka nasida."
		},
		"66": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Marolopolop tu Debata ma, ale sandok tano on!",
			"2": "<sup>2</sup> Endehon hamu ma hamuliaon ni goarna, marmulia bahen hamu pujipujianna!",
			"3": "<sup>3</sup> Dok hamu ma mandok Debata: Tung na songkal do angka pambahenanmu! Binahen ni hinatimbul ni gogom ingkon marsomba tu Ho angka musum.",
			"4": "<sup>4</sup> Ingkon liat portibi on tahe marsomba tu Ho sogot, jala mangendehon Ho, mangendehon goarmu. Sela!",
			"5": "<sup>5</sup> Ro be ma hamu marnida angka pambahenan ni Debata, tung na songkal do pangarajaionna di manisia.",
			"6": "<sup>6</sup> Nunga dipauba Ibana laut i gabe mahiang, mardalan pat do nasida manaripari batang aek i, marlas ni roha do hita uju i mida Ibana.",
			"7": "<sup>7</sup> Matua Ibana mangarajai marhitehite hagogoonna i, sai mangaranapi matana tu angka bangso, asa unang dipaginjang angka panggunturi dirina. Sela! II.",
			"8": "<sup>8</sup> Puji ma Debatanami, hamu ale angka bangso, jala patubegehon hamu ma soara pujipujianna!",
			"9": "<sup>9</sup> Ibana mambahen hosanta mangolu, * jala ndang diloas totta tarsulandit.",
			"10": "<sup>10</sup> Ai nunga diunjuni Ho hami, ale Debata, nunga tung dilala Ho hami songon na mangalala perak.",
			"11": "<sup>11</sup> Nunga ditogu Ho hami tubagasan aring, na dokdok situtu diampehon Ho tu gontingnami.",
			"12": "<sup>12</sup> Nunga diloas Ho * jolma na gale marhureta sian ulunami, nunga masuk hami + tubagasan api dohot aek, alai diparuar Ho do hami, gabe sabam situtu rohanami. III.",
			"13": "<sup>13</sup> Dibahen i masuhangku ma jabum, mamboan angka pelean situtungon, manggarar angka bagabagangku tu Ho.",
			"14": "<sup>14</sup> Angka naung pinapuas ni bibirhon, jala naung pinarbagabaga ni pamangankon, uju hagogotan ahu:",
			"15": "<sup>15</sup> Angka pelean situtungon sian birubiru na tinaruan do pelehononku tu Ho, angkup ni daupa sian hambing ro di lombu dohot birubiru tunggal pelehononku tu Ho. Sela!",
			"16": "<sup>16</sup> Ro be ma mananginangi sude hamu angka na mangkabiari Debata, asa hujamitahon naung binahen ni Debata tu tondingku.",
			"17": "<sup>17</sup> Tu ibana do joujou pamanganku, jala pujipujian mampe tu dilangku.",
			"18": "<sup>18</sup> Tung sura hajahaton ditahi rohangku, ndang tagamon tangihonon ni Tuhan i ahu.",
			"19": "<sup>19</sup> Tongon do, nunga ditangihon Debata ahu, nunga diparateatehon soara ni tangiangku.",
			"20": "<sup>20</sup> Pinuji ma Debata, na so manulakkon tangiangku manang asi ni rohana pe sian ahu."
		},
		"67": {
			"1": "<sup>1</sup> Ende na mardongan parhinaloan sipiltihon.",
			"2": "<sup>2</sup> Ale Debata, sai asi ma roham di hami, jala pasupasu hami, sai marsinondang ma bohim mandongani hita. Sela!",
			"3": "<sup>3</sup> Asa lam marbinoto tano on di dalanmu, diboto angka bangso sudena hatuaonmu.",
			"4": "<sup>4</sup> Ingkon pujion ni angka bangso do Ho sogot, ale Debata, sude angka bangso tutu mamuji Ho.",
			"5": "<sup>5</sup> Marlas ni roha jala marolopolop sogot angka bangso, ala tigor panguhummu di angka bangso, jala ditogu Ho angka marga di tano on. Sela!",
			"6": "<sup>6</sup> Ingkon pujion ni angka bangso Ho sogot, ale Debata, sude do angka bangso tutu mamuji Ho.",
			"7": "<sup>7</sup> Tano on mangalehon gogona; sai pasupasuon ni Debata, Debatanta do hita.",
			"8": "<sup>8</sup> Dipasupasu Debata ma hita jadi * habiaran ni sude ujung ni tano on ma Ibana."
		},
		"68": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Sai hehe ma Debata! Ingkon harhar angka musuna, jala maporus angka na mangkasomorhon Ibana maradophon bohina.",
			"3": "<sup>3</sup> Songon * pangombus di timus do ombushononmu nasida, + songon halalala ni pantis maradophon api, ingkon songon i ma marmagoan angka parjahat maradophon Debata.",
			"4": "<sup>4</sup> Alai sai marlas ni roha ma, marolopolop di jolo ni Debata ianggo angka partigor, sai marhasonangan ma nasida di bagasan las ni roha.",
			"5": "<sup>5</sup> * Endehon hamu ma Debata, puji hamu ma goarna i, + palendes hamu ma dalan di Ibana na marhureta di halongonan, Jahowa do goarna, jala marolopolop ma hamu di jolona.",
			"6": "<sup>6</sup> Ibana do ama ni angka na tading di lampin, jala pangondian ni angka na mabalu, Ibana do Debata di bagasan ingananna na badia i.",
			"7": "<sup>7</sup> Debata do mambahen hot ripe, angka na punjung hian; Ibana paruarhon angka na tarhurung tu hasonangan; alai anggo angka na marbalik maringan di halongonan na tungil situtu. II.",
			"8": "<sup>8</sup> Ale Debata, uju diuluhon Ho bangsom, uju mangalangka Ho, di bagasan * halongonan i: — Sela!",
			"9": "<sup>9</sup> Humuntal do tano on, manetehi huhut angka langit maradophon Debata, nang dolok Sinai adui maradophon Debata, Debata ni Israel.",
			"10": "<sup>10</sup> Udan * lomo ni roha do dipangusehon Ho, ale Debata: Jala + dipargogoi Ho do parjambaranmu na heal i.",
			"11": "<sup>11</sup> Jadi maringan ma disi angka na pinangolum, diparmudu Ho do na dangol i, ale Debata, marhitehite denggan ni basam.",
			"12": "<sup>12</sup> Martingting ma Tuhan i, jadi * torop situtu ma angka boruboru siboan barita na uli.",
			"13": "<sup>13</sup> Hapogan ma angka raja ni angka parduaan parangan maporus, jadi boru siingani jabu marbagihon tabantaban.",
			"14": "<sup>14</sup> Molo mangulon hamu di holangkolang ni angka parduaan, marsinondang do hamu songon habong ni darapati, na nilampis dohot perak, jala marsere na gorsing do holenasida.",
			"15": "<sup>15</sup> Uju dipaserak Pargogo-nasohatudosan angka raja disi, mamontar ma di atas dolok Salmon.",
			"16": "<sup>16</sup> Dolok ni Debata do dolok Basan, gok angka punsu do dolok Basan i.",
			"17": "<sup>17</sup> Boasa sai mangiburu hamu, ale angka dolok na timbo, dompak dolok Sion, na * pinillit ni Debata bahen ingananna? Sai inganan ni Jahowa do i salelenglelengna.",
			"18": "<sup>18</sup> * Marriburibu do hureta ni Debata, di tongatonganasida do Tuhan i, hira Sinai di bagasan habadiaon.",
			"19": "<sup>19</sup> Nunga * manaek Ho tu ginjang, ** ditaban Ho do na hona taban, nunga maruli + silehonlehon Ho di tongatonga ni manisia, nang angka na marbalik, asa maringan disi Debata Jahowa.",
			"20": "<sup>20</sup> Pinuji ma Tuhan i ganup ari! Dokdok pe * dipaporsanhon tu hita, Debata do mangurupi hita. Sela!",
			"21": "<sup>21</sup> Debata ni angka hatuaon do Debatanta i, jala guru di Tuhan Jahowa do angka haluaon sian hamatean.",
			"22": "<sup>22</sup> Tongon do sai rosahan ni Debata do ulu ni angka musuna, ulu parjambulan ni angka na mandatdati marpangalaho di bagasan dosana.",
			"23": "<sup>23</sup> Nunga didok Tuhan i: Mulak do nasida boanonku sian Basan mulak do nasida * sian angka lung ni laut i.",
			"24": "<sup>24</sup> Asa diburi Ho patmu di bagasan mudar, marjambar do dila ni angka biangmu sian angka musu i. III.",
			"25": "<sup>25</sup> Nunga diida nasida * habobongotmu, ale Debata, habobongot ni Debatangku, rajangku tubagasan habadiaonna i.",
			"26": "<sup>26</sup> Mardalan di jolo angka parende, di pudi ni angka parsarune di tongatonga ni na * marbaju, angka na mamalu doal.",
			"27": "<sup>27</sup> Pinuji ma Debata di bagasan angka luhutan; Tuhan i, hamu ale angka na sian * mual ni Israel.",
			"28": "<sup>28</sup> Disi do * si Benjamin siampudan pangarajainasida, angka induk sian Juda pe pasimpar, angka induk sian + Zebulon, angka induk sian Naptali.",
			"29": "<sup>29</sup> Ditonahon Debata do hagogoonmu, sai pargogoi ma, * ale Debata, na pinatupam tu hami!",
			"30": "<sup>30</sup> Ala jorom na di Jerusalem taruhonon ni angka raja do sogot silehonlehon tu Ho.",
			"31": "<sup>31</sup> Sai songgahi ma * buea na di tolongi, angka + jonggi na marhoronhoron rap dohot angka anak ni lombu ni angka bangso, asa dioloi nasida patu mangalehon jomba hahal. Ibana paserakkon bangso, angka na mangkalomohon hamusuon.",
			"32": "<sup>32</sup> Ro do sogot angka na sumangap sian Misir, Kus pe hapogan do marsomba tu Debata.",
			"33": "<sup>33</sup> Hamu ale angka harajaon di tano on, endehon hamu ma Debata, palu hamu ma parhinaloan mamuji Tuhan i! Sela!",
			"34": "<sup>34</sup> Ibana na * marhitehitehon langit ni langitan sian narobi, ida ma, pangiaronna ma soarana, soarana na gogo i.",
			"35": "<sup>35</sup> Sai * lehon hamu ma hahormaton tu Debata! + Hamuliaonna i do gumomgom Israel, jala di angka banua ginjang sahali do hagogoanna!",
			"36": "<sup>36</sup> Songkal do Debata, ro sian ingananna angka na badia i! Debata ni Israel do Ibana, * silehon hagogoon dohot hamuliaon tu bangso i. Pinuji ma Debata!"
		},
		"69": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Sai tumpahi ma ahu, ale Debata, ai nunga sipat ro di hosa angka aek i.",
			"3": "<sup>3</sup> Nunga pola lonong ahu tubagasan gambo lisop, soada hajongjongan, nunga pola tolhas ahu tu lintong laut angka na bagas i, jala dilungkupi galumbang i ahu.",
			"4": "<sup>4</sup> Nunga pola maheu ahu dibahen joujoungki, nunga mahiang aruarungku, nunga pola lotop matangku mangkalungunhon Debatangku.",
			"5": "<sup>5</sup> * Tumorop do sian obuk ni ulungku angka na mangkosom ahu, soada paralaan, angka na gogo be mangago ahu, angka musungku pangalajak; + abulonku do nang na so hudobo.",
			"6": "<sup>6</sup> Ala Debata, Ho do umboto taringot tu haotoanki, jala ndang tarporso angka dosangki maradophon Ho.",
			"7": "<sup>7</sup> Sai unang ma muruk mida ahu angka na mangkaposi Ho, ale Tuhan Jahowa Zebaot, sai unang ma tarila mida ahu angka na mangalului Ho, ale Debata ni Israel!",
			"8": "<sup>8</sup> Ai humongkop Ho do ahu tumaon insahinsak, dihungkupi hailaon bohingku.",
			"9": "<sup>9</sup> Pola banding angka donganku tu ahu, gabe halak na buro di roha ni donganku saina.",
			"10": "<sup>10</sup> Ai * hamuruhon humongkop bagasmu do manganhon ahu, jala taha tu ahu do + reherehe ni angka na mangarehei Ho.",
			"11": "<sup>11</sup> Sai tumatangis do ahu jala tumaon parpuasaon do rohangku, hape manjadi reherehe tu ahu do i.",
			"12": "<sup>12</sup> Hori do hubahen abithu, jadi pambuatan * umpama do ahu dibahen nasida.",
			"13": "<sup>13</sup> Sai dipahatahata angka na hundul di partungkoan i do ahu jala alingalingan ni angka siparmabuk. II.",
			"14": "<sup>14</sup> Alai anggo ahu sai tong do tu Ho tangiangki, ale Jahowa, di * tingki halehetanna; ale Debata, sai alusi ma ahu hombar tu hasintongan ni hatuaonmi ala ni godang ni asi ni roham.",
			"15": "<sup>15</sup> Sai palua ma ahu sian gambo lisop i, asa unang lonong ahu, asa malua ahu sian angka na humosom ahu dohot sian lintong laut angka na bagas i.",
			"16": "<sup>16</sup> Sai unang diaupi galumbang ni aek i ahu, jala unang dibondut pusat i ahu, manang dilungkuphon godung i babana di atas ahu.",
			"17": "<sup>17</sup> Sai alusi ma ahu, ale Jahowa, ai denggan do asi ni roham; sai dompakkon ma ahu hombar tu godang ni asi ni roham.",
			"18": "<sup>18</sup> Sai unang tabunihon bohim maradophon naposomon, ai hagogotan do ahu, hapogani ma mangalusi ahu.",
			"19": "<sup>19</sup> Sai padonok ma Ho tu rohangku paluahonsa, sai palua ma ahu * ala ni angka musungku.",
			"20": "<sup>20</sup> Ianggo Ho, ditanda Ho do hailaonku dohot haurahonku dohot halenjengongku, di jolomi do sude angka alongku.",
			"21": "<sup>21</sup> Haurahon do * manostosi rohangku, gabe matemate ahu marsahit, jala hupaimaima panangisi, hape so adong; dohot angka + pangapuli, hape ndang jumpang ahu.",
			"22": "<sup>22</sup> Lam pogu do dilehon nasida panganonku, jala na asom do dipainumhon tu ahu di hauaski.",
			"23": "<sup>23</sup> Sai gabe jorgong ma mejanasida di jolo nasida, jala aring di angka na marsonangsonang.",
			"24": "<sup>24</sup> Sai homur ma matanasida, asa unang marnida jala angka hitir ma tongtong bahen haehaenasidai.",
			"25": "<sup>25</sup> Pangusehon ma tu nasida rimasmu, jala parpiarpiar ni murukmu manoro nasida.",
			"26": "<sup>26</sup> Sai tarulang ma bagasnasida i, sai unang ma marpangisi undungundungnasida i.",
			"27": "<sup>27</sup> Ai dilele nasida do na * nilinsingmu, jala dipangkatahatahon nasida do habebernit ni angka na binuganganmu.",
			"28": "<sup>28</sup> Sai tambai ma hasalaan tu hasalaannasida i, asa unang sahat nasida tu hatigoranmi.",
			"29": "<sup>29</sup> Sai sosa ma nasida sian * pustaha hangoluan, asa unang tarsurat nasida rap dohot angka partigor i.",
			"30": "<sup>30</sup> Alai na dangol do ianggo ahu, jala marsingkor, sai patimbulon ni hatuaonmi do ahu sogot, ale Debata. III.",
			"31": "<sup>31</sup> Pujionku ma goar ni Debata marhitehite ende, jala pasangaponku ma Ibana marhitehite pujipujian.",
			"32": "<sup>32</sup> Jadi lomoan ma roha ni Jahowa disi asa mida jonggi manang lombu sitingko tanduk, na martambirik.",
			"33": "<sup>33</sup> Diida angka na dangol i ma i, gabe las ma rohanasida; sai hiras ma rohamuna, hamu ale angka na mangalului Debata!",
			"34": "<sup>34</sup> Ai ditangihon Jahowa do angka na pogos, jala ndang lea rohana mida bangsona na tarbuang i.",
			"35": "<sup>35</sup> Sai pujion ni langit dohot tano on do Ibana sogot, angka laut pe ro di nasa na manginsir di bagasan angka i.",
			"36": "<sup>36</sup> Ai sai tumpahan ni Debata do Sion jala paulionna do angka huta ni Juda, asa maringan nasida disi jala nampunasa.",
			"37": "<sup>37</sup> Asa pinompar ni angka naposona i tumeansa sogot, jala angka na mangkaholongi goarna maringan disi."
		},
		"70": {
			"1": "<sup>1</sup> Ende sian si Daud bahen * parningotan.",
			"2": "<sup>2</sup> Ale Debata, sai hapogani ma paluahon ahu, sai hapogani ma, ale Jahowa, mangurupi ahu!",
			"3": "<sup>3</sup> Ingkon murak ma nian jala maila angka na tumahi hosangki, ingkon sumurut tu pudi jala murak angka na mangkalomohon hinamagongku.",
			"4": "<sup>4</sup> Ingkon mulak nian pandok ni angka na mandok: Boha do! Boha do! Bahen upa ni haurahonnasida i.",
			"5": "<sup>5</sup> Ingkon marolopolop nian jala marlas ni roha di bagasan Ho sude angka na mangalului Ho, jala ingkon tongtong ma dohonon ni angka na mangkaholongi hatuaonmu: Timbul do Debata!",
			"6": "<sup>6</sup> Alai anggo ahu na dangol jala na pogos do — ale Debata, sai hapogani ma mandapothon ahu! Ho do siurupi dohot sipalua ahu, sai unang pabenda, ale Jahowa!"
		},
		"71": {
			"1": "<sup>1</sup> I. Marhaporusan tu Ho do ahu, ale Jahowa, ndang tagamon murak ahu salelenglelengna.",
			"2": "<sup>2</sup> Sai luahon ma ahu marhitehite hatigoranmu, jala palua ahu, sai paeleng ma pinggolmu tu ahu jala urupi ahu.",
			"3": "<sup>3</sup> Sai Ho ma gabe partanobatoan di ahu, tau inganan bongotanku tongtong; nunga pola diparbaga Ho urupanmu ahu, ai Ho do * partanobatoanku jala haporusanku.",
			"4": "<sup>4</sup> Ale Debatangku, sai palua ma ahu sian tangan ni parjahat i, sian tangan ni pargeduk dohot sibahen gogo.",
			"5": "<sup>5</sup> Ai * Ho do pangkirimonku, ale Tuhan Jahowa, nalom ni rohangku sian sietehetehonku.",
			"6": "<sup>6</sup> Naung * mangunsande tu Ho do ahu sian bortian, Ho do siparmudu ahu sian butuha ni dainang, sai Ho do tongtong pujionku.",
			"7": "<sup>7</sup> Jadi sobokkon parhalongangan ni torop halak do ahu, alai Ho do haporusanku na gonting.",
			"8": "<sup>8</sup> Sai gok pujipujianmu ma pamanganku, gok hamuliaonmu manipat ari.",
			"9": "<sup>9</sup> Sai * unang bolongkon ahu di tingki + haubanonku, molo maol suda gogongku unang tadingkon ahu.",
			"10": "<sup>10</sup> Ai dipahatahata angka musungku do ahu, jala rap martuptup i do angka na mangarop hosangki.",
			"11": "<sup>11</sup> Angka ninna do: Nunga ditadingkon Debata ibana, lotongi jala soro hamu ma ibana, ai ndang adong sipalua.",
			"12": "<sup>12</sup> Ale Debata, sai unang paholang sian ahu, ale Debatangku, hapogani ma mangurupi ahu.",
			"13": "<sup>13</sup> Ingkon murak ma nian jala siap angka sialo hosangki, sai dihungkupi hailaon dohot haurahon ma angka silului hinamagongku. II.",
			"14": "<sup>14</sup> Alai anggo ahu sai * tong do marhaposan, jala manambai pujipujianmu sudena.",
			"15": "<sup>15</sup> Sai baritahonon ni pamanganku do hatigoranmu, ganup ari hatuaonmu, * ai ndang huboto bilanganna.",
			"16": "<sup>16</sup> Sai harohononku do angka pambahenan hagogoan ni Tuhan Jahowa, sai hatigoranmu sandiri do pujionku.",
			"17": "<sup>17</sup> Ale Debata, sai Ho do mangajari ahu sian sietehetehonku, jala * rasirasa nuaeng sai hupaboaboa do halongangan angka na binahenmi.",
			"18": "<sup>18</sup> Nang sahat di hadohungon dohot haubanon, * sai unang tadingkon ahu, ale Debata, paima hubaritahon tanganmu tu na pinompar, + hagogoonmu tu saluhut angka na ro sogot.",
			"19": "<sup>19</sup> Tolhas ro di banua ginjang do hatigoranmi, ale Debata, nunga dijadihon Ho angka halongangan bolon, tung ise ma songon Ho, ale Debata?",
			"20": "<sup>20</sup> Nunga torop angka hagogotan dohot hinamago dipasonggop Ho tu hami, sai ulahanmu do pangoluhon hami, jala enetonmu do hami muse tu ginjang sian angka lung ni tano on.",
			"21": "<sup>21</sup> Sai ambaanmu do habalgaonki jala ulahanmu do mangapul ahu.",
			"22": "<sup>22</sup> * Ahu pe antong, pujionku ma Ho mardongan uninguningan, habonaronmu, ale Debatangku; endehononku ma Ho mardongan arbap, ale + Nabadia ni Israel!",
			"23": "<sup>23</sup> Ingkon marolopolop ma bibirhu, ai endehononku ma Ho, nang tondingku, naung tinobusmi.",
			"24": "<sup>24</sup> Dohot do dilangku mangendehon hatigoranmi manipat ari, asa maila jala murak angka na mangalului hinamagongku."
		},
		"72": {
			"1": "<sup>1</sup> Sian si Salomo. I. Ale Debata, sai pasahat ma angka panguhummu tu rajai, jala hatigoranmu tu anak ni rajai.",
			"2": "<sup>2</sup> Asa diuhum bangsom marhitehite hatigoran, jala maruli uhum angka na dangolmu.",
			"3": "<sup>3</sup> Asa marparbuehon hadameon angka dolok di bangso i, jala maruli hatigoran angka robean.",
			"4": "<sup>4</sup> Sai patingkosonna do uhum tu angka na dangol ni bangso i, tumpahanna do angka anak ni na pogos, jala ropuhanna do sibahen gogo.",
			"5": "<sup>5</sup> Sai Ho ma dihabiari halak saleleng adong mata ni ari, jala saleleng tarida bulan marsundutsundut.",
			"6": "<sup>6</sup> Sai tuat ma Ibana songon pangonai ni udan tu padang na sinabi, songon udan nene na mamornohi tano.",
			"7": "<sup>7</sup> Martunasi ma di angka arina i partigor i, jala manimbukbuk hadameon ro di na so adong be bulan.",
			"8": "<sup>8</sup> Jadi Ibana ma mangarajai sian * laut sahat tu laut, jala sian batang aek i sahat ro di angka ujung ni tano on.",
			"9": "<sup>9</sup> Ingkon marsomba di jolona angka pangisi ni halongonan, jala * dilatan ni angka musuna orbuk.",
			"10": "<sup>10</sup> Boanon ni angka raja sian Tarsis dohot angka pulo ma sombasomba, angka raja sian Seba dohot Etiopia manaruhon silehonlehon.",
			"11": "<sup>11</sup> Jala sombaon ni sude raja Ibana, luhut do angka parbegu mangoloi Ibana.",
			"12": "<sup>12</sup> Ai paluaonna ma na pogos na joujou dohot na dangol na so marpangalualuan.",
			"13": "<sup>13</sup> Olananna do na metmet dohot na pogos, jala paluaonna do angka tondi ni angka na pogos.",
			"14": "<sup>14</sup> Paluaonna do tondinasida sian pangarupaon dohot sian parhilangon, jala na arga situtu do * mudarnasida di rohana. II.",
			"15": "<sup>15</sup> Sai mangolu do ibana jala lehononna tu Ibana * sere sian Seba; jala + tangiangkononna do Ibana tongtong, pasupasuonna do Ibana ganup ari.",
			"16": "<sup>16</sup> Jadi gabe situtu ma eme di tano on ro di punsu ni angka dolok, * humaras ma parbuena, songon Libanon, jala martumburi nasida jolma i sian huta, songon + duhut ni tano on.",
			"17": "<sup>17</sup> Sai hot ma goarna i ro di salelenglelengna, sai muap ma baritana saleleng adong mata ni ari, asa * maruli pasupasu nasida di bagasan Ibana, luhut angka parbegu martuahon Ibana.",
			"18": "<sup>18</sup> Pinuji ma Debata Jahowa, Debata ni Israel, * sasadasa do mambahen angka halongangan.",
			"19": "<sup>19</sup> Pinuji ma dohot goar ni hamuliaonna i ro di salelenglelengna, jala gok hasangaponna ma liat portibi on! Amen! Amen!",
			"20": "<sup>20</sup> Marujung ma angka tangiang ni si Daud, anak ni si Isai."
		},
		"73": {
			"1": "<sup>1</sup> Ende sian si Asap. I. Mardenggan basa mamolin do Debata maradophon Israel, angka * na ias marroha.",
			"2": "<sup>2</sup> Alai anggo ahu, tarsulandit ne ma tothu, tinggang ne do ahu.",
			"3": "<sup>3</sup> Ai mangiburu do rohangku mida angka na jungkat roha, dung huida * hasonangan ni angka parjahat.",
			"4": "<sup>4</sup> Ai ndang adong parniahapannasida rasirasa mate nasida, tambos do dagingnasida i.",
			"5": "<sup>5</sup> Ndang marhangaluton nasida songon jolma na asing, jala ndang marsipalsipal nasida songon jolma na asing.",
			"6": "<sup>6</sup> Dibahen i marhorungkorungkon ginjang ni rohanasida, jala maruloshon parhilangon.",
			"7": "<sup>7</sup> Pola songon na * bosol matanasida dibahen mokmokna, + disalpui nasida do angka pingkiran ni roha.",
			"8": "<sup>8</sup> Sai mangarehei dohot pahatahata pangarupaon do nasida mangasahon hajahaton, sai tumindi do pangkulingnasida i.",
			"9": "<sup>9</sup> Hira ulpuhan sian banua ginjang do pandok ni pamangannasida, jala guru dok ni dilanasida do tano on.",
			"10": "<sup>10</sup> Dibahen i dohot do * bangsona marbalik tusi, jadi butongan ma nasida manobur aek.",
			"11": "<sup>11</sup> Angka didok nasida ma: Tung adong ma diboto Debata? Jala ndang adong parbinotoan di Natumimbul i.",
			"12": "<sup>12</sup> Ida ma, i ma angka parjahat sai mardohar salelenglelengna, lam tu suksukna hamoraonnasida.",
			"13": "<sup>13</sup> * Tung na so marniula do hape na hupapita i rohangki, jala na + huburii tanganku di bagasan hapitaon?",
			"14": "<sup>14</sup> Jala na huae i na porsuk ganup ari, jala na hona pinsang ahu ganup manogot?",
			"15": "<sup>15</sup> Tung sura hudok: Marpangkuling songon nasida ma ahu, ida ma na manjehehon * pinompar ni angka anakmu do ahu disi. II.",
			"16": "<sup>16</sup> Dung i sai hupingkiri asa dapot rohangku nian, hape mamaolhu do.",
			"17": "<sup>17</sup> Paima bongot ahu tu angka inganan ni Debata na badia i, hutangkastangkasi * ujungnasida i.",
			"18": "<sup>18</sup> Hape landit situtu do hajongjongannasida dibahen Ho, didabuhon Ho do nasida tu hamagoan.",
			"19": "<sup>19</sup> Satongkin situtu mago nasida so pangkirimanna, ripur jala lekse do nasida dibahen hinamago na jorbut situtu.",
			"20": "<sup>20</sup> Songon pangalaho ni nipi, ia dung ngot, songon i do lea ni roham, ale Tuhan, mida sumansumannasida di huta.",
			"21": "<sup>21</sup> Saleleng margorokgorok rohangku jala songon na ginirik piangku.",
			"22": "<sup>22</sup> Maoto do ahu jala * ndang adong huboto; sobokkon pinahan do ahu maradophon Ho.",
			"23": "<sup>23</sup> Alai sai marsihohot ahu tu Ho, ditiop Ho do tanganku siamun.",
			"24": "<sup>24</sup> Sai toguonmu do ahu marhitehite * sangkap ni roham jala jangkononmu do ahu muse + tu hasangapon.",
			"25": "<sup>25</sup> Tung ise ma donganku di angka banua ginjang? Jala dungkon ni Ho ndang adong dihalomohon rohangku di tano on.",
			"26": "<sup>26</sup> Nang pe merus sibukku dohot rohangku, sai Debata do partanobatoan ni rohangku jala parjambaranku salelenglelengna.",
			"27": "<sup>27</sup> Ai ida ma, sai na laho mago do angka na paholang dirina sian Ho; disiaphon Ho do sude angka * na mangose padan maradophon Ho.",
			"28": "<sup>28</sup> Alai anggo ahu — untungku do * hasolhoton tu Debata; haposanku do hubahen Tuhan Jahowa, asa + hubaritahon angka pambahenanmu sudena."
		},
		"74": {
			"1": "<sup>1</sup> Ende sipodaon sian si Asap. I. Ale Debata, boasa tung tongtong hami bolongkononmu, martimburak rimasmu mida * birubiru angka na pinarmahanmu?",
			"2": "<sup>2</sup> Sai ingot ma huriami, na tinobusmu nahinan, na pinaluam gabe * marga parjambaranmu, dolok + Sion on, na niingananmu.",
			"3": "<sup>3</sup> Sai pasintak ma angka langkam monopot angka parsiragongan salelenglelengna, tung luhutna do disiaphon musu i di bagasan habadiaon i.",
			"4": "<sup>4</sup> Marsurak do angka alom di bagasan * undungundung parluhutanmu, angka dipajongjong do + tandanasida bahen partinandaan.",
			"5": "<sup>5</sup> Songon na mangalbangkon tangke di tombak longolongo do pangalahona idaon.",
			"6": "<sup>6</sup> Jala ia nuaeng ditahahon be do tangke dohot baliung tu * uhiruhirnai.",
			"7": "<sup>7</sup> Disurbu nasida do bagas habadiaonmu, diramuni do gabe tano inganan ni goarmu.",
			"8": "<sup>8</sup> Angka ninna do di bagasan rohanasida be: Tasiaphon ma nasida sude! Gor ma sude * bagas parluhutan ni Debata di luat i dibahen nasida.",
			"9": "<sup>9</sup> Ndang huida hami be angka partinandaanmi, ndang adong be panurirang, jala ndang adong sian hami na umboto manang sadia leleng on.",
			"10": "<sup>10</sup> Sadia leleng on, ale Debata, datdatan ni musu i mangelesi? Tung insahan ni musu i nama goarmu salelenglelengna?",
			"11": "<sup>11</sup> Boasa tung * taitonmu tanganmi dohot siamunmi? Enet ma nian sian bagasan ampuanmu laho maniaphon? II.",
			"12": "<sup>12</sup> Jala * rajangku hian Debata sian narobi, Ibana do patupahon angka pangurupion di parsitongaan ni tano i.",
			"13": "<sup>13</sup> * Ho do umbola laut marhitehite gogom, dilobong Ho do ulu ni angka naga di lambung aek.",
			"14": "<sup>14</sup> Ho do mangaropuhi angka ulu ni buea, dilehon Ho do ibana panganon ni bangso, * pangisi ni halongonan.",
			"15": "<sup>15</sup> Ho do * manuhak mual dohot bondar, Ho do + mangarsik angka batang aek na marlananglanang.",
			"16": "<sup>16</sup> Gok di Ho do arian, gok di Ho dohot borngin; Ho do paojakkon * hatiuron dohot mata ni ari.",
			"17": "<sup>17</sup> Ho do * mamagohon sude talutuk ni tano on: + Ari logo dohot ari rondo Ho do jumadihonsa.",
			"18": "<sup>18</sup> Sai paingotingot: Na niinsahan ni musu i Jahowa, jala na nielesan ni * bangso na oto i goarmi.",
			"19": "<sup>19</sup> Sai unang lehon hosa ni * anduhurmi tu binatang, sai unang tongtong halupahon ngolu ni angka na dangolmi.",
			"20": "<sup>20</sup> Sai tatap ma * parpadanoni, ai gok pandoboan do angka solotsolot ni tano on.",
			"21": "<sup>21</sup> Sai unang mulak tarurak na ginosagosa i, sai dipuji na dangol jala na pogos i ma goarmu.",
			"22": "<sup>22</sup> Hehe ma Ho, ale Debata! Badahon ma parbadaanmi! Sai ingot ma haurahonmi binahen ni na oto sipatsipat ni ari.",
			"23": "<sup>23</sup> Sai unang halupahon parioho ni angka musum, hagunturon ni angka alom na tongtong martimburak."
		},
		"75": {
			"1": "<sup>1</sup> Ende sian si Asap marlogu unang siaphon.",
			"2": "<sup>2</sup> Mauliate ma rohanami tu Ho, ale Debata, mamujimuji ma hami dibahen donok do goarmu, angka dibaritahon halak do * halongangan angka na binahenmu.",
			"3": "<sup>3</sup> Ai ia dung jumpang * tingkingku, tingkos ni uhum ma dabuonku ianggo Ahu.",
			"4": "<sup>4</sup> Malala pe sogot tano on dohot pangisina sudena, ianggo * Ahu pahotonku do angka ojahanna. Sela!",
			"5": "<sup>5</sup> Ningku do mandok angka * panggetegete: Sai unang manggetegete hamu! Dohot mandok angka parjahat i: Sai unang ma paagaaga hamu + tandukmuna i.",
			"6": "<sup>6</sup> Sai unang ma patimbo hamu tandukmuna i, unang ma * hatahon hamu hajungkaton mangasahon gakgak ni rungkung.",
			"7": "<sup>7</sup> Ai ndada sian habinsaran manang sian hasundutan, jala ndada sian halongonan ro hatimbulon.",
			"8": "<sup>8</sup> Ai Debata do panguhum, sadaon dipajimput jala sadaon * dipatimbul.",
			"9": "<sup>9</sup> Ai adong do sada panginuman di tangan ni Jahowa, jala gurgur do anggur di bagasan ni, gok raru do jala dipainumhon sian i; ingkon soburon ni angka parjahat ni tano on sude apala partoruna i.",
			"10": "<sup>10</sup> Alai anggo ahu baritahononku do salelenglelengna, endehononku do Debata ni si Jakkob.",
			"11": "<sup>11</sup> Upokkononku do sude tanduk ni angka parjahat i, ingkon patimboon do angka tanduk ni partigor i."
		},
		"76": {
			"1": "<sup>1</sup> Ende sian si Asap.",
			"2": "<sup>2</sup> Tartanda do Debata di Juda, timbul do goarna di Israel.",
			"3": "<sup>3</sup> Dijadihon do di * Salem undungundungna jala di + Sion do ingananna.",
			"4": "<sup>4</sup> Disi do * diponggolhon angka sumbia api ni sior, ro di lombulombu, podang dohot parhohas tu hamusuon. Sela!",
			"5": "<sup>5</sup> * Sumangap jala marmuliaan do Ho sian angka dolok panamunan.",
			"6": "<sup>6</sup> Tarsamun do angka na begu marroha i, tarlalap modom do nasida, jala ndang * margogo tangan ni angka parangan i sudena.",
			"7": "<sup>7</sup> Hinorhon ni pangasupim, ale Debata ni Jakkob, tarlalap modom do nang hureta, nang hodanasida.",
			"8": "<sup>8</sup> Na songkal situtu do Ho, tung ise ma manahan jongjong di jolo ni bohim, molo sapala manombo rimasmu?",
			"9": "<sup>9</sup> * Sian banua ginjang do dipatubegehon Ho uhum, dambirbiron ma tano on jala mamolngit.",
			"10": "<sup>10</sup> Di na hehei Debata mandabu uhum laho paluahon sude angka na dangol ni tano on. Sela!",
			"11": "<sup>11</sup> Ai manjadi pujipujianmu do rimas ni angka jolma, dihohoshon Ho do ebaeba ni angka rimas i.",
			"12": "<sup>12</sup> Marbagabaga ma hamu, jala garari hamu tu Jahowa, Debatamuna i! Sude angka na humaliang Ibana manaruhon silehonlehonna be tu * Sihabiarhononhon i.",
			"13": "<sup>13</sup> Ibana do manostosi hosa ni angka raja, songkal Ibana di roha ni angka raja ni tano on."
		},
		"77": {
			"1": "<sup>1</sup> Ende sian si Asap. I.",
			"2": "<sup>2</sup> Tu Debata do hujoujouhon soarangkon, jala mangangguhi ahu, tu Debata do tongon soarangkon! Jadi ditangihon do ahu.",
			"3": "<sup>3</sup> Hulului do Tuhan i di ari hagogotanki, sai toltol do tanganku bornginna i, jala ndang marpansohotan, sai dipajuajua rohangku do apulon.",
			"4": "<sup>4</sup> Sai hupaingotingot Debata, jala marhoi; sai hupingkiri, jadi biahaton tondingku. Sela!",
			"5": "<sup>5</sup> Sai ditiopi Ho do langkop ni matangku, sai diumbani do ahu, jadi ndang tarbahen ahu mangkuling.",
			"6": "<sup>6</sup> Sai hupingkiri do angka ari na robi, angka taon naung leleng salpu.",
			"7": "<sup>7</sup> Sai hupaingotingot do pamiltikku di * parhinaloan bornginna i, sai marhusari do rohangku jala sai manangkasi do tondingku.",
			"8": "<sup>8</sup> Tung saleleng ni lelengna nama ulaning mambolongkon Tuhan i, jala ndang be ulahanna mardenggan basa?",
			"9": "<sup>9</sup> Tung naung marujung salelenglelengna nama ulaning asi ni rohana, tung pesan nama bagabaga i marsundutsundut?",
			"10": "<sup>10</sup> Tung naung lupa ma ulaning Debata marasi roha? Manang naung ditiopi angka asi ni rohana i dibahen murukna? Sela! II.",
			"11": "<sup>11</sup> Jadi hudok ma: Hagaleonku do i, angka taon ni siamun ni Natumimbul do i.",
			"12": "<sup>12</sup> Sai pujionku do angka pambahenan ni Jahowa, ai sai ingotonku do halongangan angka na binahenna i sian na robi.",
			"13": "<sup>13</sup> Jala sai marhusari do ahu taringot tu angka pambahenanmu sudena, jala sai hutangkasi do angka jadijadianmu.",
			"14": "<sup>14</sup> Ale Debata, habadiaon do parhitean ni dalanmu! Dung Debata dia ma marhatimbulon songon Ho, ale Debata!",
			"15": "<sup>15</sup> Ho do Debata sipatupa halongangan, dipabotohon Ho do gogom tu angka bangso.",
			"16": "<sup>16</sup> Nunga dipalua Ho bangsomi marhitehite tanganmu, angka anak ni si Jakkob dohot si Josep. Sela!",
			"17": "<sup>17</sup> Diida angka aek i do Ho, ale Debata! Diida angka aek i do Ho, gabe margilinggiling angka gunsang ma dohot angka lung.",
			"18": "<sup>18</sup> Mangusehon aek ma angka ombun, marsaringar do angka aoangaoang, sumiksaksiksak ma huhut angka sumbiam.",
			"19": "<sup>19</sup> Marsaringar ma ronggurmu di bagasan halisungsung, disondangi angka hilap ma portibi on, humuntal jala lalolalo ma tano on.",
			"20": "<sup>20</sup> Di bagasan laut do dalanmu, jala mardalan balobung do Ho di angka aek magodang, jala ndang tanda angka bogasmu.",
			"21": "<sup>21</sup> Diadu Ho do bangsom, * songon sada punguan marhitehite tangan ni si Musa dohot si Aron."
		},
		"78": {
			"1": "<sup>1</sup> Ende sipodaon sian si Asap. Hamu ale bangsongku, sai tangihon hamu ma podangkon! Paeleng hamu ma pinggolmuna tu angka hata ni pamangankon.",
			"2": "<sup>2</sup> Bungkaonku ma pamanganku mandok umpama, manurasihon hulingkulingan sian na robi.",
			"3": "<sup>3</sup> Angka naung tabege jala na itaboto dohot * na pinajojor ni angka ompunta tu hita.",
			"4": "<sup>4</sup> Ndang porsoonta tu anaknasida, tu sundut na singkat sogot; baritahononta do angka pujipujian ni Jahowa ro di hagogoonna dohot halongangan, angka na binahenna i.",
			"5": "<sup>5</sup> Ai nunga dipatindang Ibana sada panindangion di Jakkob, jala dibahen do sada patik di Israel, na tinonahonna tu angka ompunta, asa * dipabotohon nasida tu anaknasida i.",
			"6": "<sup>6</sup> Asa diboto sundut na singkat sogot, anak angka situbuhononhon dope; ia dung magodang nasida, asa dipaboa muse tu anaknasida.",
			"7": "<sup>7</sup> Asa dibahen nasida Debata haposannasida i, jala unang dihalupahon angka pambahenan ni Debata, jala dijujur angka patikna i.",
			"8": "<sup>8</sup> Asa unang nasida doshon ompunasida, * sundut na marbalik dohot panggunturi, sundut na so patoguhon rohana, jala ndang marsihohot tondina tu Debata.",
			"9": "<sup>9</sup> Anak ni si Epraim, angka parsinjata sior, angka na mundar di ari hatongtangan i.",
			"10": "<sup>10</sup> Ndang diingot nasida padan binahen ni Debata, jala dijua nasida do mangihuthon tu patikna i.",
			"11": "<sup>11</sup> Jala dihalupahon do angka pambahenanna i dohot halongangan angka na pinataridahonna i tu nasida.",
			"12": "<sup>12</sup> Dibahen Ibana do halongangan di adopan ni ompunasida i, di tano Misir, di adaran * Zoan.",
			"13": "<sup>13</sup> Dibola do laut i patariparhon nasida, jala diunsong do aek i doshon timbunan.",
			"14": "<sup>14</sup> Jala ditogihon nasida marhitehite ombun ia arian, jala marhitehite sondang ni api manipat borngin.",
			"15": "<sup>15</sup> Dibola do angka dolok batu di halongonan jala dipainum nasida doshon aek na marbuhalbuhal godangna.",
			"16": "<sup>16</sup> Jadi ruar ma angka sunge sian dolok batu i jala mabaor songon batang aek.",
			"17": "<sup>17</sup> Alai sai didatdati nasida dope mardosa dompak Ibana, mangalo Natumimbul i di tano bangkalbangkal.",
			"18": "<sup>18</sup> Jala sai diunjuni nasida do Debata di bagasan rohanasida laho martungguhon sipanganon guru roharohanasida.",
			"19": "<sup>19</sup> Jala marmungutmungut dompak Debata, angka ninna ma: Tung tagamon tarpatupa Debata ma padirihon sada meja di halongonan on?",
			"20": "<sup>20</sup> Ida ma, nunga dilombut Ibana dolok batu i, jadi martihaltihal ma aek, jala gas andalu angka batang aek; tarpatupasa do huhut ulaning mangalehon sagusagu, manang manjadihon juhut di bangsona i?",
			"21": "<sup>21</sup> Dibahen i dung dibege Jahowa, muruk ma Ibana, gabe marjimburjimbur ma api di Jakkob, marpiarpiar ma huhut rimas dompak Israel.",
			"22": "<sup>22</sup> Ai ndang dihaporseai nasida Debata jala ndang diparhanalom hatuaonna i.",
			"23": "<sup>23</sup> Hape lam didokkon Ibana do angka ombun di ginjang, jala diungkap angka pintu ni langit.",
			"24": "<sup>24</sup> Jala diudanhon tu nasida Manna bahen sipanganon, jala dahanon sian banua ginjang dilehon tu nasida.",
			"25": "<sup>25</sup> Sagusagu ni surusuruan do dipangan nasida be, maradu mahapan di bohal tinongosna i tu nasida.",
			"26": "<sup>26</sup> Dipahehe do di langit alogo habinsaran, jala ditogutogu do alogo dangsina marhitehite gogona i.",
			"27": "<sup>27</sup> Dung i diudanhon tu nasida juhut songon orbuk, jala pidong na marhabong songon horsik di laut.",
			"28": "<sup>28</sup> Jala didekdekkon angka i tu tongatonga ni parsaroanna i, humaliang inganannasida i.",
			"29": "<sup>29</sup> Jadi mangan ma nasida jala mahapan situtu; jala diparo tu nasida pinangidonasida i.",
			"30": "<sup>30</sup> Ndang dope muli nasida sian pinangido ni rohanasida, ongom dope sipanganonnasida i di pamangannasida:",
			"31": "<sup>31</sup> Nunga marpiarpiar rimas ni Debata mida nasida, jadi dibunu ma angka na mokmok sian nasida, jala diragehon angka dolidoli ni Israel.",
			"32": "<sup>32</sup> Luhutna pe songon i, sai didatdati nasida dope mardosa, jala ndang dihaporseai halongangan angka na binahenna i.",
			"33": "<sup>33</sup> Dibahen i dipasalpu ma ariarinasida maralimos jala manungka do taonnasida i.",
			"34": "<sup>34</sup> Molo Ibana mambunu nasida, jadi usouso ma nasida di Ibana, jala mulak nasida pasogothon mangalului Debata.",
			"35": "<sup>35</sup> Jala diingot nasida, Debata do hape * partanobatoannasida i, jala Debata na tumimbul i sipaluanasida.",
			"36": "<sup>36</sup> Dilesemlesem ma Ibana marhitehite pamangannasida, jala dilanasida i manggabusi Ibana.",
			"37": "<sup>37</sup> Alai ndang marsihohot rohanasida tu Ibana, jala ndang dipasintong nasida padanna i.",
			"38": "<sup>38</sup> Alai anggo Ibana, asi do rohana disesa do dosa, jala ndang disiaphon, jala jotjot do mulak rimasna i dibahen, jala ndang disunggul rimasna apala saluhut.",
			"39": "<sup>39</sup> Sai diingot rohana do, sibuk do nasida, alogo na laho salpu, jala na so mulak.",
			"40": "<sup>40</sup> Na sai jotjot Ibana dialo nasida di halongonan, jala diarsahi nasida Ibana di tangkaltangkal.",
			"41": "<sup>41</sup> Dung i diulahi nasida muse mangunjuni Debata, jala disarita Nabadia ni Israel.",
			"42": "<sup>42</sup> Ndang diingot nasida tanganna i, nang ari, na pinaluana i nasida sian sipangarupa.",
			"43": "<sup>43</sup> Uju pinatindangna i angka tandana di Misir, jala halongangan binahenna i di adaran Zoan.",
			"44": "<sup>44</sup> Jala dipauba angka batang aeknasida i gabe mudar, ro di angka sungenasida, gabe ndang tarinum nasida be.",
			"45": "<sup>45</sup> Ditongoshon tu tongatonganasida lanok angka na manganhon nasida, dohot tohuk angka na mangago nasida.",
			"46": "<sup>46</sup> Tu tamponok do dilehon suansuanannasida i, jala na niulanasida i tu sihapor.",
			"47": "<sup>47</sup> Mate do angka hau anggurnasida dibahen ambolas, ro di angka hau antajau.",
			"48": "<sup>48</sup> Rage do dorbianasida dibahen ambolas, jala disoro porhas do parduaannasida i.",
			"49": "<sup>49</sup> Dipalua do dompak nasida parpiarpiar ni rimasna i, piripiri, rimas dohot hagogotan, saparduan surusuruan ni angka parsorion.",
			"50": "<sup>50</sup> Dipahornop do dalan ni rimasna i, ndang diolani hosanasida sian hamatean, jala dipasahat do ngolunasida i tu begu antuk.",
			"51": "<sup>51</sup> Jala diantuk do sude buhabaju di tano Misir, buhabaju ni * haroro ni gogonasida di angka undungundung ni si + Ham.",
			"52": "<sup>52</sup> Dung i dipaborhat ma bangsona songon birubiru, jala diadu nasida songon parduaan di halongonan.",
			"53": "<sup>53</sup> Jala tangkas do nasida diiringiring asa unang tarsonggot nasida, alai anggo musunasida i dihungkupi laut do.",
			"54": "<sup>54</sup> Dung i dipatolhas ma nasida tu parbolatan ni habadiaonna i, tu * dolok on, na nionjar ni siamunna i.",
			"55": "<sup>55</sup> Jala dipabali sian jolonasida angka parbegu i, jala didabu tu partaliannasida, jala angka marga ni Israel mangingani undungundungnasida i.",
			"56": "<sup>56</sup> Hape diunjuni nasida do muse Debata na tumimbul i, jala dialo, jala ndang diingot nasida angka panindangionna i.",
			"57": "<sup>57</sup> Jala * manginsurut nasida huhut manoisi, suang songon ompunasida i, marbalik ma nasida + songon sior sipaotooto.",
			"58": "<sup>58</sup> Jala digitihi Ibana marhitehite tambaknasida i, jala dipinggil Ibana marhitehite ganaganaannasida i.",
			"59": "<sup>59</sup> Jadi dung dibege Debata, tarrimas ma Ibana, gabe gialan situtu ma rohana mida Israel.",
			"60": "<sup>60</sup> Dung i diulang ma ingananna di Silo, undungundung na niingananna di tongatonga ni jolma.",
			"61": "<sup>61</sup> Jala dipasahat * hagogoonna i tu habuangan, jala hamuliaonna poti parpadanan i tu tangan ni sipangarupa.",
			"62": "<sup>62</sup> Jala dipasahat bangsona i tu podang, ala tarrimas Ibana mida bangso na niainna i.",
			"63": "<sup>63</sup> Dipangan api ma angka dolidolina i, jala ndang tarpuji be angka namarbajuna i.",
			"64": "<sup>64</sup> Marragean do * angka malimna i dibahen podang, jala + ndang mananangisi angka na mabaluna i.",
			"65": "<sup>65</sup> Jadi tarsunggul ma Tuhan i songon halak na modom songon ulubalang na marolopolop dibahen anggur.",
			"66": "<sup>66</sup> Jala dipaundar angka musuna i, haurahon saleleng ni lelengna do dilehon tu nasida.",
			"67": "<sup>67</sup> Jala dibolongkon undungundung ni si Josep, jala ndang be dipillit marga Epraim.",
			"68": "<sup>68</sup> Marga Juda nama dipillit, dolok Sion na hinaholonganna i.",
			"69": "<sup>69</sup> Jala dipabuntul habadiaonna i sobokkon langit, songon tano on na pinaojakna i * salelenglelengna.",
			"70": "<sup>70</sup> Jala dipillit si Daud, naposona i, jala dibuat do ibana sian parmahanan birubiru.",
			"71": "<sup>71</sup> Sian na mangadu birubiru panusuan ibana dialapi, asa parmahanonna Jakkob, bangsona i dohot Israel bangso na niainna i.",
			"72": "<sup>72</sup> Jadi diparmahan ma nasida hombar tu habonaron ni rohana i, jala ditogihon nasida marhitehite hapistaron ni angka tanganna."
		},
		"79": {
			"1": "<sup>1</sup> Ende sian si Asap. I. Ale Debata, nunga disola angka parbegu partohapanmu, nunga diramuni nasida jorom na badia i, jala parangusan dibahen Jerusalem.",
			"2": "<sup>2</sup> Nunga diparlehon nasida bangke ni angka naposom panganon ni pidong na martongatonga langit, tu binatang ni luat i do sibuk ni angka na niasianmi.",
			"3": "<sup>3</sup> Nunga dipangusehon mudarnasida i, songon aek humaliang Jerusalem, jala ndang adong sitanomsa.",
			"4": "<sup>4</sup> Jadi haurahon ni angka hombar hundul do hami, sielesan jala pangarehean ni angka na humaliang hami.",
			"5": "<sup>5</sup> Sadia leleng on, ale Jahowa, mangarimas Ho tongtong, jala marsijembur songon api hamuruhonmu?",
			"6": "<sup>6</sup> Pangusehon ma parpiar ni rimasmu tu parbegu, angka na so tumanda Ho, dohot tu harajaon, angka na so manjou goarmu.",
			"7": "<sup>7</sup> Ai nunga dipolgak nasida Jakkob, jala diulang ingananna i. II.",
			"8": "<sup>8</sup> Sai unang jujur tu hami angka hajahaton ni ompu najolo, hapogani ma manjumpangkon angka asi ni roham tu hami, ai tarjimput situtu do hami.",
			"9": "<sup>9</sup> Sai urupi ma hami, ale Debata ni hatuaonnami, ala ni hamuliaon ni goarmu, jala palua ma hami jala hungkupi dosanami ala ni goarmu.",
			"10": "<sup>10</sup> * Boasa ma tung dohonon ni angka parbegu: Didia do nuaeng Debatanasida i? Sai sange ma diboto angka parbegu sogot, idaonnami, + partubolon ni mudar ni angka naposom, na durus i.",
			"11": "<sup>11</sup> Sai * tolhas ma tu jolo ni bohim angguhangguk ni angka na tarbuang; sai pateba ma angka anak sibunuon hian hombar tu hatimbulon ni tanganmu.",
			"12": "<sup>12</sup> Sai lompit pituhali ma pasuang tu ampuan ni hombar hundulnami haeleson, na nieleshonna i tu Ho, ale Tuhan!",
			"13": "<sup>13</sup> Ianggo hami, bangsomi jala * birubiru na pinarmahanmu, sai Ho do pujionnami salelenglelengna, jala baritahononnami do pujipujianmu marsundutsundut."
		},
		"80": {
			"1": "<sup>1</sup> Ende sian si Asap.",
			"2": "<sup>2</sup> Ale * Siparmahan Israel, sai manangi ma Ho! Ai Ho do siadu Josep, songon birubiru; sai pataridahon ma Ho, ale na + marhabangsahon kerubim.",
			"3": "<sup>3</sup> Sai sungguli ma * hagogoanmu di jolo ni Epraim dohot Benjamin dohot Manasse, jala sai ro ma Ho mangurupi hami.",
			"4": "<sup>4</sup> Ale Debata, sai pasuang ma hami, jala * pasihar bohim, asa malua hami.",
			"5": "<sup>5</sup> Ale Jahowa, Debata Zebaot, sadia leleng on marmusu tihus Ho mida tangiang ni bangsom.",
			"6": "<sup>6</sup> Dipapanganhon Ho do tu nasida roti iluilu, jala dipainumhon Ho do tu nasida iluilu martahutahu.",
			"7": "<sup>7</sup> Dibahen Ho do hami ripe badaan ni hombar hundulnami, jala sai dielesi angka musunami do hami.",
			"8": "<sup>8</sup> Ale Debata Zebaot, sai pasuang ma hami, jala pasihar ma bohim asa malua hami.",
			"9": "<sup>9</sup> Dilopokkon Ho do najolo sada hau anggur sian Misir, dibutbut Ho do angka parbegu, asa manuanhon ibana.",
			"10": "<sup>10</sup> Dipalumbang Ho do tano i di jolona, jadi marurat ma ibana jala digohi tano i.",
			"11": "<sup>11</sup> Ditutup halinuna do angka dolok, jala doshon hau Ares ni Debata do angka rantingna.",
			"12": "<sup>12</sup> Tolhas ro di laut do manjarar angka dangkana, jala tolhas tu batang aek Euprat angka tumburna i.",
			"13": "<sup>13</sup> Boasa ma tung lohaonmu angka handangna, asa roharoha ni angka pamolus sude mamalpali ibana?",
			"14": "<sup>14</sup> Sai diugei baragas sian tombak do ibana, jala dijampal angka binatang ni harangan.",
			"15": "<sup>15</sup> Ale Debata Zebaot, sai marpangulahi ma roham, tatap ma sian banua ginjang, ida jala tingkir hau anggurmon!",
			"16": "<sup>16</sup> Sai ondingi ma na sinuan ni siamunmi dohot * anak na niainmu.",
			"17": "<sup>17</sup> Nunga pola masurbu ibana jala ditultuli; nunga pola angka mago nasida maradophon pangarupion ni bohim.",
			"18": "<sup>18</sup> Sai diondingi tanganmu ma * baoa ni siamunmu, anak ni jolma i na niainmu.",
			"19": "<sup>19</sup> Jadi ndang olo be hami sumurut sian Ho, sai pangolu ma hami, jadi pujionnami ma goarmu.",
			"20": "<sup>20</sup> Ale Jahowa, Debata Zebaot, sai pasuang ma hami; pasihar ma bohim, asa malua hami."
		},
		"81": {
			"1": "<sup>1</sup> Ende sian si Asap. I.",
			"2": "<sup>2</sup> Olophon hamu ma Debata hagogoontai, suraksurakkon hamu ma Debata ni si Jakkob.",
			"3": "<sup>3</sup> Pungka hamu ma marende, jala pinalu ma arbab i, tulila na denggan i angkup ni sordam.",
			"4": "<sup>4</sup> Palu hamu sangka di * poltak ni bulan, di + tula ari parpestaanta i.",
			"5": "<sup>5</sup> Ai i do patik di Israel, uhum tu Debata ni si Jakkob.",
			"6": "<sup>6</sup> Panindangion do i dibahen Ibana di si Josep, di na borhat i ibana dompak tano Misir, pangkuling na so huantusi do hubege disi:",
			"7": "<sup>7</sup> Hubuat do siboanon i sian abarana, malua do tanganna i sian ranjang.",
			"8": "<sup>8</sup> Joujou do ho uju di hagogotan, gabe hupalua ho, hualusi do ho marhitehite ronggur, huunjuni do ho * di lambung aek Meriba. Sela! II.",
			"9": "<sup>9</sup> Tangi ma, ale bangsongku, asa * huhatindangkon tu ho! Aut ni ditangihon ho nian ahu, ale Israel!",
			"10": "<sup>10</sup> Ndang jadi adong Debata sileban di tongatongamu, jala unang marsomba ho tu debata ni na pulik.",
			"11": "<sup>11</sup> * Ahu do Jahowa Debatam, na panangkok ho sian tano Misir, + pangangang ma pamanganmu, asa hugoki.",
			"12": "<sup>12</sup> Alai ndang ditangihon bangsongku soarangki, jala ndang dioloi Israel Ahu.",
			"13": "<sup>13</sup> Jadi hupasombu ma ibana di tangkang ni rohana i, gabe diihutihut nasida ma lomolomo ni rohanasida.",
			"14": "<sup>14</sup> Oe aut ma Ahu ditangihon bangsongku, diihutihut Israel angka dalanku.",
			"15": "<sup>15</sup> Mura do pajimputonku angka musunasida i, jala dompak angka na manosak nasida do tanganku.",
			"16": "<sup>16</sup> Ingkon * sombaon ni angka na mangkosom Jahowa do Ibana, jala salelenglelengna do tingkinasida i.",
			"17": "<sup>17</sup> Jala mangan indahan sigambiri do ibana bahenonna, jala pamahaponku do ho dohot situak ni loba sian dolok batu."
		},
		"82": {
			"1": "<sup>1</sup> Ende sian si Asap. Tindang do Debata di bagasan luhutan ni Debata, mandabu uhum do Ibana di tongatonga * ni angka panguhum.",
			"2": "<sup>2</sup> Sadia leleng on do pageduhonmuna uhum, jala dingkan an muna angka parjahat i? Sela!",
			"3": "<sup>3</sup> Patingkos hamu ma uhum tu na metmet dohot tu na sopot so marama, ondihon hamu ma na dangol dohot na pogos.",
			"4": "<sup>4</sup> Palua hamu ma na metmet dohot na pogos, sian tangan ni angka parjahat ma palua hamu nasida.",
			"5": "<sup>5</sup> Ndang mananda nasida, jala ndang olo nasida parrohaon, sai * mardalani di haholomon do nasida, jadi + reberebe ma sude angka ojahan ni tano on.",
			"6": "<sup>6</sup> Ianggo ahu, nunga pola hudok nian: * Angka Debata do hamu, jala anak ni Natumimbul do hamu sudena.",
			"7": "<sup>7</sup> Alai atik pe songon i mate do hamu songon jolma hian, jala tinggang do hamu sogot songon raja na asing sada.",
			"8": "<sup>8</sup> Hehe ma Ho, ale Debata, sai uhum ma tano on, ai guru di Ho hian do angka parbegu sudena!"
		},
		"83": {
			"1": "<sup>1</sup> Ende sian si Asap.",
			"2": "<sup>2</sup> Ale Debata, sai unang marsonangsonang boti Ho! Unang laos mauhom Ho, jala unang so roham, ale Debata!",
			"3": "<sup>3</sup> Ai ida ma, sai manggunturi do angka musum, jala dipagakgak angka na mangkosom Ho do uluna.",
			"4": "<sup>4</sup> Sai marangkal do nasida mambahen tahi sibunian dompak bangsom, jala martuptup i nasida mangalo angka * na niondinganmu.",
			"5": "<sup>5</sup> Angka ninna do: Beta, itasiaphon ma nasida sian parbangsoan, asa unang be taringot goar ni Israel.",
			"6": "<sup>6</sup> Ai saroha do nasida martuptup i, mambahen parpadanan mangalo Ho:",
			"7": "<sup>7</sup> Tole angka undungundung ni Edom dohot halak Ismael, Moab dohot halak Hagar i.",
			"8": "<sup>8</sup> Gebal dohot Amon dohot Amalek, Palistim ro di isi ni Tirus.",
			"9": "<sup>9</sup> Tarihut nang Assur dongannasida, tumungkol botohon ni pinompar ni si Lot. Sela!",
			"10": "<sup>10</sup> Sai bahen ma tu nasida, songon tu Midian, songon tu si Sisera, songon tu si Jabin di lambung batang aek Kison!",
			"11": "<sup>11</sup> Angka na siap di Endor, gabe napu tu hauma do nasida.",
			"12": "<sup>12</sup> Bahen ma angka na sangapnasida i songon si Oreb dohot si Seb, jala sude rajanasida i songon si Seba dohot Salmunna.",
			"13": "<sup>13</sup> Angka na mandok: Sai italahuti ma di hita * angka inganan ni Debata!",
			"14": "<sup>14</sup> Ale Debatangku, sai bahen ma nasida songon halisungsung, songon hurangkam maradophon alogo.",
			"15": "<sup>15</sup> Songon api na mamansingkon tombak, jala songon jimburjimbur na mandilathon angka dolok.",
			"16": "<sup>16</sup> Suang songon i ma nasida lotongi marhitehite habahabami jala guntur i nasida marhitehite halisungsungmi.",
			"17": "<sup>17</sup> Marsapu haurahon ma bohinasida bahen, asa usouso nasida di goarmu, ale Jahowa!",
			"18": "<sup>18</sup> Ingkon langan ma nasida jala gaor salelenglelengna, sai murak ma nasida jala siap.",
			"19": "<sup>19</sup> Asa ditanda nasida sasada Ho do na margoar Jahowa, Natumimbul gumomgom liat portibi on."
		},
		"84": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora.",
			"2": "<sup>2</sup> Dengganna i angka ingananmi, ale Jahowa Zebaot!",
			"3": "<sup>3</sup> Pola do langan jala maras rohangku dibahen lungunna di * angka alaman ni Jahowa; marolopolop do rohangku dohot sibukku tu Debata na mangolu i.",
			"4": "<sup>4</sup> Gari amporik jumpangan jabu, jala leangleang dapotan asarna bahen inganan ni angka anakna, mandok: Angka langgatan pamelean tu Ho, ale Jahowa Zebaot, * Rajangku dohot Debatangku.",
			"5": "<sup>5</sup> Martua ma angka na mangingani bagasmu, sai Ho do pujionnasida. Sela!",
			"6": "<sup>6</sup> Martua ma halak ia di bagasan Ho hagogoonna, ia rohanasida di bagasan manuju dalan na tigor.",
			"7": "<sup>7</sup> Angka na umbolus rura partangisan, Ibana do dibahen mualna; gabe * maruli pasupasu nasida.",
			"8": "<sup>8</sup> Lam leleng, lam * ganda do gogonasida, paima tolhas nasida + tujolo ni Debata di Sion.",
			"9": "<sup>9</sup> Ale Jahowa, Debata Zebaot, sai tangihon ma tangiangkon! Sai tangi ma, * ale Debata ni si Jakkob! Sela!",
			"10": "<sup>10</sup> * Lombulombunami do Ho, ale Debata, asi ma roham, + tatap ma bohi ni Messiasmi.",
			"11": "<sup>11</sup> Ai dumenggan do * sadari di angka alamanmu sian saribu ari na asing; tagonan do dipangido rohangku + sijaga pintu ahu di bagas ni Debatangku, asa maringan di angka undungundung ni parjahat.",
			"12": "<sup>12</sup> Ai Debata Jahowa do * mata ni ari dohot lombulombu, dilehon Jahowa do asi ni roha dohot hamuliaon, ndang + diholit na denggan i di angka na burju marpangalaho.",
			"13": "<sup>13</sup> Ale Jahowa Zebaot, martua ma jolma na marhaposan tu Ho."
		},
		"85": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora. I.",
			"2": "<sup>2</sup> Ale Jahowa, asi do najolo roham di tanomon, * dipalua Ho do si Jakkob sian habuangan.",
			"3": "<sup>3</sup> Marpamuati do roham di hajahaton ni bangsom on, dihungkupi Ho do dosanasida sudena. Sela!",
			"4": "<sup>4</sup> Nunga dipaombun Ho sude rimasmi, nunga mansohot roham sian parpiar ni murukmu.",
			"5": "<sup>5</sup> Sai marpangulahi ma roham tu hami, ale Debata ni hatuaonnami, jala pasohot somor ni roham dompak hami!",
			"6": "<sup>6</sup> Tung saleleng ni lelengna ma Ho marrimas dompak hami, ingotonmu tongtong rimasmu marsundutsundut?",
			"7": "<sup>7</sup> Tung so ulahanmu do * pangoluhon hami, asa las roha ni bangsom mida Ho?",
			"8": "<sup>8</sup> Sai pataridahon ma tu hami, ale Jahowa, asi ni roham, jala lehon ma tu hami hatuaonmu! II.",
			"9": "<sup>9</sup> * Sai tangihononku do manang aha na nidok ni Debata Jahowa, ai + diparbaga do hasonangan tu bangsona dohot tu angka na niasianna, asa unang mulak nasida tu haotoon.",
			"10": "<sup>10</sup> Tongon do, * donok do hatuaonna di angka na mangkabiari Ibana, asa mian muse hamuliaon di tanonami on.",
			"11": "<sup>11</sup> Asa pajumpang sogot asi ni roha dohot hasintongan, jala masiummaan hatigoran dohot hadameon.",
			"12": "<sup>12</sup> Asa martumbur sian tano i hasintongan, jala hatigoran manatap sian banua ginjang.",
			"13": "<sup>13</sup> Sai lehonon ni Jahowa do huhut na denggan i, jadi * lehonon ni tanonami ma parbuena.",
			"14": "<sup>14</sup> Mardalan ma hatigoran di jolona, jala patongononna ma langkanasida tu dalan."
		},
		"86": {
			"1": "<sup>1</sup> Tangiang sian si Daud. I. * Sai paeleng ma pinggolmu, ale Jahowa, alusi ahu, + ai na dangol jala na pogos do ahu.",
			"2": "<sup>2</sup> Sai * ramoti ma rohangku, ai hasian do ahu; sai urupi ma naposom, na marhaposan tu Ho, ale Debatangku.",
			"3": "<sup>3</sup> Asi ma roham di ahu, ale Tuhan, ai sai tu Ho do ahu joujou manipat ari.",
			"4": "<sup>4</sup> Sai palas ma roha ni naposomon, ai * Ho do, ale Tuhan, dihalungunhon rohangku.",
			"5": "<sup>5</sup> Ai anggo Ho, ale Tuhan, pardengganbasa jala * marpamuati roham, jala godang situtu do asi ni roham di sude angka na manjou Ho.",
			"6": "<sup>6</sup> Sai tangi ma, ale Jahowa, tangiangkon jala parateatehon soara ni anggukkon.",
			"7": "<sup>7</sup> Di ari hagogotanki Ho do hujou, ai sai alusanmu do ahu.",
			"8": "<sup>8</sup> Ndang adong tudoshon Ho di tongatonga ni angka Debata, ale Tuhan, jala ndang adong tudoshon angka pambahenanmi.",
			"9": "<sup>9</sup> Ro do sogot sude parbegu, angka na tinongosmi marsomba tu jolom, ale Tuhan, jala pasangaphon goarmu.",
			"10": "<sup>10</sup> Ai timbul do Ho jala mambahen angka halongangan, sasada Ho do Debata.",
			"11": "<sup>11</sup> Sai * ajarhon ma tu ahu, ale Jahowa, dalanmu, asa + marpangalaho ahu di bagasan hasintonganmi; sai pasada ma rohangku mangkabiari goarmu. II.",
			"12": "<sup>12</sup> Asa hupuji Ho, ale Tuhan Debatangku, sian nasa rohangku, jala hupasangap goarmu salelenglelengna.",
			"13": "<sup>13</sup> Ai na godang situtu do asi ni roham di ahu, jala * dipalua Ho do tondingku sian banua toru apala partoru.",
			"14": "<sup>14</sup> Ale Debata, hehe do angka na jungkat roha mangalo ahu, jala satuptupan do angka sibahen gogo marburu hosangki, jala ndada Ho tu jolonasida dibahen.",
			"15": "<sup>15</sup> Alai anggo Ho, ale Tuhan, Debata parasi roha jala pardengganbasa do Ho, lambat tarrimas, jala parasi roha dohot parhasintongan godang.",
			"16": "<sup>16</sup> Sai dompakkon ma ahu, jala asi ma roham di ahu, sai tumpakkon ma gogom tu ahu naposomon, jala palua * anak ni hatobanmu.",
			"17": "<sup>17</sup> Sai bahen ma tu ahu sada tanda paboa denggan ni roham, asa diida angka na hosom roha di ahu, jala maila nasida, paboa Ho sandiri, ale Jahowa, mangurupi dohot mangapuli ahu."
		},
		"87": {
			"1": "<sup>1</sup> Ende sian angka anak ni si Kora. Di atas ni angka dolok habadiaon i do ojahanna.",
			"2": "<sup>2</sup> Holongan do roha ni Jahowa mida * angka bahal ni Sion, asa mida sude inganan ni si Jakkob.",
			"3": "<sup>3</sup> Na sumurung do barita taringot tu ho, ale huta ni Debata. Sela!",
			"4": "<sup>4</sup> Tariashononku ma * Rahab dohot Babel masuk tu bilangan ni angka na tumanda Ahu, ida ma, halak Palistim dohot Tirus ro di + Kus angka naung tubu disi.",
			"5": "<sup>5</sup> Jala taringot tu Sion dohonon ni halak do sogot: Sadasada do baoa tubu di bagasan ibana, jala laos Ibana, Natumimbul i pahothon.",
			"6": "<sup>6</sup> Bilangan ni Jahowa do angka bangso laho manurathon: Tubu disi do on sadasada. Sela!",
			"7": "<sup>7</sup> Jadi angka parende ro di panortor mandok: Di bagasan ho do angka * mualhu sudena."
		},
		"88": {
			"1": "<sup>1</sup> Ende sipodaon sian si Heman, anak ni si Esra, taringot tu parsahiton ni angka na dangol.",
			"2": "<sup>2</sup> Ale Jahowa, Debata ni hatuaonku, sai joujou do ahu arian, sai di jolom do ahu bornginna i.",
			"3": "<sup>3</sup> Sai tolhas ma tu jolom tangiangki, sai paeleng ma pinggolmu tu angguhanggukki.",
			"4": "<sup>4</sup> Ai nunga mandaon rohangki di angka hinamago, jala nunga pola dolos ngolungku tu banua toru.",
			"5": "<sup>5</sup> Doshon angka na * manuruk tanoman nama ahu, songon baoa na so margellok.",
			"6": "<sup>6</sup> Di tongatonga ni angka naung mate do podomanku, songon angka na rage tartullang marmodoman di tanoman, angka na so niingotmu be, jala naung tinostosan nasida sian tanganmu.",
			"7": "<sup>7</sup> Nunga dipeakkon Ho ahu tubagasan godung apala partoru, tubagasan angka haholomon, tubagasan angka lung.",
			"8": "<sup>8</sup> Sai didondoni murukmu do ahu, jala sude angka * galumbangmu diodothon Ho tu ahu. Sela!",
			"9": "<sup>9</sup> Nunga * dipaholang Ho sian ahu angka alealengku, nunga dibahen Ho ahu hagigiannasida, tarhurung do ahu jala ndang tarbahen ahu haruar.",
			"10": "<sup>10</sup> Pola do * lotop matangku binahen ni pardangolan, sai Ho do hupajoujou, ale Jahowa, manipat ari, sai hupaherbang, do tanganku tu Ho.",
			"11": "<sup>11</sup> Tung tagamon ma bahenonmu halongangan tu angka naung mate? Manang tagamon ma hehe angka halinu mamuji Ho? Sela!",
			"12": "<sup>12</sup> Tung tagamon ma baritahononhon asi ni roham di bagasan tanoman, manang hasintonganmi di * banua toru?",
			"13": "<sup>13</sup> Tung tagamon ma botoon halongangan binahenmu di bagasan haholomon, manang hatigoranmu di bagasan * tano parhalupaan?",
			"14": "<sup>14</sup> Alai anggo ahu, ale Jahowa, sai tu Ho do ahu angguhangguk, gari sogot manogotna i nunga dijumpangkon tangiangki Ho.",
			"15": "<sup>15</sup> Boasa ma tung tulakkononmu tondingki, ale Jahowa, tabunihononmu bohim sian ahu?",
			"16": "<sup>16</sup> Na dangol do ahu jala matemate sian sidakdanahon, sai hupataontaon angka parsorion binahenmu, gabe mandeledele ahu.",
			"17": "<sup>17</sup> Nunga dibolus angka parpiarpiar ni murukmu ahu, nunga disiaphon angka sipasonggotmu ahu.",
			"18": "<sup>18</sup> Sai dihaliangi do ahu songon aek manipat ari, tung luhutna do mangonsongi ahu.",
			"19": "<sup>19</sup> Dipaholang Ho do sian ahu aleale dohot dongan magodang, gabe haholomon do angka na hutanda."
		},
		"89": {
			"1": "<sup>1</sup> Ende sipodaon sian si Etan, anak ni si Esra. I.",
			"2": "<sup>2</sup> Sai endehononku ma angka asi ni roha ni Jahowa salelenglelengna, sai pabotohonon ni pamanganku ma hasintonganmi marsundutsundut.",
			"3": "<sup>3</sup> Ai ningku do: * Sai lam manjadi hot do asi ni roha i salelenglelengna, marojahan di angka banua ginjang do hasintonganmi.",
			"4": "<sup>4</sup> Nunga hubahen padan tu na pinillit ni rohangku, nunga pola huuarihon tu si Daud, naposongki:",
			"5": "<sup>5</sup> Ro di saleleng ni lelengna do pahotonku pinomparmu, jala paulionku habangsami marsundutsundut. Sela!",
			"6": "<sup>6</sup> Jadi dipuji angka banua ginjang do halongangan binahenmu, ale Jahowa, nang hasintonganmu di * luhutan ni angka na badia.",
			"7": "<sup>7</sup> Ai tung ise ma di aoangaoang tudoshon Jahowa? Tung ise ma sian angka anak ni Debata doshon Jahowa?",
			"8": "<sup>8</sup> Debata na songkal situtu diluhutan ni angka na badia, jala tongam maradophon sude angka na humaliang Ibana.",
			"9": "<sup>9</sup> Ale Jahowa, Debata Zebaot, tung ise ma songon Ho? Pargogo, ale Jahowa jala hasintonganmu humaliang Ho.",
			"10": "<sup>10</sup> Ho do gumomgom hagunsangon ni laut; molo manaek angka galumbangna, Ho do pasohon.",
			"11": "<sup>11</sup> Nunga diropuhi Ho * Rahab, songon halak na tinampul: Dipaserak Ho do angka musum marhitehite botohon ni hagogoonmu.",
			"12": "<sup>12</sup> Gok di Ho do angka banua ginjang, gok di Ho do dohot tano on, nang portibi on ro di isina i, Ho do paojakkon nasida.",
			"13": "<sup>13</sup> Utara dohot dangsina. Ho do jumadihonsa, Tabor dohot Hermon marolopolop mida goarmu.",
			"14": "<sup>14</sup> Marbotohon na gogo do Ho, gogo do tanganmu, timbul do siamunmi.",
			"15": "<sup>15</sup> * Hatigoran dohot uhum do ojahan ni habangsami, + asi ni roha dohot hasintongan patujolo ni bohim.",
			"16": "<sup>16</sup> Martua ma bangso na umboto olopolop! Angka na marpangalaho di bagasan hatiuron ni bohim, ale Jahowa.",
			"17": "<sup>17</sup> Sai marolopolop do nasida manipat ari marhitehite goarmu, jala timbul do nasida hinorhon ni hatigoranmu.",
			"18": "<sup>18</sup> Ai Ho do saudara ni hagogoonnasida, jala hinorhon ni habasaonmi do manuarang tanduknami.",
			"19": "<sup>19</sup> Ai sian Jahowa do * lombulombunami, jala sian na badia ni + Israel do rajanami. II.",
			"20": "<sup>20</sup> * Uju i mangkatai do Ho di bagasan alatan tu angka na niasianmu, jala nimmu do: Nunga hupasahat pangurupion tu sada ulubalang, nunga hupabangkit sada dolidoli sian bangso i.",
			"21": "<sup>21</sup> Nunga jumpang Ahu si Daud, naposongku, nunga humiahi ibana, dohot miak habadiaonki.",
			"22": "<sup>22</sup> Sai tong do donganan ni tanganku ibana, nang botohonku margogoihon ibana.",
			"23": "<sup>23</sup> Na so tupa onjaron ni musu ibana, manang rupaon ni anak ni hajahaton ibana.",
			"24": "<sup>24</sup> Sai ropuhanku do angka alona maradophon ibana, jala ragehononku do angka na mangkosom ibana.",
			"25": "<sup>25</sup> Jala hasintonganku dohot asi ni rohangku mandongani ibana, jala manuarang do sogot * tandukna marhitehite goarhu.",
			"26": "<sup>26</sup> Jala pampeongku tanganna tu laut, jala siamunna tu angka sunge.",
			"27": "<sup>27</sup> Ianggo ibana jouonna ma Ahu: Damang do Ho, Debatangku dohot partanobatoan ni hatuaonku!",
			"28": "<sup>28</sup> Ahu pe bahenonku do ibana sihahaan, na tumimbul sian angka raja ni tano on.",
			"29": "<sup>29</sup> Ro di saleleng ni lelengna paianonku di ibana asi ni rohangku, jala sai hot do padanhu tu ibana.",
			"30": "<sup>30</sup> Sai pampeongku do pinomparna ro di salelenglelengna, jala habangsana matua langit.",
			"31": "<sup>31</sup> Molo tung ditadingkon angka anakna patikki, jala ndang marpangalaho di bagasan angka uhumhu.",
			"32": "<sup>32</sup> Molo tung diramuni nasida angka aturanku, jala ndang diradoti angka tonangku:",
			"33": "<sup>33</sup> Jadi luluhononku ma pangalaosinasida marhitehite linsinglinsing, dohot hajahatonnasida marhitehite angka parsorion.",
			"34": "<sup>34</sup> Alai anggo asi ni rohangku, ndada unsatonku sian ibana, jala ndang oseonku hasintonganki.",
			"35": "<sup>35</sup> Ndang ramunanku padan na hubahen i, jala ndang ubaonku na ruar sian bibirhu.",
			"36": "<sup>36</sup> Nunga pola huuarihon sahali tu * habadiaonki: + Molo tung gabusanku si Daud!",
			"37": "<sup>37</sup> Ingkon saleleng ni lelengna do pinomparna i, jala habangsana songon mata ni ari di jolongku.",
			"38": "<sup>38</sup> Hot do ibana salelenglelengna songon bulan, jala sintong do * sitindangi di ombun. Sela! III.",
			"39": "<sup>39</sup> Hape anggo nuaeng, ditulakkon, jala dibolongkon Ho do, tarrimas do Ho dompak na miniahanmu.",
			"40": "<sup>40</sup> Nunga diupir Ho padan tu naposomon, nunga diramuni Ho tumpalna i tu tano.",
			"41": "<sup>41</sup> Nunga dipuntasi Ho sude angka handangna, nunga magargar angka partanobatoanna i dibahen Ho.",
			"42": "<sup>42</sup> Sude angka pamolus * mamupusi ibana, manjadi + sieleseleson ni angka hombarna hundul ibana.",
			"43": "<sup>43</sup> Nunga dipatimbul Ho siamun ni angka alona i, jala marlas ni roha sude musuna i dibahen Ho.",
			"44": "<sup>44</sup> Angkup ni nunga dipabalik Ho * baba ni podangna i, jala ndang marnangon ibana di tongtangan dibahen Ho.",
			"45": "<sup>45</sup> Nunga dipesanhon Ho hadoharonna i, jala ditunggalingkon Ho habangsana tu tano.",
			"46": "<sup>46</sup> Nunga dipajempek Ho ariari ni haposoonna i, jala ditujungkon Ho tu ibana haurahon. Sela!",
			"47": "<sup>47</sup> Sadia leleng on, ale Jahowa, tabunihononmu dirim tongtong? Sai marjimburjimbur murukmu songon api?",
			"48": "<sup>48</sup> Sai ingot ma, pola sadia ma umurhu, boasa ma tung magopo panompam di manisia sudena?",
			"49": "<sup>49</sup> Tung ise ma baoa i na mangolu, so idaonna hamatean, tung tarpaluasa tondina i sian tangan ni banua toru? Sela!",
			"50": "<sup>50</sup> Didia do * asi ni roham, angka na jolo i, ale Tuhan, angka naung niuarihonmu tu si Daud di bagasan hasintonganmu?",
			"51": "<sup>51</sup> Sai ingot ma, ale Tuhan, haurahon ni angka naposomon, pangusungku di sude angka bangso na sai torop di bagasan ampuanku.",
			"52": "<sup>52</sup> Sai mangelesi do angka musum, ale Jahowa! Sai mangarehei angka bogas ni na miniahanmu do nasida.",
			"53": "<sup>53</sup> Pinuji ma Jahowa salelenglelengna! Amin! Amin!"
		},
		"90": {
			"1": "<sup>1</sup> Tangiang sian si Musa, naposo ni Debata. I. Ale Tuhan, sai Ho do haporusannami marsundutsundut!",
			"2": "<sup>2</sup> * Tagan so tubu dope angka dolok, jala tagan so adong dope ditubuhon tano on dohot portibi on, nunga adong hian Ho, ale Debata, sian salelenglelengna ro di salelenglelengna.",
			"3": "<sup>3</sup> Sumuang do gabe orbuk jolma i dibahen Ho, dung i didok Ho muse: * Mulak ma hamu, ale jolma manisia!",
			"4": "<sup>4</sup> Ai sobokkon sadari nantuari naung salpu do na saribu taon ianggo di jolom, jala songon sada gansi parjaga di borngin.",
			"5": "<sup>5</sup> Diumbang Ho do nasida, jadi mate ma nasida, manogotna i nunga martumbur diulahi songon * duhutduhut.",
			"6": "<sup>6</sup> Torang ari marbunga do i, jala martumbur, hape bodarina i disabi do jadi malos.",
			"7": "<sup>7</sup> Ai siap do hami dibahen rimasmu, jala binahen ni parpiar ni murukmu, umbahen tompu mago hami.",
			"8": "<sup>8</sup> Nunga dibahen Ho hajahatonnami tu jolom, dosanami angka na buni tu hatiuron ni bohim.",
			"9": "<sup>9</sup> Ai lam moru do angka ariarinami sudena dibahen rimasmu, ai songon ho i sada do laho suda angka taonnami.",
			"10": "<sup>10</sup> Ariari ni taonnami, intap pitupulu taon do i, jala molo marhagogoon situtu dieak do ualupulu taon, jala hinadenggan nasida do * hangaluton dohot halojaon, ai hatop situtu do laho salpu, jala habang do hami.",
			"11": "<sup>11</sup> Tung ise ma tumanda gogo ni rimasmu, jala dihabiari Ho hombar tu pangonai ni rimasmu?",
			"12": "<sup>12</sup> Sai parroha i ma hami mamilangi angka ariarinami, asa dapotan roha na bisuk hami. II.",
			"13": "<sup>13</sup> Sai marpangulahi ma roham, ale Jahowa! Tung sadia leleng on ma? Jala asi ma roham mida angka naposom.",
			"14": "<sup>14</sup> Disi torang ari pasabam ma rohanami marhitehite asi ni roham, asa marolopolop jala marlas ni roha hami di saluhut ariarinami.",
			"15": "<sup>15</sup> Sai palas ma rohanami timbang ni angka ari hajimputonnami, timbang ni angka taon hinamago, na huida hami.",
			"16": "<sup>16</sup> Sai pataridahon ma tu angka naposom angka * pambahenanmu dohot hamuliaonmu tu angka pinomparnasida.",
			"17": "<sup>17</sup> Sai songgop ma tu hita habasaron ni Jahowa Debatanta, sai * ditumpak Ibana ma pambahenan ni tanganta, olo tahe, sai ditumpak ma pambahenan ni tanganta i!"
		},
		"91": {
			"1": "<sup>1</sup> Manang ise na hundul di pangondingan ni Natumimbul i, marborngin do ibana di * linggom ni Pargogo na so hatudosan.",
			"2": "<sup>2</sup> Ningku do mandok Jahowa: Haporusanku jala * partanobatoanku, Debatangku, marhaposan tu Ibana do ahu!",
			"3": "<sup>3</sup> Ai anggo Ibana, sai paluaonna do ho sian * sambil ni parsambil, sian pangago i ni begu antuk.",
			"4": "<sup>4</sup> Sai ulosanna do ho dohot * habongna, jala marhaporusan tu toru ni hatirna i do ho, tau lombulombu dohot pangondingan do hasintonganna i.",
			"5": "<sup>5</sup> Ndang pola mabiar ho maradophon * songgotsonggot borngin, maradophon + sumbia, na habang arian.",
			"6": "<sup>6</sup> Maradophon begu antuk, na manisipi di na holom marimpotimpot, maradophon begu masa, na mangago di hos ni ari.",
			"7": "<sup>7</sup> Nang pe marribu marragean di lambungmi, jala marloksaloksa di siamunmi, ndang mangonai ianggo tu ho.",
			"8": "<sup>8</sup> Asal ambal matam manaili, idaonmu ma pamaloson tu angka parjahat i.",
			"9": "<sup>9</sup> Ai Ho do, ale Jahowa, haporusanku; Natumimbul i nunga dibahen ho partanobatoanmu.",
			"10": "<sup>10</sup> Ndang tagamon mangonai tu ho hinamago, jala ndang tagamon begu masa i dumonok tu undungundungmu.",
			"11": "<sup>11</sup> Ai dohononna do angka surusuruanna taringot tu ho, asa dijaga ho di angka dalanmu sudena.",
			"12": "<sup>12</sup> Sai * tangantanganonnasida do ho, asa unang + tartuktuk patmu tu batu.",
			"13": "<sup>13</sup> Bolusonmu do singa dohot hala, * degedegeonmu do singa dohot buea.",
			"14": "<sup>14</sup> Ala na holong situtu rohana di Ahu, jadi paluaonku ma ibana, patimbulonku ibana, ala tinandana i goarhu.",
			"15": "<sup>15</sup> * Jouonna ma Ahu, jadi alusanku ma ibana, sai dongananku do ibana jumpa hagogotan, + paluaonku do ibana, jala marmulia ibana bahenonku.",
			"16": "<sup>16</sup> Sai pamahaponku do ibana sarimatua, jala pataridahononku tu ibana hatuaonku."
		},
		"92": {
			"1": "<sup>1</sup> Ende di ari Sabbat. I.",
			"2": "<sup>2</sup> Na denggan situtu do na mamuji Jahowa dohot mangendehon goarmu, ale Natumimbul!",
			"3": "<sup>3</sup> Mamaritahon asi ni roham manogotna i dohot hasintonganmi bornginna i.",
			"4": "<sup>4</sup> Mardongan uninguningan sisampulutali dohot sisampuluduatali dohot hasapi.",
			"5": "<sup>5</sup> Ai nunga dipalas Ho rohangku, ale Jahowa, marhitehite angka pambahenanmu, marolopolop do ahu mida angka jadijadian ni tanganmu.",
			"6": "<sup>6</sup> Tung na balga do angka jadijadianmu, ale Jahowa, bagas situtu do angka pingkiranmu.",
			"7": "<sup>7</sup> Ianggo baoa na bodo ndang mananda disi, jala na oto ndang marateatehonsa.",
			"8": "<sup>8</sup> Lam martumbur pe angka parjahat songon duhutduhut, jala marbunga pe sude angka siulahon hajahaton, asa siaphononhon do nasida salelenglelengna.",
			"9": "<sup>9</sup> Alai anggo Ho, ale Jahowa, timbul do ro di salelenglelengna! II.",
			"10": "<sup>10</sup> Ai ida ma, angka musum, ale Jahowa! Ai ida ma, sai na siap do sogot angka musum sai na marserak do sude angka siulahon hajahaton.",
			"11": "<sup>11</sup> Alai dipatimbo Ho do tandukku songon tanduk ni sada rango, nunga dimiahi ahu dohot miak na lambok.",
			"12": "<sup>12</sup> Jala sombu do roha ni matangku marnida angka na mangonggop ahu, lomo do roha ni pinggolhu mananginangi barita ni angka na jungkat roha mangalo ahu.",
			"13": "<sup>13</sup> Ianggo partigor i, sai na martumbur do songon harambir, songon sada hau Ares di Libanon do ibana martunas.",
			"14": "<sup>14</sup> Angka na * sinuan di bagasan bagas joro ni Jahowa, marbunga do nasida di bagasan angka + alaman ni Debatanta.",
			"15": "<sup>15</sup> Sai marpinompari dope nasida, nang dung ubanon, marmiak jala rata do nasida.",
			"16": "<sup>16</sup> Mamaritahon, paboa na tigor do Jahowa, partanobatoanki, jala ndang adong hageduhon di bagasan Ibana."
		},
		"93": {
			"1": "<sup>1</sup> * Jahowa do raja, nunga marpangkean hamuliaon Ibana, marpangkean tongon Jahowa, nunga dihohoshon hagogoon: Jadi hot ma portibi on, ndang tagamon humuntal.",
			"2": "<sup>2</sup> Hot do habangsam sian na robi, sian saleleng ni lelengna do Ho.",
			"3": "<sup>3</sup> Nunga martimpul angka batang aek, ale Jahowa, nunga martimpul * hasak ni angka batang aek, nunga diumbakkon angka batang aek panunjanasida.",
			"4": "<sup>4</sup> Gumogo sian angka parhasak ni aek na godang do angka galumbang ni laut, alai tumongam sahali do Jahowa di banua ginjang.",
			"5": "<sup>5</sup> * Sintong situtu do angka panindangionmu, habadiaon do na tama di bagasmu, ale Jahowa, ro di salelenglelengna."
		},
		"94": {
			"1": "<sup>1</sup> I. Ale Debata Jahowa, * nampuna angka partubolon, ale Debata, nampuna angka partubolon, + marsinondang ma Ho!",
			"2": "<sup>2</sup> Hehe ma Ho, ale * Panguhum ni tano on, paro ma + partubolon mangalo angka na ginjang roha.",
			"3": "<sup>3</sup> Sadia leleng on angka parjahat i, ale Jahowa, sadia leleng on marolopolop angka parjahat i?",
			"4": "<sup>4</sup> Sai marbullakbullak do nasida mangkatahon hajungkaton, sai teal do pangkuling ni sude angka siulahon hajahaton.",
			"5": "<sup>5</sup> Sai diparsipal nasida do * bangsom, ale Jahowa, jala diruparupa parjambaranmu.",
			"6": "<sup>6</sup> Marragean do na mabalu dohot na buro dibahen nasida, jala dibunui do angka na tading di lampin.",
			"7": "<sup>7</sup> Dung i didok nasida: Ndang diida Jahowa, jala ndang marbinoto Debata ni si Jakkob.",
			"8": "<sup>8</sup> Ua manimbang ma hamu, ale angka na oto ni bangso i, jala hamu, ale angka na bodo, sadihari pe marbisuk hamu?",
			"9": "<sup>9</sup> Tung so marbinege ma Ibana Sisuan pinggol? Tung so marnida ma Sijadihon mata?",
			"10": "<sup>10</sup> Ibana, na mangajar angka parbegu, tung so marlulu Ibana, Ibana do na mangajarhon parbinotoan tu manisia?",
			"11": "<sup>11</sup> Ditanda Jahowa do angka pingkiran ni manisia, ai alogo do angka nasida. II.",
			"12": "<sup>12</sup> Martua ma baoa na pininsangmu, ale Jahowa, jala na pinodam marhite sian patikmu.",
			"13": "<sup>13</sup> Asa dipasonang Ho ibana maradophon angka ari hinamago, paima sidung hinali godung tu parjahat i.",
			"14": "<sup>14</sup> Ai ndang tagamon bolongkonon ni Jahowa anggo bangsona, manang tadingkononna parjambaranna.",
			"15": "<sup>15</sup> Ai sai mulak tu hatigoran do uhum, jadi ihuthonon ni sude angka na tigor roha ma Ibana.",
			"16": "<sup>16</sup> Tung ise ma donganku hehe mangalo angka parjahat i? Tung ise ma mangondihon ahu mangalo angka siulahon hajahaton?",
			"17": "<sup>17</sup> Aut sura unang Jahowa gabe pangurupion di ahu, na tung naung mangulon tondingku di * tano hasonangan.",
			"18": "<sup>18</sup> Molo didok rohangku: * Tarsulandit ma pathu, jadi disande asi ni roham do ahu, ale Jahowa.",
			"19": "<sup>19</sup> Di hinadeak ni holso ni rohangku di bagasan, sai dipasabam angka pangapoim do tondingku.",
			"20": "<sup>20</sup> Tung tagamon ma satahi Ho dohot * habangsa ni hamagoan, na pajadijadi halojaon tada tu patik hian?",
			"21": "<sup>21</sup> Sai marluhut i do nasida tumahi tondi ni partigor, jala mudar * na so marpipot ditorui nasida.",
			"22": "<sup>22</sup> Alai Jahowa do gabe partanobatoan di ahu, jala Debatangku gabe dolok batu haporusanku.",
			"23": "<sup>23</sup> Jala Ibana pasuang tu nasida hajahatonnasida i, jala siaphononna do nasida di bagasan hajahatonnasida i, siaphonon ni Jahowa Debatanta do nasida sogot."
		},
		"95": {
			"1": "<sup>1</sup> I. Beta hamu itaendehon ma Jahowa, itaolophon ma * partanobatoan ni hatuaonta!",
			"2": "<sup>2</sup> Itadapothon ma tu jolo ni bohina marhitehite pujipujian, itaolophon ma Ibana marhitehite ende!",
			"3": "<sup>3</sup> Ai Debata na timbul do Jahowa, jala raja bolon mangatasi sude angka debata.",
			"4": "<sup>4</sup> Di bagasan tanganna do angka ojahan ni tano on, jala guru di Ibana do punsu ni angka dolok.",
			"5": "<sup>5</sup> Guru di Ibana do laut, jala Ibana do tumompasa, jala tanganna do jumadihon tano darat.",
			"6": "<sup>6</sup> Beta hita manungkap dohot marsomba, marsinggang ma hita tu jolo ni Jahowa, Sitompa hita.",
			"7": "<sup>7</sup> Ai * Ibana do Debatanta, jala hita bangso pinarmahanna, jala birubiru ni tanganna. + Sadarion, aut ditangihon hamu nian soarana! II.",
			"8": "<sup>8</sup> Unang ma tangkangi hamu rohamuna songon uju di Meriba, songon ari uju di masa pangunjunan di halongonan.",
			"9": "<sup>9</sup> Uju na niunjunan ni angka ompumuna Ahu, tung diuji Ahu, atik pe naung diida nasida pambahenanku.",
			"10": "<sup>10</sup> Tung opatpulu taon bolon lelengna Ahu marbiasbias mida sundut i, jadi ningku ma: Bangso parroha lilu do nasida, alai ndang ditanda nasida angka dalanku.",
			"11": "<sup>11</sup> Jadi pola maruari Ahu di bagasan rimashu: * Molo tung masuk nasida tu paradiananku!"
		},
		"96": {
			"1": "<sup>1</sup> I. Endehon hamu ma sada ende na imbaru di Jahowa, endehon ma Jahowa, ale sandok tano on!",
			"2": "<sup>2</sup> Endehon hamu ma Jahowa, puji hamu ma goarna, baritahon hamu ma hatuaonna ganup ari.",
			"3": "<sup>3</sup> Pajojor hamu ma di tongatonga ni angka parbegu hamuliaonna i, di tongatonga ni saluhut bangso halongangan, angka na binahenna i.",
			"4": "<sup>4</sup> Ai na timbul do Jahowa, jala tama situtu pujion, na songkal do Ibana mangatasi sude angka debata.",
			"5": "<sup>5</sup> Ai ajiajian do sude debata ni angka bangso, alai anggo Jahowa naung manjadihon angka langit.",
			"6": "<sup>6</sup> Hatongamon dohot hamuliaon di jolona, hagogoon dohot hinauli masa di bagasan habadiaonna i. II.",
			"7": "<sup>7</sup> Hamu ale angka marga ni angka bangso, sai lehon hamu ma hamuliaon dohot hagogoon tu Jahowa!",
			"8": "<sup>8</sup> Lehon hamu ma di Jahowa hamuliaon ni goarna; * boan hamu ma silehonlehon dung i masuk ma hamu tubagasan angka alamanna.",
			"9": "<sup>9</sup> Marsomba ma hamu tu Jahowa marpangkean na marhadohoan, angka hitir ma maradophon Ibana ale isi ni sandok tano on.",
			"10": "<sup>10</sup> Paboaboa hamu ma di tongatonga ni angka parbegu: Jahowa do raja! Hot ma antong portibi on, ndang tagamon humordit, uhumonna ma sogot angka bangso di bagasan hatigoran.",
			"11": "<sup>11</sup> Marlas ni roha ma disi angka langit jala marolopolop tano on, marhasakhasak ma laut ro di isina.",
			"12": "<sup>12</sup> Marolopolop ma angka ladang ro di nasa na disi, marolopolop ma disi sude angka hau di tombak.",
			"13": "<sup>13</sup> Di jolo ni Jahowa, ai nunga ro Ibana, nunga ro Ibana manguhum tano on; uhumonna ma liat portibi on di bagasan hatigoran, nang angka bangso di bagasan hasintonganna."
		},
		"97": {
			"1": "<sup>1</sup> I. * Jahowa do raja, marolopolop ma tano on, marlas ni roha ma + pulopulo angka na lan i!",
			"2": "<sup>2</sup> Ombun jala haholomon marimpotimpot humaliang Ibana, hatigoran dohot uhum ojahan ni habangsana.",
			"3": "<sup>3</sup> Api mardalan di jolona manganhon angka alona humaliang.",
			"4": "<sup>4</sup> Disondangi angka hilapna do portibi on, jadi lalolalo tano on marnidasa.",
			"5": "<sup>5</sup> * Malala do angka dolok songon pantis maradophon bohi ni Jahowa, maradophon bohi ni + Tuhan ni sandok tano on.",
			"6": "<sup>6</sup> Dibaritahon angka langit do hatigoranna, jala sude angka bangso marnida hamuliaonna. II.",
			"7": "<sup>7</sup> Ingkon tarurak sogot sude angka sisomba ajiajian, angka na papujipuji dirina mida ganaganaan, ingkon marsomba tu Ibana do sude * angka debata sileban!",
			"8": "<sup>8</sup> Dibege Sion do i, jadi marlas ni roha ma, marolopolop ma angka boru ni Juda, ala ni panguhummu, ale Jahowa!",
			"9": "<sup>9</sup> Ai Ho do, ale Jahowa na tumimbul, gumomgom sandok tano on, tumimbul situtu do Ho sian nasa debata sileban.",
			"10": "<sup>10</sup> Hamu ale angka na mangkaholongi Jahowa, sai * hagigihon hamu ma na jat! Ibana do siramoti tondi ni angka na niasianna, sai paluaonna do nasida sian tangan ni parjahat.",
			"11": "<sup>11</sup> Sai tarsabur do hatiuron di partigor, jala las ni roha di angka na unjur marroha.",
			"12": "<sup>12</sup> Marlas ni roha ma hamu, ale angka partigor di bagasan Jahowa, jala puji hamu ma goarna na badia i!"
		},
		"98": {
			"1": "<sup>1</sup> Endehon hamu ma di Jahowa * ende na imbaru sada, ai nunga dipambahen Ibana angka halongangan; nunga ditumpahi siamunna i dohot tanganna na badia i Ibana.",
			"2": "<sup>2</sup> Nunga dipabotohon Jahowa hatuaonna i, nunga dipapatar Ibana hatigoranna i di adopan ni angka parbegu.",
			"3": "<sup>3</sup> Nunga diingot Ibana asi ni rohana dohot hasintonganna tu bagas ni Israel, nunga diida * luhut ujung ni tano on hatuaon ni Debatanta.",
			"4": "<sup>4</sup> Marsuraksurak ma ho, ale sandok tano on, mangolophon Jahowa, pangiar ma soaram marolopolop, jala marende ma hamu.",
			"5": "<sup>5</sup> Puji hamu ma Jahowa, marangkup arbap, mardongan arbap dohot soara ni ende!",
			"6": "<sup>6</sup> Marolopolop ma hamu di jolo ni Raja Jahowa, mardongan sarune dohot soara ni sangka.",
			"7": "<sup>7</sup> Mardorom ma laut ro di isina, portibi on ro di pangisina i.",
			"8": "<sup>8</sup> * Martopaptopap ma angka batang aek, rap marolopolop ma angka dolok.",
			"9": "<sup>9</sup> Dijolo ni Jahowa, ai nunga ro Ibana laho manguhum tano on, uhumonna ma portibi on marhitehite hatigoran dohot angka bangso marhitehite hasintongan."
		},
		"99": {
			"1": "<sup>1</sup> * Jahowa do raja, angka hitir ma angka bangso; + marhabangsahon kerubim Ibana, humuntal ma tano on.",
			"2": "<sup>2</sup> Tongam do Jahowa di Sion, jala timbul do Ibana gumomgom sude angka bangso.",
			"3": "<sup>3</sup> Pujionnasida ma sogot goarmu na timbul jala na songkal, na badia do Ibana.",
			"4": "<sup>4</sup> Dohot hagogoon ni raja na mangkaholongi uhum. Nunga dipahot Ho * hasintongan, nunga dipamasa Ho uhum dohot hatigoran di Jakkob.",
			"5": "<sup>5</sup> Patimbul hamu ma Jahowa Debatanta i, jala marsinggang ma hamu tujolo ni sidegedegean ni patna, na badia do Ibana!",
			"6": "<sup>6</sup> Si Musa dohot si Aron di tongatonga ni angka malimna, jala si Samuel di tongatonga ni angka sijou goarna, manjoujou do nasida tu Jahowa, jadi Ibana mangalusi nasida.",
			"7": "<sup>7</sup> Di bagasan ombun na marsijongjong Ibana mangkatai tu nasida, diradoti nasida do angka panindangionna i dohot patik na nilehonna i tu nasida.",
			"8": "<sup>8</sup> Ale Jahowa, Debatanami, Ho do mangalusi nasida, Debata na marpamuati do Ho di nasida, jala parlulu di pambahenannasida.",
			"9": "<sup>9</sup> Sai patimbul hamu ma Jahowa Debatanta i, jala marsinggang ma hamu di dolokna na badia i, ai na badia do Jahowa Debatanta i."
		},
		"100": {
			"1": "<sup>1</sup> Ende hamauliateon. Olophon ma Jahowa, ale sandok tano on!",
			"2": "<sup>2</sup> Oloi hamu ma Jahowa marhitehite las ni roha, ro be ma hamu tu jolona marhitehite olopolop.",
			"3": "<sup>3</sup> Boto hamu ma on: Jahowa do Debata; ibana jumadihon hita, jala Ibana nampuna hita, bahen bangsona dohot birubiru pinarmahanna.",
			"4": "<sup>4</sup> Bongot i hamu ma angka bahalna marhitehite hamauliateon, angka alamanna marhitehite pujipujian, mauliate ma rohamuna tu Ibana, puji hamu ma goarna.",
			"5": "<sup>5</sup> Ai pardengganbasa do Jahowa, ro di saleleng ni lelengna do asi ni rohana, jala marsundutsundut do hasintonganna."
		},
		"101": {
			"1": "<sup>1</sup> Ende sian si Daud. Asi ni roha dohot uhum endehononku, umpalu parhinaloan ma ahu mamuji Ho, ale Jahowa.",
			"2": "<sup>2</sup> Naeng pantas ahu marpangalahohon dalan haburjuon; sadihari pe ro Ho manopot ahu, naeng ahu marpangalahohon hadaulaton ni rohangku ditonga ni jabungku.",
			"3": "<sup>3</sup> Ndang olo ahu mambahen pambahenan na jat di jolo ni matangku; dihagigihon rohangku do pambahenan roharoha, tung na so jadi dais do i tu ahu.",
			"4": "<sup>4</sup> Ingkon mandao sian ahu roha pangansi, ndang hutanda hajahaton.",
			"5": "<sup>5</sup> Manang ise na marsibuni mangkata tundal donganna, sai siaphononku do ibana; manang ise * parmata baus dohot parroha manggang, ndang tarparrombang ahu.",
			"6": "<sup>6</sup> Sai humatamatahon do angka parburju ni luat i bahen donganku sahundulan; manang ise na mangihutihut dalan hadaulaton, ingkon ibana parhaladongku.",
			"7": "<sup>7</sup> Na so tupa maringan ditonga ni jabungku sibahen sipaotooto; na so tupa mian di adopan ni matangku sihatahon gabus.",
			"8": "<sup>8</sup> Sai siaphononku do ganup sogot sude angka parjahat ni luat i umpidomhon sian huta ni Jahowa sude angka siulahon hajahaton."
		},
		"102": {
			"1": "<sup>1</sup> Tangiang sian sada halak na dangol jumpa maras ibana, jala * diusehon alualuna tujolo ni Jahowa. I.",
			"2": "<sup>2</sup> Ale Jahowa, sai tangi ma tangiangkon, jala sai tolhas tu Ho ma angukkon!",
			"3": "<sup>3</sup> Unang tung tabunihon bohim maradophon ahu di ari hagogotanki, sai paeleng ma pinggolmu tu ahu, hapogani ma mangalusi ahu di ari panjouonku.",
			"4": "<sup>4</sup> Ai nunga salpu ariaringku songon * timus, jala mohop situtu holiholingku songon dalihan.",
			"5": "<sup>5</sup> Mosok songon duhutduhut jala mahiang ateatengku, gari manganhon sipanganon lupa do rohangku.",
			"6": "<sup>6</sup> Manandos holiholingku di sibukku dibahen soara ni anggukku.",
			"7": "<sup>7</sup> Tudoshon * onggang di halongonan do ahu, songon sipauk di turanggong do ahu.",
			"8": "<sup>8</sup> Sai marhal do ahu, jadi songon amporik na meat punjung di tarup do ahu.",
			"9": "<sup>9</sup> Manipat ari sai direhei angka musungku ahu, angka nalalaen do nasida mambahen ahu panolonannasida.",
			"10": "<sup>10</sup> Ai sirabun do hupangan i songon roti, jala husaor iluilungku tu siinumonku.",
			"11": "<sup>11</sup> Maradophon rimasmu dohot parpiripirionmu, ai jolo dijomput Ho ahu, dung i ditimpalhon Ho ahu.",
			"12": "<sup>12</sup> Songon halinu na manihir do angka ariaringku, jala lam malos do ahu songon duhutduhut. II.",
			"13": "<sup>13</sup> Alai anggo Ho, ale Jahowa, sai marhabangsa do Ho salelenglelengna, jala marsundutsundut do parningotan di Ho.",
			"14": "<sup>14</sup> Sai hehe ma Ho mambahen asi ni roham di Sion, ai nunga jumpang tingki parasi ni roha di ibana, nunga ro tingkina.",
			"15": "<sup>15</sup> Ai holong situtu do roha ni angka naposom mida angka batu ni Sion, jala habot do rohanasida mida orbukna.",
			"16": "<sup>16</sup> Jadi mabiar sogot angka parbegu mida goar ni Jahowa, ro di sude angka raja ni tano on mida hamuliaonmu.",
			"17": "<sup>17</sup> Ala naung dipauli Jahowa Sion i, naung tarida Ibana di hamuliaonna.",
			"18": "<sup>18</sup> Naung marpangulahi rohana mida tangiang ni na so mardihadiha, jala * ndang lea rohana di tangiangnasida.",
			"19": "<sup>19</sup> Surathononhon ma i tu na pinompar sogot, jadi bangso sitompaon dope mamuji Jahowa sogot.",
			"20": "<sup>20</sup> Ala naung manatapnatap Ibana sian habadiaonna na timbo i, ala naung mandulo Jahowa sian banua ginjang tu tano on.",
			"21": "<sup>21</sup> Laho manangihon hoihoi ni angka na tarbuang, laho paluahon angka anak ni hamatean hian.",
			"22": "<sup>22</sup> Asa dibaritahon nasida di Sion goar ni Jahowa dohot baritana di Jerusalem.",
			"23": "<sup>23</sup> Molo sange marpungu sogot angka bangso ro di angka harajaon mangoloi Jahowa.",
			"24": "<sup>24</sup> Nunga suda gogongku di tongandalan dibahen Ibana, nunga dipajempek ariaringku.",
			"25": "<sup>25</sup> Ningku ma: Ale Debatangku, unang tung alap ahu di parsitongaan ni angka ariaringku, marsundutsundut do ianggo angka taonmi.",
			"26": "<sup>26</sup> Ho do paojakkon tano on di na robi, jala jadijadian ni tanganmu do angka langit.",
			"27": "<sup>27</sup> Ianggo nasida laho mago do sogot, alai anggo Ho sai hot do; laho buruk do ianggo nasida sude songon ulos; songon sampesampe paubaonmu nasida sogot, gabe muba ma nasida.",
			"28": "<sup>28</sup> Alai sai tong do ianggo Ho, jala ndang olo marujung angka taonmi.",
			"29": "<sup>29</sup> Sai dapotan inganan do angka anak ni naposom, jala sai hot di jolom do pinomparnasida."
		},
		"103": {
			"1": "<sup>1</sup> Ende sian si Daud. Puji ma Jahowa, * ale tondingku, jala nasa rohangku di bagasan mamuji goarna na badia i.",
			"2": "<sup>2</sup> Puji ma Jahowa, ale tondingku, jala unang tung halupahon denggan ni basana sudena.",
			"3": "<sup>3</sup> Ibana do manesa dosam sudena, Ibana pamalum angka sahitmu sudena.",
			"4": "<sup>4</sup> Ibana * paluahon ngolum sian hamagoan, Ibana + martumpalhon tu ho denggan basa dohot asi ni roha.",
			"5": "<sup>5</sup> Ibana pamahap roham marhitehite denggan basa, asa mulak poso ho, songon * pidong raja wali.",
			"6": "<sup>6</sup> Jahowa do patupahon angka pambahenan hatigoran, jala dipatingkos uhum tu sude angka na nirupa.",
			"7": "<sup>7</sup> Ibana do pabotohon angka dalanna tu si Musa, tu angka anak ni Israel angka pambahenna i.",
			"8": "<sup>8</sup> Parasi roha jala pardengganbasa do Jahowa, lambat tarrimas jala parasi roha godang.",
			"9": "<sup>9</sup> Ndang tongtong Ibana manorui, jala ndang gotos rohana saleleng ni lelengna.",
			"10": "<sup>10</sup> Ndang dibahen tu hita hombar tu angka dosanta, jala ndang dibaloshon tu hita hombar tu angka hajahatonta.",
			"11": "<sup>11</sup> Ai songon dao ni langit sian tano on do gogo ni asi ni rohana di angka na mangkabiari Ibana.",
			"12": "<sup>12</sup> Songon dao ni habinsaran sian hasundutan dipadao Ibana sian hita angka pangalaosintai.",
			"13": "<sup>13</sup> Songon asi ni amaama tu angka anakna asi ni roha ni Jahowa di angka na mangkabiari Ibana.",
			"14": "<sup>14</sup> Ai diboto Ibana do tompanta, diingot do * orbuk hita.",
			"15": "<sup>15</sup> Songon duhutduhut do ariari ni jolma na gale i, marbunga ibana songon bunga di ladang.",
			"16": "<sup>16</sup> Ai dibolus alogo ibana, jadi ndang disi be, jala ndang tartanda be ingananna i.",
			"17": "<sup>17</sup> Alai anggo asi ni roha ni Jahowa sian salelenglelengna do ro di salelenglelengna di angka na mangkabiari Ibana, jala hatigoranna marnini marnono.",
			"18": "<sup>18</sup> Di angka na mangaradoti padan binahenna i dohot patupahon angka patikna i.",
			"19": "<sup>19</sup> Nunga dipaojak Jahowa habangsana di banua ginjang, jala harajaonna sasudena.",
			"20": "<sup>20</sup> Puji ma Jahowa, hamu ale angka surusuruanna, hamu ale * angka ulubalang na gogo, angka na + patupahon hatana, di na tinangihonmuna soara ni hatana i!",
			"21": "<sup>21</sup> Puji ma Jahowa, hamu ale angka paranganna i sudena, hamu angka parhaladona, angka sipasaut lomo ni rohana!",
			"22": "<sup>22</sup> Puji ma Jahowa, hamu ale * angka jadijadianna sudena, di sude inganan ni harajaonna i, puji ma Jahowa, ale tondingku!"
		},
		"104": {
			"1": "<sup>1</sup> I. Puji ma Jahowa, ale tondingku! Na bolon situtu do Ho, ale Jahowa Debatangku, * marpangkean hasangapon dohot hamuliaon do Ho.",
			"2": "<sup>2</sup> * Hatiuron dialithon Ibana hira ulos, Ibana pahembangkon angka langit songon + rimberimbe.",
			"3": "<sup>3</sup> Ibana manggulanggulangi di angka aek bilutna parginjang; huretana do dibahen angka ombun i, mardalandalan do Ibana di atas habong ni alogo.",
			"4": "<sup>4</sup> Ibana mambahen angka alogo surusuruanna, api na marjimburjimbur bahen parhaladona.",
			"5": "<sup>5</sup> Nunga dipaojak Ibana tano on tu angka ojahanna i, asa unang lalolalo salelenglelengna.",
			"6": "<sup>6</sup> Lintong majoajo do pangkuphupina dibahen hira ulos, disalpui aek i do angka dolok.",
			"7": "<sup>7</sup> Maporus do angka i dibahen pangasupim, humalaput do nasida maporus maradophon soara ni ronggurmu.",
			"8": "<sup>8</sup> Hinsat ma angka dolok, marongrong ma angka rura tu inganan, na pinaojakmu hian di nasida.",
			"9": "<sup>9</sup> Nunga dibahen Ho hian sada parbolatan, na so tupa salpuanna, ndang jadi ulahanna manghungkupi tano on.",
			"10": "<sup>10</sup> Ibana manongos angka mual di angka rura, sian holangkolang ni angka dolok do angka i mabaor.",
			"11": "<sup>11</sup> Dipasobur nasida saluhut binatang harangan, gabe sombu ma uas ni angka halode harangan.",
			"12": "<sup>12</sup> Marasari di lambungnasida i pidong angka na martongatonga langit, angka na pahar soarana sian holangkolang ni angka dangka.",
			"13": "<sup>13</sup> Ibana pasobur angka dolok sian angka bilutna parginjang i, sian parbue ni angka jadijadianmu do butong tano on.",
			"14": "<sup>14</sup> Ibana patubuhon duhutduhut di pinahan dohot ingkau rata bahen parulian ni jolma, laho paruarhon roti sian tano on.",
			"15": "<sup>15</sup> Ro di * anggur, na palas roha ni jolma na gale i, asa marmiak bohina lobi sian na hona miak, dohot roti na tumungkol roha ni jolma na gale i.",
			"16": "<sup>16</sup> Butongan ma angka hau ni Jahowa, angka hau Ares ni Libanon, angka na sinuanna i.",
			"17": "<sup>17</sup> Disi ma marasari angka pidong; siboru tasik i na marjabuhon hau tusam.",
			"18": "<sup>18</sup> Angka bedu do nampuna dolok angka na timbo i, haporusan ni angka antuasu do angka dolok batu.",
			"19": "<sup>19</sup> Ibana mambahen bulan panjujuran tingki, diboto mata ni ari do hasundutanna.",
			"20": "<sup>20</sup> Ho do mambahen haholomon, jadi tubu ma borngin, disi ma gumamang saluhut binatang harangan;",
			"21": "<sup>21</sup> Singa na bajar, angka na patungaor mangido sisoroonna jala mangalului sian Debata sipanganonnasida.",
			"22": "<sup>22</sup> Binsar mata ni ari, manginsurut ma nasida, laho manggompang tubagasan liangnasida.",
			"23": "<sup>23</sup> Ruar ma jolma i tumopot ulaonna, na pinuhutanna rasirasa bot ari. II.",
			"24": "<sup>24</sup> Tung na lan situtu do angka jadijadianmu, ale Jahowa! Saluhutna i dipauli Ho marhitehite hapistaran, tung gok jadijadianmu do tano on.",
			"25": "<sup>25</sup> Tole laut i na balga jala na lambas, disi do rumamang angka gulokgulok na so habilangan, binatang angka na metmet rap dohot angka na balga.",
			"26": "<sup>26</sup> Disi do mardalani angka parau, tole buea, na jinadihonmu, asa marmeammeam disi.",
			"27": "<sup>27</sup> Saluhut nasida mangaranap tu Ho, asa lehononmu sipanganonnasida di tingkina be.",
			"28": "<sup>28</sup> Molo dilehon Ho di nasida, dijomputi nasida, molo dipatedek Ho tanganmu, butongan nasida di na denggan i.",
			"29": "<sup>29</sup> Molo ditabunihon Ho bohim, holsoan ma nasida, ditait Ho ma hosanasida, monding ma nasida, jala mulak nasida tu orbuknasida hian.",
			"30": "<sup>30</sup> Molo ditongos Ho tondim, tartompa ma nasida, jala dipaimbaru Ho do rupa ni tano on.",
			"31": "<sup>31</sup> Sai ro di salelenglelengna ma hamuliaon ni Jahowa * marlas ni roha ma Jahowa mida angka jadijadianna i!",
			"32": "<sup>32</sup> Molo Ibana mamereng tano on, jadi humuntal ma, dijama angka dolok, jadi martimus ma.",
			"33": "<sup>33</sup> Endehononku ma Jahowa saleleng di ngolungku, umpalu parhinaloan ma ahu umpuji Debatangku, saleleng adong dope ahu.",
			"34": "<sup>34</sup> Sai dihalomohon rohana ma nian pingkiranku, ianggo ahu, sai marlas ni roha do ahu mida Jahowa.",
			"35": "<sup>35</sup> Sai siap ma nian angka pardosa sian tano on, jala unang adong be angka parjahat! Puji ma Jahowa, ale tondingku! Halleluya!"
		},
		"105": {
			"1": "<sup>1</sup> I. Puji hamu ma Jahowa, baritahon hamu ma goarna i, pabotohon hamu di tongatonga ni angka bangso angka pambahenanna i!",
			"2": "<sup>2</sup> Endehon hamu ma Ibana, palu hamu ma parhinaloan umpuji Ibana, marnonangi ma hamu taringot tu halongangan angka na binahenna i sudena.",
			"3": "<sup>3</sup> Tunggulhon hamu ma goarna na badia i, * marlas ni roha ma angka na mangalului Jahowa.",
			"4": "<sup>4</sup> Sisiri hamu ma Jahowa dohot hagogoonna i, tongtong ma * lulu i hamu bohina.",
			"5": "<sup>5</sup> Sai ingot hamu ma halongangan angka naung binahenna i, angka tanda halongangan naung binahenna i dohot uhum angka na ruar sian pamanganna.",
			"6": "<sup>6</sup> Hamu ale pinompar ni si Abraham, naposona i, hamu ale anak ni si Jakkob, angka na pinillitna i!",
			"7": "<sup>7</sup> Ibana, Jahowa do Debatanta, sar tu liat portibi on do angka uhumna.",
			"8": "<sup>8</sup> Sai marningot do Ibana di padan binahenna ro di salelenglelengna, di hata pinatikna i marriburibu sundut.",
			"9": "<sup>9</sup> Padan naung binahenna i tu si Abraham, ro di uarina tu si Isak.",
			"10": "<sup>10</sup> Jala dihajongjongkon do i tu si Jakkob bahen patik, tu si Israel bahen padan salelenglelengna.",
			"11": "<sup>11</sup> Ninna do: Tu ho do lehononku tano Kanaan, partalian ni partohapanmuna.",
			"12": "<sup>12</sup> Uju jolma habilangan dope nasida, otik jala paisolat disi.",
			"13": "<sup>13</sup> Jala sai marbungkasan nasida sian bangso tu bangso, sian sada harajaon tu bangso na asing.",
			"14": "<sup>14</sup> Ndang diloas Ibana halak mangarupa nasida, jala dipinsang do angka raja ala nasida.",
			"15": "<sup>15</sup> Unang hahua hamu angka na humiahi, jala unang sonoi hamu angka panurirangku!",
			"16": "<sup>16</sup> Dung i dipasonggop Ibana haleon tu tano i, diponggolhon ma nasa tungkot parbohalan.",
			"17": "<sup>17</sup> Disuru Ibana sada halak parjolonasida, targadis ma si Josep gabe hatoban.",
			"18": "<sup>18</sup> Disuhulhon halak ma patna i tu beangan, sumuruk bosi do hosana i.",
			"19": "<sup>19</sup> Paima jumpang tingki hasosonggop ni hatana, dung diuji pangkataion ni Jahowa ibana.",
			"20": "<sup>20</sup> Jadi disuru rajai ma paluahon ibana, sigomgom angka bangso mandokkon tanggalon ibana.",
			"21": "<sup>21</sup> Dipabangkit ma ibana bahen induk ni jabuna dohot sigomgom sinamotna sudena.",
			"22": "<sup>22</sup> Asa tarihot angka indukna guru lomo ni rohana, jala diparbisuhi angka sintuana.",
			"23": "<sup>23</sup> Dung i tolhas ma Israel tu Misir, gabe paisolat ma si Jakkob di tano ni si Ham.",
			"24": "<sup>24</sup> Dung i gabe situtu ma bangsona i ditumpak, jala sumangap do i dibahen sian angka alona i.",
			"25": "<sup>25</sup> Dipahosing ma ianggo rohanasida mangkosom bangsona i, mambahen bisukbisuk tu angka naposona i. II.",
			"26": "<sup>26</sup> Dung i disuru ma si Musa, naposona i, si Aron, na pinillitna i.",
			"27": "<sup>27</sup> Dipatupa nasida na dua ma di tongatonganasida tanda angka na tinonahonna dohot angka halongangan di tano ni si Ham.",
			"28": "<sup>28</sup> Ditongos Ibana ma haholomon, asa paholomhon, jadi ndang dijua nasida angka hatana i.",
			"29": "<sup>29</sup> Dipauba angka batang aeknasida gabe mudar, jadi marragean ma dengkenasida.",
			"30": "<sup>30</sup> Marrumang ma angka tohuk sian tanonasida masuk tubagasan bilut ni angka rajanasida.",
			"31": "<sup>31</sup> Mangkuling ma Ibana, jadi ro ma angka naning, angka rongit di sandok parbolatannasida.",
			"32": "<sup>32</sup> Udannasida gabe ambolas dibahen Ibana, angka jimburjimbur ni api di tanonasida.",
			"33": "<sup>33</sup> Jala i do mamopoi hau anggur dohot antajaunasida, jala ditipulhon angka hau di parbolatannasida.",
			"34": "<sup>34</sup> Mangkuling Ibana, jadi ro ma angka sihapor dohot tamponok so habilangan.",
			"35": "<sup>35</sup> Jadi dijampal ma sude ingkau rata di tanonasida, dijampal dohot parbue ni tanonasida.",
			"36": "<sup>36</sup> Dung i diantuk Ibana ma nasa buhabaju di tanonasida, patumonaan ni gogonasida sudena.",
			"37": "<sup>37</sup> Dung i diparuar ma nasida * mantat perak dohot sere, jala ndang adong + na gale di angka marganasida i.",
			"38": "<sup>38</sup> Marlas ni roha do Misir di na ruar i nasida, ai madabu do tu nasida hatahuton maradophon nasida.",
			"39": "<sup>39</sup> Dipaherbang Ibana sada ombun bahen parlapelapean, dohot api patiurhon borngin.",
			"40": "<sup>40</sup> Mangido nasida, jadi diparo ma angka lote, jala dipamahap nasida mangan sagusagu sian banua ginjang.",
			"41": "<sup>41</sup> Ibana mangarigathon dolok batu, jadi mabaor angka aek, angka na mardalan di tano tangkaltangkal songon sunge.",
			"42": "<sup>42</sup> Ai diingot Ibana do hatana na badia i tu si Abraham, naposona i.",
			"43": "<sup>43</sup> Jadi Ibana paruarhon bangsona i marhinsa ni roha, marolopolop do angka na pinillitna i.",
			"44": "<sup>44</sup> Dung i dilehon Ibana tu nasida angka tano ni parbegu, jala nasida do tumean na niula ni angka bangso.",
			"45": "<sup>45</sup> Asa diradoti nasida angka aturanna jala diparangehon angka patikna i. Halleluya!"
		},
		"106": {
			"1": "<sup>1</sup> I. Halleluya! Mandok mauliate ma hamu di Jahowa, ai na basa do Ibana, ai ro di salelenglelengna do asi ni rohana i.",
			"2": "<sup>2</sup> Tung ise ma tuk mangkatahon angka hagogoon ni Jahowa, patubegehon baritana i sudena?",
			"3": "<sup>3</sup> Martua ma angka na mangaradoti uhum, na tongtong patupahon hatigoran.",
			"4": "<sup>4</sup> Sai ingot ma ahu, ale Jahowa, hombar tu halolomo di bangsom, sai tingkir ma ahu marhitehite hatuaonmi!",
			"5": "<sup>5</sup> Asa hupaidaida hadoharon ni angka na pinillitmu, asa huhalashon halalas ni roha ni bangsomi, mamujimuji rap dohot partohapanmi. II.",
			"6": "<sup>6</sup> Nunga mardosa hami rap dohot ompunami, nunga mangulahon hageduhon hami, nunga manjahati hami.",
			"7": "<sup>7</sup> Ndang diparateatehon angka ompunami di Misir halongangan angka na binahenmi, ndang diingot nasida hinagodang ni asi ni roham, jala mangalo do nasida di lambung laut pararungan i.",
			"8": "<sup>8</sup> Hape Ibana paluahon nasida ala ni goarna i, laho pabotohon hagogoonna i.",
			"9": "<sup>9</sup> Jadi mangonai hata do Ibana tu laut pararungan i, gabe marsik ma, dung i Ibana manogihon nasida umbolus angka lung songon adaran.",
			"10": "<sup>10</sup> Jadi Ibana paluahon nasida sian tangan ni parsomor, jala ditobus nasida sian tangan ni musu.",
			"11": "<sup>11</sup> Dung i dilungkupi aek alonasida i, nanggo sada sian nasida ndang teba.",
			"12": "<sup>12</sup> Jadi dihaporseai nasida ma angka hatana, diendehon ma baritana i. III.",
			"13": "<sup>13</sup> Hape tibu do dihalupahon nasida angka pambahenanna i, ndang dipaima nasida sangkapna i.",
			"14": "<sup>14</sup> Lam mangoloi hisaphisap do nasida di halongonan, jala diunjuni Debata di tano tangkaltangkal.",
			"15": "<sup>15</sup> Jadi dilehon Ibana tu nasida pinangidonasida i, gabe ditongos ma begu tiarap ala ni hisaphisapnasida i.",
			"16": "<sup>16</sup> Dung i mangiburu ma nasida dompak si Musa di parsaroan, dompak si Aron, na badia ni Jahowa.",
			"17": "<sup>17</sup> Dipangangang tano i ma babana asa mamondut si Datan, jala dilungkupi luhutan ni si Abiram.",
			"18": "<sup>18</sup> Jala didilati api luhutannasida i, nala ni api mansudahon angka parjahat i.",
			"19": "<sup>19</sup> Dipauli nasida ma sada lombu di Horeb, jala marsomba nasida tu gombaran na tinuang i.",
			"20": "<sup>20</sup> Jadi disambarhon nasida ma hamuliaonnasida tu sumansuman ni lombu, sigagat duhut.",
			"21": "<sup>21</sup> Nunga * dihalupahon nasida Debata, Sipaluanasida i, na patupahon angka pambahenan na balga di Misir.",
			"22": "<sup>22</sup> Angka halongangan di tano ni si Ham, angka sipasonggot di lambung laut pararungan.",
			"23": "<sup>23</sup> Nunga pola didok Ibana, siaphononna nasida, aut unang si Musa, na pinillitna i * jongjong di partostosan di jolona i, paombunhon murukna i, asa unang disiaphon.",
			"24": "<sup>24</sup> Dung i dihapishon rohanasida tano na hinapianan ni roha, ndang dihaporseai nasida hatana i.",
			"25": "<sup>25</sup> Marmungutmungut ma nasida di bagasan undungundungnasida i, ndang ditangihon nasida soara ni Jahowa.",
			"26": "<sup>26</sup> Jadi ditenggalhon Ibana ma tanganna dompak nasida, naeng mangaragehon nasida di halongonan.",
			"27": "<sup>27</sup> Mandanggurhon dohot pinomparnasida tu tongatonga ni angka parbegu, jala paserakkon nasida tu angka luat.",
			"28": "<sup>28</sup> Dung i diharosuhon nasida ma Baal-Peor huhut manganhon angka pelean ni na mate ajiajiannasida.",
			"29": "<sup>29</sup> Sai maminggili do nasida di pambahenannasida i, jadi rarat ma begu masa mangaragehon nasida.",
			"30": "<sup>30</sup> Dung i hehe ma si Pinehas mangaluluhon, gabe motap ma begu masa i.",
			"31": "<sup>31</sup> Jadi dietong ma i tu ibana gabe hatigoran marsundutsundut sahat ro di salelenglelengna.",
			"32": "<sup>32</sup> Dung i manggitihi muse nasida di lambung aek Meriba parbadaan, gabe tarjea ma si Musa dibahen nasida.",
			"33": "<sup>33</sup> Ai ditaji nasida tondina i, gabe tarsor ma bibirna mandok soara. IV.",
			"34": "<sup>34</sup> Ndang disiaphon nasida angka bangso, * naung nidokkon ni Jahowa tu nasida.",
			"35": "<sup>35</sup> Lam disaorsaor nasida do angka parbegu, jala diguruhon angka pambahenannasida.",
			"36": "<sup>36</sup> Jala dipapelepele angka ajiajiannasidai, jadi jorgong ma i tu nasida.",
			"37": "<sup>37</sup> Huhut do dipampelehon nasida angka anak dohot borunasida tu begu.",
			"38": "<sup>38</sup> Jala dipandurushon nasida mudar na so marpipot, mudar ni angka anak dohot borunasida, angka na pinelehonna tu angka ajiajian ni tano Kanaan, gabe ramun ma tano i dibahen sapata ni mudar.",
			"39": "<sup>39</sup> Jadi ormus ma nasida di pambahenannasida i, jala mangincui nasida di parulaon nasida i.",
			"40": "<sup>40</sup> Jadi marpiarpiar ma muruk ni Jahowa dompak bangso i, jala dihabiashon partohapanna i.",
			"41": "<sup>41</sup> Dung i dipasahat ma nasida tubagasan tangan ni angka parbegu, gabe digomgom halak na mangkasomorhon nasida ma nasida.",
			"42": "<sup>42</sup> Jadi dirupa musunasida i ma nasida, gabe tarsugutsugut nasida tu toru ni tanganna.",
			"43": "<sup>43</sup> Mansai jotjot do nian Ibana paluahon nasida, hape anggo nasida sai mangalo do mangihutihut sangkapnasida i, jadi pesan ma nasida binahen ni hajahatonnasida i. V.",
			"44": "<sup>44</sup> Alai manatap ma anggo Ibana di hagogotannasida i, uju na tinangihonna i angguhangguknasida.",
			"45": "<sup>45</sup> Jadi diingot Ibana muse padanna i tu nasida, meol ma rohana hombar tu hinagodang ni asi ni rohana.",
			"46": "<sup>46</sup> Jadi dapotan asi ni roha ma nasida dibahen maradophon sude angka na mambuangkon nasida.",
			"47": "<sup>47</sup> Tumpahi ma hami, ale Jahowa, Debatanami, jala papungu hami sian angka parbegu, asa hupuji hami goarmu na badia i jala martanggulhon baritami.",
			"48": "<sup>48</sup> Pinuji ma Jahowa, Debata ni Israel sian na saingan sahat ro di salelenglelengna jala rim bangso i mandok: Amin! Halleluya!"
		},
		"107": {
			"1": "<sup>1</sup> I. * Mandok mauliate ma hamu di Jahowa, ai pardengganbasa do Ibana, ai salelenglelengna do asi ni rohana i.",
			"2": "<sup>2</sup> I ma dohonon ni angka na pinalua ni Jahowa, angka na pinaluana sian tangan ni musu.",
			"3": "<sup>3</sup> Jala angka na pinapunguna i sian angka luat, sian habinsaran dohot sian hasundutan, sian utara dohot sian laut i.",
			"4": "<sup>4</sup> Lilu do angka nasida di halongonan di dalan na lungun, ndang jumpang nasida huta soranganna.",
			"5": "<sup>5</sup> Male huhut mauas nasida, pola tarhatos rohanasida di bagasan.",
			"6": "<sup>6</sup> Jadi joujou ma nasida tu Jahowa di hagogotannasida i, gabe dipalua Ibana nasida sian hagogotannasida i.",
			"7": "<sup>7</sup> Dung i ditogihon ma nasida di dalan na tigor i, asa tolhas nasida tu huta siinganan. II.",
			"8": "<sup>8</sup> Ingkon pujionnasida ma Jahowa ala ni asi ni rohana dohot halongangan angka na binahenna i tu jolma manisia.",
			"9": "<sup>9</sup> Ala naung pinasabamna roha na malungun i, jala * dipasuksuk na denggan i tu roha na male i.",
			"10": "<sup>10</sup> Angka na hundul di haholomon dohot di linggom ni hamatean, angka na nirante ni pardangolan dohot bosi.",
			"11": "<sup>11</sup> Ala na nialonasida i angka hata ni Debata, jala dielesi sangkap ni Natumimbul i.",
			"12": "<sup>12</sup> Jadi dipajimput Ibana ma rohanasida marhitehite hangaluton, angka martungkapan ma nasida, jala ndang adong sipangurupi.",
			"13": "<sup>13</sup> Dung i joujou ma nasida tu Jahowa di hagogotannasida, jadi dipalua ma nasida sian hasosahannasida i.",
			"14": "<sup>14</sup> Ibana do paruarhon nasida sian haholomon dohot sian linggom ni hamatean, jala dirapui angka rantenasida i. III.",
			"15": "<sup>15</sup> Ingkon pujionnasida ma Jahowa ala asi ni rohana dohot halongangan angka na binahenna i tu jolma manisia.",
			"16": "<sup>16</sup> Ala naung binolana i angka pintu haksa, jala dirosahi angka sordaksordak bosi.",
			"17": "<sup>17</sup> Marsipal dihilala angka na oto ala ni dalan pangalaosionnasida i dohot dibahen angka hajahatonnasida.",
			"18": "<sup>18</sup> Luhut do sipanganon dihaginehon rohanasida, jala nunga pola dolos nasida sahat tu angka harbangan ni hamatean.",
			"19": "<sup>19</sup> Dung i joujou ma nasida tu Jahowa di hagogotannasida i, jadi dipalua Ibana nasida sian angka hasosahannasida.",
			"20": "<sup>20</sup> Ditongos ma hatana i jala dipamalum nasida, jala dipalua nasida sian hamagoannasida i. IV.",
			"21": "<sup>21</sup> Ingkon pujionnasida ma Jahowa ala asi ni rohana dohot halongangan angka na binahenna i tu jolma manisia.",
			"22": "<sup>22</sup> Jala dipelehon nasida ma angka pelean hamauliateon jala dipajojor angka pambahenanna i mardongan olopolop.",
			"23": "<sup>23</sup> Angka na tuat marparau tu laut, angka na marboniaga tu angka laut bolon.",
			"24": "<sup>24</sup> Diida nasida ma angka jadijadian ni Jahowa dohot halongangan angka na binahenna di bagasan lung.",
			"25": "<sup>25</sup> Dung i mangkuling ma Ibana, jadi hehe ma habahaba, gabe lam timbo ma angka galumbangna i.",
			"26": "<sup>26</sup> Tongkin manaek nasida tu langit, tongkin tuat nasida tu angka lung, malala ma rohanasida dibahen hinamago.",
			"27": "<sup>27</sup> Moror do angka nasida jala lalolalo songon parmabuk, jala tarbondut do sude habisukonnasida.",
			"28": "<sup>28</sup> Dung i joujou ma nasida tu Jahowa di hagogotannasida i, jadi diparuar Ibana nasida sian hasosahannasida i.",
			"29": "<sup>29</sup> Dipasohot ma habahaba i gabe mardemak, so ma dohot angka galumbangnasidai.",
			"30": "<sup>30</sup> Jadi marlas ni roha ma nasida ala naung so angka i, dung i ditogihon Ibana ma nasida tu muara lomo ni rohanasida. V.",
			"31": "<sup>31</sup> Ingkon pujionnasida ma Jahowa ala asi ni rohana, dohot halongangan angka na binahenna i tu jolma manisia.",
			"32": "<sup>32</sup> Jala patimbulonnasida Ibana di bagasan luhutan ni bangso i, jala pujionnasida Ibana di luhutan ni angka sintua.",
			"33": "<sup>33</sup> Ibana mangarsik angka batang aek gabe halongonan dohot angka mual gabe tano bangkalbangkal.",
			"34": "<sup>34</sup> Tano bosar hian gabe garaga ala hajahaton ni angka pangisina i.",
			"35": "<sup>35</sup> Ibana muse mambahen halongonan hian gabe tao jala tano bangkalbangkal hian gabe angka mual.",
			"36": "<sup>36</sup> Dung i tusi ma dipaian angka na male, gabe dipaojak nasida ma sada huta inganan.",
			"37": "<sup>37</sup> Jadi disaburi nasida ma angka ladang i, jala dipungka angka porlak anggur, jala gabe do na niulanasida i.",
			"38": "<sup>38</sup> Dung i dipasupasu Ibana ma nasida, gabe sopar situtu nasida, pinahannasida i pe dipasinur do.",
			"39": "<sup>39</sup> Dung i lam otik ma ianggo nasida, jala tarjimput dibahen pangarupaon, hinamago dohot pardangolan.",
			"40": "<sup>40</sup> Ibana mangusehon haleaon tu angka induk, jala dililuhon nasida di halongonan soada dalan.",
			"41": "<sup>41</sup> Jala Ibana patimbul na pogos sian pardangolan jala dibahen angka marga songon birubiru toropna.",
			"42": "<sup>42</sup> * Diida angka partigor i ma i, jadi marlas ni roha ma nasida gabe manguntam ma pamangan ni nasa hajahaton.",
			"43": "<sup>43</sup> Manang ise na pantas roha ditimbangi ma angka i, jala diparateatehon nasida ma angka asiasi ni Jahowa."
		},
		"108": {
			"1": "<sup>1</sup> Ende sian si Daud. I.",
			"2": "<sup>2</sup> Nalom do rohangku, ale Debata, marende ma ahu jala umpalu arbap, i ma tutu, ale hamuliaonku.",
			"3": "<sup>3</sup> Ngot ma ho, ale arbap dohot sordam, asa husunggul buha siang ari.",
			"4": "<sup>4</sup> Pujionku ma Ho di tongatonga ni angka bangso, ale Jahowa, jala endehononku ma Ho di tongatonga ni angka marga.",
			"5": "<sup>5</sup> Ai manalpui angka langit do godang ni asi ni roham, jala tolhas ro di aoangaoang parginjang do hasintonganmu.",
			"6": "<sup>6</sup> Sai patimbul ma dirim tu atas ni angka langit, ale Debata, jala hamuliaonmi tu sandok tano on.",
			"7": "<sup>7</sup> Asa malua angka na niasianmi, sai manumpak ma siamunmi jala alusi ahu! II.",
			"8": "<sup>8</sup> Nunga marbagabaga Debata di bagasan habadiaonna i: Ingkon marolopolop ahu marsagihon Sikem dohot manali rura Sukot.",
			"9": "<sup>9</sup> Ahu do nampuna Gilead, jala ahu nampuna Manasse, jala Epraim do partanobatoan ni ulungku, Juda do tungkot ni harajaonku.",
			"10": "<sup>10</sup> Moab do mangkuk parburianku, tu Edom hureongkon sipatungku, marolopolop ma ahu mida Palistim.",
			"11": "<sup>11</sup> Ise ulaning manogihon ahu tu huta na gonting? Ise ulaning pataruhon ahu tolhas ro di Edom?",
			"12": "<sup>12</sup> Nda Ho do, ale Debata, Ho naung mambolongkon hami, jala na so ruar, ale Debata, mandongani parangannami?",
			"13": "<sup>13</sup> Sai patupa ma haluaon di hami sian hagogotan, ai ndang marnosan ianggo haluaon binahen ni jolma.",
			"14": "<sup>14</sup> Mangasahon Debata sai hamonangan do ulahononta, jala Ibana sandiri mangalotlot alontai."
		},
		"109": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Sai unang mauhom Ho, ale Debata ni pujipujianku!",
			"2": "<sup>2</sup> Ai ngangang do pamangan ni parjahat dohot pangalajak mangalo ahu, angka na mangkatai dohot ahu mardila sipaotooto.",
			"3": "<sup>3</sup> Jala dihaliangi ahu dohot angka hata hasomoran, jala dimusui ahu soada paralaan.",
			"4": "<sup>4</sup> Sai dialo nasida do ahu balos ni holong ni rohangku, alai sai martangiang do anggo ahu.",
			"5": "<sup>5</sup> Jala diampehon do tu ahu hajahaton, balos ni denggan basa, jala hasomoran, balos ni holong ni rohangku.",
			"6": "<sup>6</sup> Pabangkit ma sada parjahat pandapotanna, jala sai jongjong ma di siamunna pangasung i.",
			"7": "<sup>7</sup> Tole diuhumi ibana, ruar ma ibana tandap parjahat, jala gabe dosa ma tangiangna i.",
			"8": "<sup>8</sup> Sai lam tu otikna ma angka ariarina i, ingkon na asing jumalo * tohonanna.",
			"9": "<sup>9</sup> Sai tading di lampin ma anakkonna i, jala mabalu jolmana i.",
			"10": "<sup>10</sup> Sai mompasompas ma anakkonna manggoanggo, jala sai mandiori sidabuannasida holong sian parulangulangannasida i.",
			"11": "<sup>11</sup> Sai dihishis pangurangan ma sude na di ibana i, jala sai dipupusi halak na pulik ma na sinamotsamotna.",
			"12": "<sup>12</sup> Sai unang ma adong na pateltel asi ni roha tu ibana, jala sai unang adong na asi roha tu anakkonna angka na tading di lampin.",
			"13": "<sup>13</sup> Sai ripur ma pinomparna i, sai siap ma goarnasida di sundut paduahon.",
			"14": "<sup>14</sup> Sai taringot ma hajahaton ni amanasida tu Jahowa, jala sai unang tarsesa dosa ni inana i.",
			"15": "<sup>15</sup> Sai tongtong ma angka i di adopan ni Jahowa, jala Ibana maniaphon * baritanasida sian tano on.",
			"16": "<sup>16</sup> Ala na so diingot mambahen asi ni roha jala dilotongi sada baoa na dangol jala na pogos, jala na jimput hian marroha, naeng bunuonna.",
			"17": "<sup>17</sup> Dihaholongi rohana do torutoru, jadi manginona ma tu ibana; jala ndang dihalomohon pasupasu, jadi mandao ma sian ibana.",
			"18": "<sup>18</sup> Dialithon do torutoru hira pangkeanna, jadi ditopot ma tubagasan dirina * songon aek, jala songon miak tubagasan holiholina.",
			"19": "<sup>19</sup> Asa songon ulos na tinapolhon ma i tu ibana, jala gabe hohos na tongtong hinobahon.",
			"20": "<sup>20</sup> I ma nian upa ni angka na mangalo ahu sian Jahowa dohot angka parpangkuling na jat dompak tondingki. II.",
			"21": "<sup>21</sup> Alai anggo Ho, ale Tuhan Jahowa, roham ma di ahu ala ni goarmi; ai na denggan do asi ni roham, sai palua ma ahu!",
			"22": "<sup>22</sup> Ai na dangol jala na pogos do ahu, jala mabugang do rohangku di bagasan.",
			"23": "<sup>23</sup> Songon halinu na pagistang dirina do ahu laho salpu, dilotongi do ahu songon sihapor.",
			"24": "<sup>24</sup> Rabatrabat do ulu ni tothu dibahen parpuasaon, jala merus do sibukku, ndang be marmiak.",
			"25": "<sup>25</sup> Jadi ingkon sieleselesonnasida nama ianggo ahu, angka mangupir be ulunasida i marnida ahu.",
			"26": "<sup>26</sup> Sai urupi ma ahu, ale Jahowa, Debatangku! Sai tumpahi ma ahu hombar tu asi ni roham.",
			"27": "<sup>27</sup> Asa tung ditanda nasida tanganmu do i, Ho do, ale Jahowa, mambahensa.",
			"28": "<sup>28</sup> Mamburai ianggo nasida, alai * mamasumasu do ianggo Ho; hehe do angka nasida, hape tarurak do, jadi marlas ni roha ma naposom.",
			"29": "<sup>29</sup> Sai marpangkean haurahon do sogot angka na mangalo ahu, jala ditapolhon hailaonnasida i songon sampesampe.",
			"30": "<sup>30</sup> Pujionku situtu ma Jahowa marhitehite pamanganku, jala patimbulonku ma Ibana di tonga ni hatoropan.",
			"31": "<sup>31</sup> Ai * jongjong do Ibana di siamun ni na pogos laho paluahon tondina i sian angka na manguhum marutang hosa."
		},
		"110": {
			"1": "<sup>1</sup> Ende sian si Daud. Nunga didok Jahowa mandok Tuhanku: Hundul ma Ho tu siamunhon, paima hubahen angka musum sidegedegean ni patmu.",
			"2": "<sup>2</sup> Tongoson ni Jahowa ma sian * Sion tungkot harajaon ni huasomi; antong mangarajai ma Ho di tongatonga ni musum!",
			"3": "<sup>3</sup> Marrongoman bangsom ro sian lomona di ari parporanganmu * marpangkean habadiaon, sian ampuan ni andostorang ro do tu Ho + nambur ni paranganmu angka na bajar.",
			"4": "<sup>4</sup> Nunga pola maruari Jahowa, jala ndang tagamon solsolanna bagina: Sai Ho do malim ro di salelenglelengna * mangihuthon horong ni si Melkisedek.",
			"5": "<sup>5</sup> Tuhan i do di siamunmu, Ibana mangalengsehon angka raja di ari panombo ni rimasna.",
			"6": "<sup>6</sup> Ibana mandabu uhum di tongatonga ni angka parbegu, Ibana mambahen gok angka bangke; Ibana do mangarosak ulu di tano adaran bidang.",
			"7": "<sup>7</sup> Inumonna ma sian sunge di dalan, ala ni patimbulonna ma muse uluna."
		},
		"111": {
			"1": "<sup>1</sup> Halleluya! Pujionku ma Jahowa sian nasa roha di luhutan ni angka partigor dohot di huria i.",
			"2": "<sup>2</sup> Balga do angka pambahenan ni Jahowa, hinalungunhon ni sude angka na lomo roha disi.",
			"3": "<sup>3</sup> Hamuliaon dohot hasangapon do parulaonna i, jala hot do jongjong hatigoranna i salelenglelengna.",
			"4": "<sup>4</sup> Nunga dibahen Ibana sada parningotan di halongangan angka na binahenna i, pardengganbasa jala parasi roha do Jahowa.",
			"5": "<sup>5</sup> Nunga diparbohali angka na mangkabiari Ibana, diingot do padan binahenna i ro di salelenglelengna.",
			"6": "<sup>6</sup> Nunga dipabotohon tu bangsona gogo ni pambahenanna i mangalehon tu nasida parjambaran ni angka parbegu.",
			"7": "<sup>7</sup> Hasintongan dohot uhum do angka pambahenan ni tanganna, sintong do sude angka patikna i.",
			"8": "<sup>8</sup> Hot do angka i ro di salelenglelengna, dibahen do angka i di bagasan hasintongan dohot habonaron.",
			"9": "<sup>9</sup> Nunga ditongoshon Ibana haluaon tu bangsona, dipatik do padan binahenna i salelenglelengna, nabadia jala na songkal do goarna i.",
			"10": "<sup>10</sup> Biar mida Jahowa do parmulaan ni habisuhon, maruli hapistaran na sumurung do sude angka na mangulahonsa; hot do baritana i ro di salelenglelengna."
		},
		"112": {
			"1": "<sup>1</sup> Halleluya! Martua ma baoa na mangkabiari Jahowa, na lomo roha situtu di angka patikna!",
			"2": "<sup>2</sup> Sangap ma pinomparna i sogot di tano on, dapotan pasupasu ma sundut ni angka partigor sogot.",
			"3": "<sup>3</sup> Hamoraon marlobilobi di bagasan jabuna, jala hot do hatigoranna i ro di salelenglelengna.",
			"4": "<sup>4</sup> Sai * binsar do di partigor i hatiuron di haholomon, sian Ibana pardengganbasa, parasi roha jala na bonar.",
			"5": "<sup>5</sup> Mardohar ma baoa na asi roha dohot na pasalihonsa, tarondolhonsa ma angka hatana di paruhuman.",
			"6": "<sup>6</sup> Ndang tagamon humordit ibana salelenglelengna, marbarita salelenglelengna do partigor i.",
			"7": "<sup>7</sup> Ndang tagamon mabiar ibana binahen ni barita hinamago, nalom do rohana marhaposan tu Jahowa.",
			"8": "<sup>8</sup> Marsitiopan do rohana, ndang mabiar ibana, paima * idaonna pamaloson tu angka alona i.",
			"9": "<sup>9</sup> * Manaburi ibana, mangalehon tu angka na pogos, hot do hatigoranna i ro di salelenglelengna, + timbul ma tandukna sogot di bagasan hamuliaon.",
			"10": "<sup>10</sup> Idaon ni parjahat i ma i sogot, jala hagitikhononna, * patungoripon ma iponna jala malangke ibana, matua lonong do pinangido ni angka parjahat i."
		},
		"113": {
			"1": "<sup>1</sup> Halleluya! Mamuji ma hamu, ale angka naposo ni Jahowa, puji hamu ma goar ni Jahowa!",
			"2": "<sup>2</sup> Pinuji ma goar ni Jahowa olat ni on ro di salelenglelengna.",
			"3": "<sup>3</sup> Sian habinsaran ni mata ni ari ro di hasundutanna do sipujion goar ni Jahowa.",
			"4": "<sup>4</sup> Tumimbul do Jahowa sian luhut angka bangso, diginjang ni angka langit do hamuliaonna i.",
			"5": "<sup>5</sup> Tung ise ma songon Jahowa, Debatanta i? Timbo Ibana marhabangsa.",
			"6": "<sup>6</sup> Hape dipaserep dirina manatap na di angka banua ginjang dohot na di tano on.",
			"7": "<sup>7</sup> Ibana pahehehon na metmet sian orbuk, dipatimbul do na pogos i sian gambo.",
			"8": "<sup>8</sup> Laho pahundulhon ibana top dohot angka raja ni bangsona.",
			"9": "<sup>9</sup> Ibana paian parompuan na hol di jabu, gabe ina na las roha mida angka anakna. Halleluya!"
		},
		"114": {
			"1": "<sup>1</sup> Uju na ruar i Israel sian Misir, pinompar ni si Jakkob sian bangso parhata bobang:",
			"2": "<sup>2</sup> Jadi Juda gabe habadiaonna, Israel gomgomanna.",
			"3": "<sup>3</sup> Diida laut i ma i, gabe tolak, jala sumurut tu pudi ia Jordan.",
			"4": "<sup>4</sup> Marhajingjang ma angka dolok songon birubiru tunggal, angka robean songon anak ni birubiru.",
			"5": "<sup>5</sup> Aha di ho, ale laut, umbahen maporus ho? Ale Jordan umbahen sumurut tu pudi ho?",
			"6": "<sup>6</sup> Hamu ale angka dolok, umbahen marhajingjang hamu songon birubiru tunggal, hamu ale robean, songon anak ni birubiru?",
			"7": "<sup>7</sup> Maradophon bohi ni Tuhan i humuturhutur ma ho, ale tano on, maradophon Debata ni si Jakkob.",
			"8": "<sup>8</sup> Na paubahon dolok batu gabe ambar aek, batu ping gabe mual."
		},
		"115": {
			"1": "<sup>1</sup> I. Ndada di hami, ale Jahowa, ndada di hami, di goarmu ma tagonan lehon hamuliaon, ala ni asi ni roham, ala ni hasintonganmu.",
			"2": "<sup>2</sup> Boasa ma tung dohonon ni angka parbegu: Didia ulaning Debatanasida i?",
			"3": "<sup>3</sup> Hape di banua ginjang do Debatanta i, saguru lomo ni rohana dipatupa.",
			"4": "<sup>4</sup> Alai anggo ajiajiannasidai perak do jala sere bahenbahenan ni tangan ni jolma.",
			"5": "<sup>5</sup> Adong do pamangannasida, hape ndang mangkuling; adong do matanasida, hape ndang marnida.",
			"6": "<sup>6</sup> Adong do pinggolnasida, hape ndang marbinege; adong do igungnasida, hape ndang marnianggo.",
			"7": "<sup>7</sup> Adong do tangannasida, hape ndang tarjamahonsa, jala ndang tarlangkahonsa ia patnasida i; ndang mangkuling ianggo aruarunasida.",
			"8": "<sup>8</sup> Sobokkon nasida sogot angka na mambahennasida, sude angka na marhaposan tusi. II.",
			"9": "<sup>9</sup> Ianggo ho, ale * Israel, marhaposan tu Jahowa ma ho! Ibana do pangurupi dohot lombulombunasida.",
			"10": "<sup>10</sup> Ale pinompar ni * si Aron, marhaposan tu Jahowa ma hamu! Ibana do pangurupi dohot lombulombunasida.",
			"11": "<sup>11</sup> Hamu ale angka na * mangkabiari Jahowa, marhaposan tu Jahowa ma hamu! Ibana do pangurupi dohot lombulombunasida.",
			"12": "<sup>12</sup> Nunga diingot Jahowa hita: Ibana mamasumasu, Ibana mamasumasu pinompar ni Israel, Ibana mamasumasu pinompar ni si Aron.",
			"13": "<sup>13</sup> Ibana mamasumasu angka na mangkabiari Jahowa, angka na metmet dohot angka na magodang.",
			"14": "<sup>14</sup> Sai ambaambaan ni Jahowa do tu hamu, tu hamu dohot tu pinomparmuna.",
			"15": "<sup>15</sup> Angka na pinasupasu do hamu sian Jahowa, Sitompa angka langit dohot tano on.",
			"16": "<sup>16</sup> Jahowa do nampuna angka langit ni langitan, alai anggo tano on nunga dilehon tu jolma manisia.",
			"17": "<sup>17</sup> Ndang tagamon pujion ni angka naung mate Jahowa, nang sude angka naung tuat tu tano hasonangan.",
			"18": "<sup>18</sup> Alai anggo hita, sai pujionta do Jahowa olat ni on ro di salelenglelengna. Halleluya!"
		},
		"116": {
			"1": "<sup>1</sup> I. Holong do rohangku di Jahowa, ala naung ditangihon joujoungki, parhurajaionku.",
			"2": "<sup>2</sup> Ai nunga dipaeleng pinggolna tu ahu, jadi sai jouonku ma Ibana, saleleng ahu mangolu.",
			"3": "<sup>3</sup> Nunga pola dihaliangi * angka rante ni hamatean ahu, jala nunga pola mangonai tu ahu angka hagogotan ni banua toru, nunga pola mangonai tu ahu hagogotan dohot pardangolan.",
			"4": "<sup>4</sup> Dung i hupajoujou ma goar ni Jahowa: Ale Jahowa, sai palua ma tondingki!",
			"5": "<sup>5</sup> Parasi roha do Jahowa jala na bonar, jala parasi roha do Debatanta i.",
			"6": "<sup>6</sup> Siramoti angka siunjur roha do Jahowa, nunga tung tarjepol ahu, jadi Ibana mangurupi ahu.",
			"7": "<sup>7</sup> * Mulak ma ho, ale tondingku, tu paradiananmi, ai denggan do uhum ni Jahowa tu ho.",
			"8": "<sup>8</sup> Tongon do, nunga dipalua Ho tondingku sian hamatean, matangku sian iluilu, pathu sian partuktuhan.",
			"9": "<sup>9</sup> Sai marparange di jolo ni Jahowa ma ahu di angka luat ni halak na mangolu.",
			"10": "<sup>10</sup> * Porsea do ahu umbahen huhatahon, mansai dangol situtu do ahu huhilala.",
			"11": "<sup>11</sup> Ianggo ahu, nunga pola hudok di hatahutonku: * Sude jolma pargabus. II.",
			"12": "<sup>12</sup> Tung beha ma pamaloshu tu Jahowa, ala saluhut denggan ni uhumna i tu ahu!",
			"13": "<sup>13</sup> Jaloonku do panginuman ni angka hatuaon, jala pajoujouonku do goar ni Jahowa.",
			"14": "<sup>14</sup> Gararonku ma angka bagabagangku tu Jahowa, apala di adopan ni sandok bangsona.",
			"15": "<sup>15</sup> Arga do di roha ni Jahowa hamamate ni angka na niasianna i.",
			"16": "<sup>16</sup> Antong, ale Jahowa, nunga tung naposom ahu, naposom do ahu, anak ni hatobanmu, nunga diharhari Ho angka rante sian ahu.",
			"17": "<sup>17</sup> Sai pelehononku ma tu Ho pelean hamauliateon, jala sai pajoujouonku ma goar ni Jahowa.",
			"18": "<sup>18</sup> Sai gararonku ma angka bagabagangku tu Jahowa, apala di adopan ni sandok bangsona.",
			"19": "<sup>19</sup> Di angka alaman ni bagas ni Jahowa, di parsitongaanmi, ale Jerusalem! Halleluya!"
		},
		"117": {
			"1": "<sup>1</sup> Puji ma Jahowa, hamu ale angka parbegu sudena! Puji ma Ibana hamu ale angka bangso sudena!",
			"2": "<sup>2</sup> Ai tung na godang do asi ni rohana tu hita jala ro di salelenglelengna do habonaron ni Jahowa. Halleluya!"
		},
		"118": {
			"1": "<sup>1</sup> I. Mandok mauliate ma hamu tu Jahowa, ai pardengganbasa do Ibana, ai ro di salelenglelengna do asi ni rohana!",
			"2": "<sup>2</sup> Dohonon ni Israel ma tongon: Ai ro di salelenglelengna do asi ni rohana!",
			"3": "<sup>3</sup> Dohonon ni pinompar ni si Aron ma: Ai ro di salelenglelengna do asi ni rohana.",
			"4": "<sup>4</sup> Dohonon ni angka na mangkabiari Jahowa ma: Ai ro di salelenglelengna do asi ni rohana i.",
			"5": "<sup>5</sup> Sian hagogotan do hupajoujou Jahowa, gabe dialusi Jahowa ahu, di na pinalumbangna i ahu.",
			"6": "<sup>6</sup> Jahowa do donganku, ndang mabiar ahu, tung aha ma tagamon bahenon ni jolma tu ahu?",
			"7": "<sup>7</sup> Jahowa do donganku di tongatonga ni angka na mangurupi ahu, jadi sombu ma roha ni matangku marnida angka na mangkosom ahu.",
			"8": "<sup>8</sup> Dengganan marhaporusan tu Jahowa, asa marhaposan tu jolma.",
			"9": "<sup>9</sup> Dengganan marhaporusan tu Jahowa, asa marhaposan tu angka raja.",
			"10": "<sup>10</sup> Nunga pola luhut angka parbegu mangkaliangi ahu, mangasahon goar ni Jahowa tung rasiphononku do nasida.",
			"11": "<sup>11</sup> Nunga pola dihaliangi nasida ahu tuk humaliang, mangasahon goar ni Jahowa tung rasiphononku do nasida.",
			"12": "<sup>12</sup> Nunga pola dihaliangi nasida ahu, songon * angka loba, mintop do nasida songon api di buluduri, marhitehite goar ni Jahowa tung rasiphononku do nasida.",
			"13": "<sup>13</sup> Nunga pola digogo ho manulakkon ahu, asa tinggang nian, hape Jahowa mangurupi ahu. II.",
			"14": "<sup>14</sup> Jahowa do pargogongku dohot endengku, jadi gabe hatuaonku ibana.",
			"15": "<sup>15</sup> Soara ni olopolop dohot hatuaon marsaringar di undungundung ni angka partigor: Siamun ni Jahowa do sibahen hamonangan.",
			"16": "<sup>16</sup> Timbul situtu do siamun ni Jahowa, siamun ni Jahowa do sibahen hamonangan.",
			"17": "<sup>17</sup> Ndang tagamon mate ahu, sai na mangolu do ahu, asa hupajojor angka pambahen ni Jahowa.",
			"18": "<sup>18</sup> Nunga gogo tutu dipinsang Jahowa ahu, alai nda tung tu hamatean ahu dipasahat.",
			"19": "<sup>19</sup> Ungkap hamu ma di ahu angka bahal ni hatigoran, asa hubongoti angka i laho mamuji Jahowa.",
			"20": "<sup>20</sup> On do bahal ni Jahowa, bongotan ni angka partigor do i sogot.",
			"21": "<sup>21</sup> Mandok mauliate ma ahu di Ho, ala naung dialusi Ho ahu, jala manjadi hatuaonku.",
			"22": "<sup>22</sup> Batu naung binolongkon ni angka pande bagas, i ma jadi batu parsuhi.",
			"23": "<sup>23</sup> Sian Jahowa do i masa, halongangan do i anggo di matanta.",
			"24": "<sup>24</sup> Ari on do na jinadihon ni Jahowa, * marolopolop jala marlas ni roha ma hita disi.",
			"25": "<sup>25</sup> Iale Jahowa, sai manumpak ma Ho! Iale Jahowa sai Ho ma mambahen manjadi!",
			"26": "<sup>26</sup> Pinasupasu ma na ro marhitehite goar ni Jahowa, hupasupasu hami ma hamu, angka na sian bagas ni Jahowa.",
			"27": "<sup>27</sup> Jahowa do Debata, jala Ibana manondangi hita. Tambathon hamu ma angka pelean pesta i sahat ro di angka tanduk ni langgatan.",
			"28": "<sup>28</sup> Ho do Debatangku, jadi Ho do pujionku; ale Debatangku, sai Ho do patimbulonku.",
			"29": "<sup>29</sup> Mandok mauliate ma hamu di Jahowa, ai pardengganbasa do Ibana, ai ro di salelenglelengna do asi ni rohana i."
		},
		"119": {
			"1": "<sup>1</sup> I. Martua ma halak angka na daulat marpangalaho, angka na marpangalahohon patik ni Jahowa.",
			"2": "<sup>2</sup> Martua ma halak angka na mangaradoti angka panindangionna i, * angka na mangalului Ibana sian nasa roha.",
			"3": "<sup>3</sup> Huhut angka na so mangulahon hageduhon, angka na mangkampungi angka dalanna i.",
			"4": "<sup>4</sup> Nunga ditonahon Ho angka parentam, siradotan situtu.",
			"5": "<sup>5</sup> Aut ni sai marsihohot angka dalanku mangaradoti angka aturanmu!",
			"6": "<sup>6</sup> Dung i ndang tagamon tarurak ahu, molo sai huparateatehon sude angka tonami.",
			"7": "<sup>7</sup> Sai mandok mauliate ma ahu di Ho sian hatigoran ni roha, molo huguruhon angka uhum ni hatigoranmi.",
			"8": "<sup>8</sup> Sai radotanku do angka aturanmi, unang tung tadingkon ahu situtu. II.",
			"9": "<sup>9</sup> Marhitehite aha tarpabontor dolidoli langkana? Molo dipahombarhombar tu hatam.",
			"10": "<sup>10</sup> Sai hulului do Ho sian nasa rohangku unang tung loas ahu lilu sian angka tonami.",
			"11": "<sup>11</sup> Nunga hupajop hatami di bagasan rohangku, asa unang mardosa ahu tu Ho.",
			"12": "<sup>12</sup> Pinuji ma Ho, ale Jahowa, sai * podahon ma tu ahu angka aturanmi.",
			"13": "<sup>13</sup> Nunga dipajojor angka bibirhon sude uhum, angka na ruar sian pamanganmi.",
			"14": "<sup>14</sup> Hinsaan do rohangku mida dalan ni angka panindangionmu, asa mida nasa hamoraon.",
			"15": "<sup>15</sup> Sai papingkirpingkironku do angka parentam, jala sai berengonku do angka bogasmi.",
			"16": "<sup>16</sup> Sai * huhahilashon do angka aturanmi, ndang tagamon + halupahononku hatami. III.",
			"17": "<sup>17</sup> Mardenggan basa ma Ho tu naposom, pangolu ma ahu! Asa huradoti hatam.",
			"18": "<sup>18</sup> Sai pabuha ma matangku, asa huida halongangan, angka sian patikmi.",
			"19": "<sup>19</sup> * Paisolat do ahu di tano on, unang tung tabunihon angka tonami sian ahu.",
			"20": "<sup>20</sup> Malampot do rohangku mangkalungunhon angka uhummu manipat ari.",
			"21": "<sup>21</sup> Mangonai hata do Ho * mamulasi angka na jungkat roha, angka na manimbil sian tonami.",
			"22": "<sup>22</sup> Gilingi ma sian ahu haurahon dohot haleaon, ai nunga huradoti angka panindangionmi.",
			"23": "<sup>23</sup> Hundul pe angka raja manuptupi mangalo ahu, sai angka aturanmi do dipingkirpingkiri naposom.",
			"24": "<sup>24</sup> Tongon angka panindangionmi do hasoloan ni rohangku, angka i do jolma panuturingku. IV.",
			"25": "<sup>25</sup> Lohot di rere do rohangku, sai pangolu ma ahu hombar tu hatam!",
			"26": "<sup>26</sup> Hupajojor do angka dalanku, jadi dialusi Ho ahu, sai podahon ma tu ahu angka aturanmi.",
			"27": "<sup>27</sup> Sai parroha i ahu mangantusi dalan ni angka parentam, asa hupingkirpingkiri halongangan angka na binahenmi.",
			"28": "<sup>28</sup> Malampot do rohangku dibahen holsoholso, sai pahehe ma ahu hombar tu hatam.",
			"29": "<sup>29</sup> Sai paholang ma sian ahu dalan ni pangansion, jala asinirohahon tu ahu patikmi.",
			"30": "<sup>30</sup> Nunga hupillit dalan hasintongan, angka uhummu nunga hubahen tu jolongku.",
			"31": "<sup>31</sup> Sai marsihohot do ahu di angka panindangionmu, unang tung paurak ahu, ale Jahowa.",
			"32": "<sup>32</sup> Sai dalan ni angka tonami do tulusonku, ai nunga * dipalumbang Ho rohangku. V.",
			"33": "<sup>33</sup> Sai podahon ma tu ahu, ale Jahowa dalan ni angka aturanmi, asa huradoti * ro di ujung.",
			"34": "<sup>34</sup> Sai parroha i ahu, asa huradoti patikmi, jalahuhajongjongkon sian nasa roha!",
			"35": "<sup>35</sup> Sai panonohon ma tu ahu dalan balobung ni angka tonami, ai lomo do rohangku disi.",
			"36": "<sup>36</sup> Sai paeleng ma rohangku tu angka panindangionmu, unang tung tu parhilangon.",
			"37": "<sup>37</sup> Sai pasalpu ma angka matangku, unang marnida na so gabeak, sai pangolu ma ahu hinorhon ni angka dalanmi.",
			"38": "<sup>38</sup> Hajongjongkon ma tu naposom bagabagam taringot tu biar maradophon Ho.",
			"39": "<sup>39</sup> Sai pasalpu ma haurahonku, na huholsohon, ai denggan do angka uhummi.",
			"40": "<sup>40</sup> Ida ma, sai huhalungunhon do angka parentami sai pangolu ma ahu hinorhon ni hatigoranmi. VI.",
			"41": "<sup>41</sup> Sai tolhas ma tu ahu angka asi ni roha, ale Jahowa, hatuaonmi pe hombar tu bagabagam.",
			"42": "<sup>42</sup> Asa hualushon sada hata tu na mangelesi ahu, ai marhaposan tu hatam do ahu.",
			"43": "<sup>43</sup> Jala unang tung paunsat situtu hata hasintongan i sian pamanganku, ni angka uhummi do na huhalungunhon.",
			"44": "<sup>44</sup> Sai tongtong do radotanku patikmi ro di saleleng ni lelengna.",
			"45": "<sup>45</sup> Sai mardalani ma ahu di halambason, ai huharingkoti do angka parentam.",
			"46": "<sup>46</sup> Sai hatahononku do angka panindangionmu di jolo ni angka raja jala ndang hailahononku.",
			"47": "<sup>47</sup> Sai dihahinsahon rohangku do tonami, angka na huhaholongi.",
			"48": "<sup>48</sup> Jala sai hupataretare do tanganku tu tonami, angka na huhaholongi, jala sai pingkirpingkiranku do angka aturanmi. VII.",
			"49": "<sup>49</sup> Sai ingot ma hata tu naposom, na pinalungunhonmu tu ahu.",
			"50": "<sup>50</sup> Sai on do sabam ni rohangku di * pardangolankon, ai bagabagami do + pangoluhon ahu.",
			"51": "<sup>51</sup> Mansai eles situtu do angka na jungkat roha tu ahu, alai ndang manimbil anggo ahu sian patikmi.",
			"52": "<sup>52</sup> Sai huingot do angka uhummu sian narobi, ale Jahowa, jadi sabam ma rohangku.",
			"53": "<sup>53</sup> Marpiarpiar do murukku mida parjahat, angka na tumadingkon patikmi.",
			"54": "<sup>54</sup> Jadi gabe endengku do angka aturanmi, di bagasan bagas paisolatanki.",
			"55": "<sup>55</sup> Sai * huingoti do bornginna i goarmi, ale Jahowa, jala huradoti patikmi.",
			"56": "<sup>56</sup> On do na sorang tu ahu: Sai naeng radotanku angka parentam. VIII.",
			"57": "<sup>57</sup> Parjambaranku do Ho, ale Jahowa, nunga pola hudok, sai radotanku do angka hatami.",
			"58": "<sup>58</sup> Marhuraja do ahu tu bohimi sian nasa roha, asi ma roham di ahu hombar tu bagabagam.",
			"59": "<sup>59</sup> Nunga tung hutimbangi angka dalanku, jadi sai mulak tu angka panindangionmi do pathu.",
			"60": "<sup>60</sup> Sai humalaput do ahu, jala ndang huhabendahon mangaradoti angka tonami.",
			"61": "<sup>61</sup> Sai dihaliangi angka aring ni angka parjahat i do ahu, ianggo patikmi ndang huhalupahon.",
			"62": "<sup>62</sup> Hehe do ahu tonga borngin laho mandok mauliate tu Ho ala ni angka uhum ni hatigoranmi.",
			"63": "<sup>63</sup> Aleale ni sude angka na mangkabiari Ho do ahu, ro di angka na mangaradoti angka parentam.",
			"64": "<sup>64</sup> * Gok asi ni roham do tano on, ale Jahowa, sai podahon ma tu ahu angka aturanmi. IX.",
			"65": "<sup>65</sup> Nunga denggan uhummi dibahen Ho tu naposom, ale Jahowa, hombar tu hatami.",
			"66": "<sup>66</sup> Sai podahon ma tu ahu roha hapantason dohot parbinotoan na denggan, ai huhaporseai do angka tonami.",
			"67": "<sup>67</sup> Tagan so tarjepol ahu, sai lilu do ahu, alai anggo nuaeng sai bagabagami do na huradoti.",
			"68": "<sup>68</sup> Denggan do Ho marroha jala pardengganbasa, sai ajarhon ma tu ahu angka aturanmi.",
			"69": "<sup>69</sup> Sai patubutubu gasa do angka na jungkat roha mangalo ahu, ianggo ahu sai radotanku do angka parentam sian nasa roha.",
			"70": "<sup>70</sup> Ndang mangilala rohanasida songon tabotabo, ianggo ahu patikmi do na huhahilashon.",
			"71": "<sup>71</sup> Untungku do i na tarjepol i ahu, asa huguruhon angka aturanmi.",
			"72": "<sup>72</sup> Tagonan do di rohangku patik sian pamanganmi asa sere dohot perak marriburibu. X.",
			"73": "<sup>73</sup> Angka tanganmi do tumompa ahu jala pauliuli ahu, sai parroha i ahu, asa huguruhon angka tonami.",
			"74": "<sup>74</sup> Ia diida angka na mangkabiari Ho ahu, sai las ma rohanasida, ala na huhalungunhon hatami.",
			"75": "<sup>75</sup> Nunga huboto, ale Jahowa, hatigoran do tongon angka uhummi, jala * mardongan haburjuon do dijepol Ho ahu.",
			"76": "<sup>76</sup> Sai apulapul tu ahu ma nian asi ni rohami hombar tu bagabagam tu naposom.",
			"77": "<sup>77</sup> Sai tolhas ma tu ahu angka asi ni roham, asa mangolu ahu, ai patikmi do na * huhahilashon.",
			"78": "<sup>78</sup> Sai tarurak ma angka na jungkat roha i ala dipatungki ahu marhitehite gabus; ianggo ahu, sai angka parentam do hupingkirpingkiri.",
			"79": "<sup>79</sup> Sai mulak tu ahu ma angka na mangkabiari Ho dohot angka na umboto angka panindangionmi.",
			"80": "<sup>80</sup> Sai sisangunjur ma rohangku tu angka aturanmi, asa unang tarurak ahu. XI.",
			"81": "<sup>81</sup> Pola maheu rohangku dibahen siholna di hatuaonmi, sai hatami do na huhalungunhon.",
			"82": "<sup>82</sup> Pola do rambon angka matangku mangkalungunhon bagabagami, angka ninna do: Andigan pe ulaning apulonmu ahu?",
			"83": "<sup>83</sup> Ai nunga pola doshon hajut bobak sinale ni timus ahu, ianggo angka aturanmi ndang huhalupahon.",
			"84": "<sup>84</sup> Pola piga ariari ni naposom? Andigan pe dabuonmu uhum tu angka na mangalotongi ahu?",
			"85": "<sup>85</sup> Nunga pola dihali angka na jungkat roha i angka godung tu ahu, nasida angka na so marparange hombar tu patikmi.",
			"86": "<sup>86</sup> Hasintongan do sude angka tonami; pangansion dibahen nasida mangalotongi ahu; sai urupi ma ahu!",
			"87": "<sup>87</sup> Otik nari tung siap ahu bahenonnasida di tano on, alai laos so hutadingkon do angka parentam.",
			"88": "<sup>88</sup> Sai pangolu ma ahu hombar tu asi ni roham, asa huradoti panindangion sian pamanganmi. XII.",
			"89": "<sup>89</sup> Ro di salelenglelengna do hot hatami di angka banua ginjang, ale Jahowa.",
			"90": "<sup>90</sup> Marsundutsundut do hasintonganmi, nunga dipaojak Ho tano on, jadi hot ma jongjong.",
			"91": "<sup>91</sup> Rasirasa sadarion sai hot do angka uhummu, ai angka naposom, do nasida saluhutna.",
			"92": "<sup>92</sup> Aut unang patikmi ma huhahilashon, nunga leleng mago ahu di pardangolankon.",
			"93": "<sup>93</sup> Ro di salelenglelengna do ndang tagamon halupahononku angka parentami ai marhitehite angka i do dipangolu Ho ahu.",
			"94": "<sup>94</sup> Gok di Ho do ahu, sai palua ma ahu, ai angka aturanmi do na hulului.",
			"95": "<sup>95</sup> Sai diaropi angka parjahat i do ahu, naeng agoonna ahu, sai angka panindangionmi do huparateatehon.",
			"96": "<sup>96</sup> Sai marujung do huida saluhutna pangabahan, mansai hangkam do ianggo tonami. XIII.",
			"97": "<sup>97</sup> Mansai huhaholongi do patikmi, sai i do hupingkirpingkiri manipat ari.",
			"98": "<sup>98</sup> Bisukan do ahu sian angka musungku dibahen angka tonami, ai gok disi do ahu salelenglelengna.",
			"99": "<sup>99</sup> Marrohaan do ahu sian sude angka gurungku, ai sai angka panindangionmi do na huparateatehon.",
			"100": "<sup>100</sup> Marrohaan do ahu sian angka natuatua, ai sai huradoti do angka parentam.",
			"101": "<sup>101</sup> Sai huambatambat do angka pathu sian nasa dalan na roa, asa huradoti hatami.",
			"102": "<sup>102</sup> Ndang dung manimbil ahu sian angka uhummi, ai nunga dipodai Ho ahu.",
			"103": "<sup>103</sup> Tumonggi do bagabagami didai aruarungku sian situak ni loba di pamanganku.",
			"104": "<sup>104</sup> Binahen ni angka parentam do ahu marroha, ala ni do umbahen huhagigihon nasa dalan pangansion. XIV.",
			"105": "<sup>105</sup> Hatami do sulusulu ni pathu jala hatiuron di dalanku.",
			"106": "<sup>106</sup> Nunga pola huuarihon, jadi sai huhajongjongkon do: Mangaradoti angka uhum ni hatigoranmi.",
			"107": "<sup>107</sup> Tarjepol situtu do ahu, sai pangolu ma ahu, ale Jahowa, hombar tu hatam.",
			"108": "<sup>108</sup> Sai halomohon ma, ale Jahowa, angka pelean pujipujian ni pamanganku sian nasa roha, jala ajarhon tu ahu angka uhummu!",
			"109": "<sup>109</sup> Sai tongtong do huhomolhomol tondingki di bagasan tanganku, jala ndang huhalupahon patikmi.",
			"110": "<sup>110</sup> Sai ditaoni angka parjahat i do jorgong tu ahu, alai laos so manimbil do ahu sian angka parentam.",
			"111": "<sup>111</sup> Angka panindangionmi do hubahen parjambaranku salelenglelengna, ai hahilason ni rohangku do angka i.",
			"112": "<sup>112</sup> Sai hupaunduk do rohangku, laho mangulahon angka aturanmi salelenglelengna ro di ujung sogot. XV.",
			"113": "<sup>113</sup> Sai * huhagigihon do angka simeoleol, jala huhaholongi patikmi.",
			"114": "<sup>114</sup> Pangondianku jala lombulombungku do Ho, sai hatami do na huhalungunhon.",
			"115": "<sup>115</sup> Sumurut ma sian ahu, hamu ale angka parjahat i, sai angka tona ni Debatangku do radotanku.",
			"116": "<sup>116</sup> Sai tiopi ahu hombar tu bagabagam, asa mangolu ahu, jala sai unang loas ahu tarurak mida na hinirim ni rohangku.",
			"117": "<sup>117</sup> Sai sande ma ahu, asa martua ahu, asa tongtong huhahilashon angka aturanmi.",
			"118": "<sup>118</sup> Diparhamuda roham do sude angka na manimbil sian angka aturanmi, ai gabus do sipaotooto binahennasida i.",
			"119": "<sup>119</sup> Disiaphon Ho do sude angka parjahat ni tano on, hira gubogubo, dibahen i huhaholongi do angka panindangionmi.",
			"120": "<sup>120</sup> Manindang do imbulungku panonditnonditon mida Ho, jala huhabiari do angka uhummi. XVI.",
			"121": "<sup>121</sup> Sai huulahon do uhum dohot hatigoran, sai unang loas ahu rupaon ni angka siulahon gogo mangalo ahu!",
			"122": "<sup>122</sup> Sai ondihon ma naposom tu na denggan, asa unang dirupa angka na jungkat roha i ahu.",
			"123": "<sup>123</sup> Pola do rambon angka matangku mangkalungunhon hatuaonmi dohot bagabaga ni hatigoranmi.",
			"124": "<sup>124</sup> Bahen ma tu naposom hombar tu asi ni roham, jala podahon tu ahu angka aturanmi.",
			"125": "<sup>125</sup> Naposom do ahu, sai parroha i ma ahu, asa huboto angka panindangionmi.",
			"126": "<sup>126</sup> Nunga jumpang tingki ni Jahowa painonahon uhum, ai nunga ditorbangi halak angka patikmi.",
			"127": "<sup>127</sup> Ala ni do umbahen na huhaholongi angka tonami lobi sian sere, tongon tahe lobi sian sere palangki.",
			"128": "<sup>128</sup> Ala ni do umbahen huparhatongon salulut angka parentam di saluhutna, sai huhagigihon do nasa lapang pangansion. XVII.",
			"129": "<sup>129</sup> Tung na sumurung do angka panindangionmi, ala ni do umbahen diradoti rohangku angka i.",
			"130": "<sup>130</sup> Pangungkapon di angka hatami do patiur parnidaan, marrohaihon angka na oto.",
			"131": "<sup>131</sup> Sai hupangangang do pamanganku jala marhoi, ai angka tonami do na huhauashon.",
			"132": "<sup>132</sup> Sai dompakkon ma ahu, jala asi ma roham di ahu, mangihuthon uhum tu angka na mangkaholongi goarmi.",
			"133": "<sup>133</sup> Sai * pahot ma langkalangkangku marhitehite bagabagam, jala unang loas dirajai manang hajahaton dia ahu!",
			"134": "<sup>134</sup> Sai palua ma ahu sian pangarupaon ni jolma, asa huradoti angka parentam!",
			"135": "<sup>135</sup> Sai bahen ma bohim marsinondang tu naposom, jala podahon tu ahu angka aturanmi.",
			"136": "<sup>136</sup> Sai mabakbak do ilu ni matangku hira pansur, ala so diradoti halak angka patikmi. XVIII.",
			"137": "<sup>137</sup> Nabonar do Ho, ale Jahowa, jala na tigor do angka uhummu.",
			"138": "<sup>138</sup> Nunga tung ditingtingkon Ho paboa hatigoran do angka panindangionmu jala hasintongan situtu.",
			"139": "<sup>139</sup> Ngaetan do ahu dibahen hajugulonki, ala dihalupahon angka alongku angka hatami.",
			"140": "<sup>140</sup> Na pinindan situtu do bagabagami, jadi holong roha ni naposom disi.",
			"141": "<sup>141</sup> Metmet pe ahu jala lea, ianggo angka parentam ndang dung huhalupahon.",
			"142": "<sup>142</sup> Hatigoran ro di salelenglelengna do hatigoranmu, jala hasintongan do patikmi.",
			"143": "<sup>143</sup> Songgop pe hagogotan dohot hasusaan tu ahu, ianggo angka tonami sai huhahilashon do.",
			"144": "<sup>144</sup> Sai hatigoran do angka panindangionmi ro di salelenglelengna, parroha i ahu, asa mangolu ahu. XIX.",
			"145": "<sup>145</sup> Sai joujou do ahu sian nasa roha, sai alusi ma ahu, ale Jahowa; sai radotanku do angka aturanmi.",
			"146": "<sup>146</sup> Sai joujou ahu tu Ho: Tumpahi ma ahu! Asa sai huradoti angka panindangionmi.",
			"147": "<sup>147</sup> Hujoloani do * buha siang ari asa maungaung, angka hatami do huhalungunhon.",
			"148": "<sup>148</sup> Dijoloani angka matangku do angka gansi borngin, naeng mamingkirmingkiri bagabagami.",
			"149": "<sup>149</sup> Sai tangihon ma soarangki hombar tu asi ni roham, sai pangolu ma ahu, ale Jahowa, hombar tu angka uhummi.",
			"150": "<sup>150</sup> Dumonokdonok do angka sieahi hajahaton, holang do nasida sian patikmi.",
			"151": "<sup>151</sup> Donok do Ho, ale Jahowa, jala * hasintongan do sude angka tonami.",
			"152": "<sup>152</sup> Tibu hian do huboto sian angka panindangionmi, paboa Ho paojakkon angka i ro di salelenglelengna. XX.",
			"153": "<sup>153</sup> Sai tatap ma pardangolankon, jala palua ahu, ai * ndang huhalupahon patikmi.",
			"154": "<sup>154</sup> Badahon ma parbadaanki, jala palua ahu, sai pangolu ma ahu ala ni bagabagami.",
			"155": "<sup>155</sup> Mandao do hatuaon sian angka parjahat, ai ndang dilului nasida angka aturanmi.",
			"156": "<sup>156</sup> Torop do angka asi ni roham, ale Jahowa, sai pangolu ma ahu hombar tu angka uhummi.",
			"157": "<sup>157</sup> Torop do angka silotongi dohot sisosak ahu, laos so manimbil do ahu sian angka panindangionmi.",
			"158": "<sup>158</sup> Huida angka parjehe, jadi gine ateatengku, ala so diradoti nasida bagabagami.",
			"159": "<sup>159</sup> Sai tatap ma, ai sai huhaholongi do angka parentam, ale Jahowa, sai pangolu ma ahu hombar tu asi ni roham.",
			"160": "<sup>160</sup> * Hasintongan do pangarimpunan ni hatam, jala ro di salelenglelengna do nasa uhum ni hatigoranmi. XXI.",
			"161": "<sup>161</sup> Dilotongi angka raja do ahu soada alana, alai holan * hatami do dihabiari rohangku.",
			"162": "<sup>162</sup> Marhilas ni roha do ahu ala ni bagabagami, songon halak na jumpangan godang taban.",
			"163": "<sup>163</sup> Huhagigihon jala huhabiashon do sipaotooto, huhaholongi do ianggo patikmi.",
			"164": "<sup>164</sup> Pitu hali di na sadari hupuji Ho, ala ni angka uhum ni hatigoranmi.",
			"165": "<sup>165</sup> Mardame situtu do angka na mangkaholongi patikmi, jala ndang adong partuktuhan di nasida.",
			"166": "<sup>166</sup> Sai huhalungunhon do hatuaonmi, ale Jahowa, jala huulahon angka tonami.",
			"167": "<sup>167</sup> Sai diradoti rohangku do angka panindangionmi, jala huhaholongi situtu angka i.",
			"168": "<sup>168</sup> Sai huradoti do angka parentam dohot panindangionmi, ai di jolom do saluhut angka dalanku. XXII.",
			"169": "<sup>169</sup> Sai loas ma alualungku dumonok tu bohim, ale Jahowa, sai parroha i ma ahu hombar tu hatam.",
			"170": "<sup>170</sup> Sai tolhas tujolo ni bohim ma angguhangguk i, sai palua ma ahu hombar tu bagabagam.",
			"171": "<sup>171</sup> Sai marbulakkon pujipujian ma angka bibirhu, ala dipodahon Ho angka aturanmi tu ahu.",
			"172": "<sup>172</sup> Sai * tariashonon ni dilangku do bagabagami, ai hatigoran do angka tonami saluhutna.",
			"173": "<sup>173</sup> Sai ditumpahi tanganmi ma ahu, ai nunga hupillit angka parentam.",
			"174": "<sup>174</sup> Sai dihalungunhon rohangku do hatuaonmi, ale Jahowa, jala patikmi do hasudungan ni rohangku.",
			"175": "<sup>175</sup> Sai mangolu ma tondingku, asa Ho dipuji, jala ditumpahi angka uhummu ma ahu!",
			"176": "<sup>176</sup> Nalilu do ahu, * songon birubiru na mago, sai lulu i ma naposom, ai ndang + huhalupahon angka tonami."
		},
		"120": {
			"1": "<sup>1</sup> Ende hananangkok. Tu Jahowa do ahu mangalualu di hagogotanki, jadi dialusi Ibana ahu.",
			"2": "<sup>2</sup> Ale Jahowa, sai palua ma tondingki sian bibir pangansion, sian dila siduatdait!",
			"3": "<sup>3</sup> Tung aha lehononna tu ho, jala tung aha dope ambaanna tu ho, ale dila siduatdait?",
			"4": "<sup>4</sup> Sumbia angka na tajom ni ulubalang angkup ni arang ni turituri.",
			"5": "<sup>5</sup> Soro ni aringki, tung maisolat ahu di Mesek halak parbada, tung maringan ahu di lambung undungundung ni Kedar! Panggetegete.",
			"6": "<sup>6</sup> Nunga malelengku nian rohangki maringanan di lambung ni angka na mangkasomorhon hadameon.",
			"7": "<sup>7</sup> Sai dame do ianggo ahu, alai molo mangkuling ahu, sai mamungka hamusuon do ianggo nasida."
		},
		"121": {
			"1": "<sup>1</sup> Ende hananangkok. Sai mangaranapi do matangku dompak angka dolok: Sian dia do ulaning ro pangurupion tu ahu?",
			"2": "<sup>2</sup> Sian Jahowa Sitompa langit dohot tano on sambing ro pangurupion ianggo tu ahu.",
			"3": "<sup>3</sup> Ndang tagamon loasonna tarsulandit patmu, ndang tagamon nok mata ni Sijaga ho.",
			"4": "<sup>4</sup> Ida ma, ndang olo nok mata, jala ndang olo modom ianggo Sijaga Israel.",
			"5": "<sup>5</sup> Jahowa do Sijaga ho, Jahowa do parlinggomanmu di lambung ni tanganmu siamun.",
			"6": "<sup>6</sup> Ndang tagamon doiton ni mata ni ari ho arian, manang bulan pe bornginna i.",
			"7": "<sup>7</sup> Sai jagaon ni Jahowa do ho sian nasa parmaraan, sai jagaonna do tondim.",
			"8": "<sup>8</sup> Sai jagaon ni Jahowa do ho laho ruar dohot laho bongot, olat ni on ro di salelenglelengna."
		},
		"122": {
			"1": "<sup>1</sup> Ende hananangkok sian si Daud. Las do rohangku di angka na mandok tu ahu: Beta hita manopot bagas ni Jahowa!",
			"2": "<sup>2</sup> Nunga jongjong patnami di angka bahalmi, ale Jerusalem!",
			"3": "<sup>3</sup> Ale Jerusalem, naung pinauli songon huta na tipak marrapitrapit gabe sada.",
			"4": "<sup>4</sup> Nangkok do tusi angka marga, angka marga ni Jahowa, bahen panindangion di Israel, laho mamuji goar ni Jahowa.",
			"5": "<sup>5</sup> Ai tusi do dipajongjong angka habangsa paruhuman, angka habangsa di pinompar ni si Daud.",
			"6": "<sup>6</sup> Sai pangido hamu ma * hadameon di Jerusalem, sai mardohar ma angka na mangkaholongi ho!",
			"7": "<sup>7</sup> Sai masa ma hadameon di bagasan parikmu, hasonangan ma di bagasan jabum angka na bolon!",
			"8": "<sup>8</sup> Ala ni angka hahaanggingku dohot alealengku sai dohononku do: Hadameon ma di bagasan ho.",
			"9": "<sup>9</sup> Ala ni bagas ni Jahowa, Debatanta i, sai * haringkothononku do nadenggan di ho."
		},
		"123": {
			"1": "<sup>1</sup> Ende hananangkok. Sai manatapnatap do matangku tu Ho, ale na marhabangsa di banua ginjang.",
			"2": "<sup>2</sup> Ida ma, songon mata ni angka anak somang tu tangan ni induk somangnasida, songon mata ni naposo boruboru tu tangan ni sorangannasida: Songon i do mangaranapi matanta tu Jahowa, Debatanta, paima asi rohana di hita.",
			"3": "<sup>3</sup> Sai asi ma roham di hami, ale Jahowa, sai asi ma tutu, ai nunga tung mahap situtu hami di pangareheon.",
			"4": "<sup>4</sup> Nunga tung mahap situtu rohanami dihaeleson ni angka na jungkat roha, di pangareheon ni angka na ginjang roha."
		},
		"124": {
			"1": "<sup>1</sup> Ende hananangkok sian si Daud. Aut unang Jahowa mandongani hita, sai i ma didok Israel.",
			"2": "<sup>2</sup> Aut unang Jahowa mandongani hita, uju hehe jolma mangalo hita:",
			"3": "<sup>3</sup> Sai * ngolungolu hita bondutonna, uju i di panombo ni rimasnasida dompak hita.",
			"4": "<sup>4</sup> Sai na aupon ni angka aek do hita uju i, sai na boluson ni batang aek i do tondinta.",
			"5": "<sup>5</sup> Sai na boluson ni angka aek na marhasahi do tongon tondinta uju i.",
			"6": "<sup>6</sup> Pinuji ma Jahowa, na so mangalehon hita sisoroon ni angka nginginasida i.",
			"7": "<sup>7</sup> Nunga malua tondinta i songon * pidong, na malua sian sambil ni parsambil, nunga matos sambil i, jadi malua hita.",
			"8": "<sup>8</sup> Ianggo pangurupion di hita di bagasan goar ni Jahowa, Sitompa langit dohot tano on do."
		},
		"125": {
			"1": "<sup>1</sup> Ende hananangkok. Angka na marhaposan tu Jahowa, songon dolok Sion do nasida, ndang tagamon humordit, hot do tahe ro di salelenglelengna.",
			"2": "<sup>2</sup> Angka dolok do ia humaliang Jerusalem, Jahowa do ianggo humaliang bangsona olat ni on ro di salelenglelengna.",
			"3": "<sup>3</sup> Ai ndang tagamon tong mandondon tungkot harajaon ni hajahaton di atas parjambaran ni angka partigor, asa unang laho tangan ni angka partigor i tu hageduhon.",
			"4": "<sup>4</sup> Sai bahen ma na denggan, ale Jahowa, tu angka na denggan roha i dohot tu angka sisangunjur marroha di bagasan.",
			"5": "<sup>5</sup> Alai anggo angka na manimbil tu dalannasida sandiri, angka na geduk i, sai na togihonon ni Jahowa do nasida rap dohot angka siula hajahaton. * Dame ma songgop ianggo tu Israel!"
		},
		"126": {
			"1": "<sup>1</sup> Ende hananangkok. Di na mulak tinogihon ni Jahowa angka * na tarbuang sian Sion, doshon halak na marnipi do hita.",
			"2": "<sup>2</sup> * Gok parengkelon ma uju i pamanganta, jala marolopolop dilanta, martaringot ma uju i di tongatonga ni angka parbegu: Godang ma na binahen ni Jahowa tu nasida!",
			"3": "<sup>3</sup> Godang ma tongon na binahen ni Jahowa tu hita, jadi marhilas ni roha ma hita.",
			"4": "<sup>4</sup> Sai togihon ma mulak, ale Jahowa, angka na tarbuang sian hami, songon angka sunge di tano tungkan dangsina.",
			"5": "<sup>5</sup> Angka na mariluilu laho manabur, marolopolop do sogot laho manggotil.",
			"6": "<sup>6</sup> Mardalandalan pe ibana huhut tangis pausungusung boni sisaburhononhon, ro do ibana sogot marolopolop mangusung angka tibalanna."
		},
		"127": {
			"1": "<sup>1</sup> Ende hananangkok sian si Salomo. Molo so Jahowa paulihon bagas, loja sambing do angka na mamandei; molo so Jahowa marhal huta i, ndang marniula hadudungo ni parhal.",
			"2": "<sup>2</sup> Ndang adong labamuna dipasogot hamu hehe, dipaleleng hamu muse laho hundul manganhon roti hangaluton, songon i modom dilehon Ibana tongon tu hasianna.",
			"3": "<sup>3</sup> Ida ma, pala ni Jahowa sambing do di anak, silehonlehonna do parbue ni bortian.",
			"4": "<sup>4</sup> Songon angka sumbia di tangan ni ulubalang, songon i do angka anak di haroro ni daging.",
			"5": "<sup>5</sup> Martua ma baoa na manggohi parnangkatanna sian nasida: Ndang tagamon tarurak nasida, molo marsiuaan nasida dohot angka musu di parjompahan."
		},
		"128": {
			"1": "<sup>1</sup> Ende hananangkok. Martua ma ganup na mangkabiari Jahowa, na marparange di angka dalanna i.",
			"2": "<sup>2</sup> Sai panganonmu do na niula ni tanganmu, martua ma ho jala sonang.",
			"3": "<sup>3</sup> Tudoshon hau anggur na marparbue do ianggo jolmam di bagasan angka bilut ni jabum, tudoshon tunas ni hau jetun do angka anakmu humaliang mejam.",
			"4": "<sup>4</sup> Ida ma, sai songon i do tongon dapotan pasupasu baoa, na mangkabiari Jahowa.",
			"5": "<sup>5</sup> Sai pasupasuon ni Jahowa ma ho sian Sion, asa paidaidaonmu hinadenggan ni Jerusalem ganup ari saleleng ho mangolu.",
			"6": "<sup>6</sup> Jala ingkon idaonmu do angka pahompum tubu ni anakmu. Hasonangan ma songgop tu Israel."
		},
		"129": {
			"1": "<sup>1</sup> Ende hananangkok. Jotjot situtu do disosak halak ahu sian sietehetehonku, i ma dohonon ni Israel nian.",
			"2": "<sup>2</sup> Jotjot situtu do tongon disosak halak ahu * sian sietehetehonku, hape ndang tarhahua nasida ahu.",
			"3": "<sup>3</sup> Maninggalai pola angka paninggala di atas tanggurungku, ganjang do dibahen angka barurannasida.",
			"4": "<sup>4</sup> Bonar do anggo Jahowa, nunga digotapi tali ni angka parjahat i.",
			"5": "<sup>5</sup> Ingkon tarurak nian jala sumurut tu pudi sude angka na mangkasomorhon Sion.",
			"6": "<sup>6</sup> Ingkon gabe doshon ri na tinaruphon nasida nian, ndang dope binutbut, nunga ape.",
			"7": "<sup>7</sup> Na so pola gohan ni panabi tanganna sian i, manang pola abingon ni panarui.",
			"8": "<sup>8</sup> Jala ndang pola dohonon ni angka pamolus: * Pasupasu ni Jahowa ma mandongani hamu! Hupasupasu hami ma hamu marhitehite goar ni Jahowa!"
		},
		"130": {
			"1": "<sup>1</sup> Ende hananangkok. * Sian pardangolan angka na bagas i do ahu joujou tu Ho, ale Jahowa!",
			"2": "<sup>2</sup> Ale Tuhan, sai tangihon ma soarangki, sai patinggil ma pinggolmu tumangi soara ni anggukkon!",
			"3": "<sup>3</sup> Molo tung manjujur Ho, ale Jahowa, di angka dosa, tung ise ma manahan jongjong, ale Tuhan?",
			"4": "<sup>4</sup> Alai tahe * marroha pamuation do Ho, asa dihabiari halak Ho.",
			"5": "<sup>5</sup> Huhalungunhon do Jahowa, malungun do tondingku, jala huparhanalom do hatana.",
			"6": "<sup>6</sup> Gumogo do dihalungunhon rohangku Tuhan i sian angka parhal di torang ni ari, angka parhal di torang ni ari tongon.",
			"7": "<sup>7</sup> Nalom ma roham tu Jahowa, ale Israel, ai parasi roha do Jahowa, jala godang do haluaon di Ibana.",
			"8": "<sup>8</sup> Jala Ibana sandiri paluahon Israel sogot sian dosana sudena."
		},
		"131": {
			"1": "<sup>1</sup> Ende hananangkok sian si Daud. Ale Jahowa, ndang ginjang rohangku, jala ndang buas angka matangku, jala ndang hupangalahohon ruhut hatimbulon angka na so tarjujung ahu.",
			"2": "<sup>2</sup> Tongon tahe nunga tung hupataem jala hupahohom rohangku songon dakdanak na sirang susu di lambung ni inana, songon dakdanak na sirang susu do rohangku di bagasan.",
			"3": "<sup>3</sup> Nalom ma roham, ale Israel tu Jahowa olat ni on sahat ro di salelenglelengna!"
		},
		"132": {
			"1": "<sup>1</sup> Ende hananangkok. I. Sai ingot ma, ale Jahowa, di si Daud sude angka parniahapanna!",
			"2": "<sup>2</sup> Na marmangmang i ibana tu Jahowa, marbagabagahon tu Sipargogoi Jakkob:",
			"3": "<sup>3</sup> Molo tung bongotanku undungundung ni bagashu, molo tung panaehonku podoman hapeahanku.",
			"4": "<sup>4</sup> Molo tung loasonku tarnono matangku manang tung podompodom bolak langkop ni matangku.",
			"5": "<sup>5</sup> Paima jumpang ahu sada ojahan di Jahowa, sada inganan di Sipargogoi Jakkob.",
			"6": "<sup>6</sup> Ida ma, nunga itabege barita ni poti parpadanan di Eprata, nunga jumpang hita di * ladang ni si Jaar.",
			"7": "<sup>7</sup> Antong itabongoti ma angka ingananna i, marsomba ma hita tu jolo ni sidegedegean ni totna!",
			"8": "<sup>8</sup> Hehe ma Ho, ale Jahowa, mandapothon paradiananmu, Ho dohot poti hamuliaonmu!",
			"9": "<sup>9</sup> Sai marpangkean hatigoran ma angka malimmi jala marolopolop angka na niasianmu.",
			"10": "<sup>10</sup> Ala ni si Daud, naposomi, unang tulakkon bohi ni na miniahanmu! II.",
			"11": "<sup>11</sup> Nunga pola * diuarihon Jahowa hasintongan tu si Daud, ndang tagamon ubaonna: Sian pinomparmi do pabangkitonku di ho nampuna habangsa i.",
			"12": "<sup>12</sup> Molo tung diradoti angka anakmu padan na hubahen i, dohot panindangionku na huajarhon tu nasida, anaknasida pe sai hundul do di habangsam ro di salelenglelengna.",
			"13": "<sup>13</sup> Ai nunga dipillit Jahowa Sion, dipangido rohana naeng maringanan disi.",
			"14": "<sup>14</sup> On do paradiananku ro di salelenglelengna, dison do Ahu naeng maringan, ai hasudungan ni rohangku do i.",
			"15": "<sup>15</sup> Sai pasupasuonku do bohalna i, pamahaponku do angka na pogosna i mangan roti.",
			"16": "<sup>16</sup> Jala bahenonku do angka malimna i marpangkean hatuaon, jala ingkon mariaia do angka na niasianna i.",
			"17": "<sup>17</sup> Patimbulonku ma disi sada * tanduk di si Daud, paradehon sada + palito di na miniahanku na miniahan.",
			"18": "<sup>18</sup> Bahenonku ma ianggo angka musuna * marulos haurahon, alai marlinanglinang ma ianggo di uluna tumpalna i."
		},
		"133": {
			"1": "<sup>1</sup> Ende hananangkok sian si Daud. Ida ma, dengganna i dohot sonangnai, molo tung pungu sahundulan angka na marhahamaranggi!",
			"2": "<sup>2</sup> Songon * miak na hushus di ulu pola mabaor tu mise, tu mise ni si Aron, pola mabaor sahat tu rambu ni angka ulosna.",
			"3": "<sup>3</sup> Songon nambur ni Hermon, na mabaor tu angka dolok Sion, ai disi do diparbaga Jahowa pasupasu, hangoluan sahat ro di salelenglelengna."
		},
		"134": {
			"1": "<sup>1</sup> Ende hananangkok. Ida ma, puji ma Jahowa, sude hamu ale naposo ni Jahowa, hamu ale angka na jongjong di bagas ni Jahowa ganup borngin.",
			"2": "<sup>2</sup> Paherbang hamu ma tanganmuna tu habadiaon, jala puji hamu ma Jahowa!",
			"3": "<sup>3</sup> Sai dipasupasu Jahowa, Sitompa langit dohot tano on, ma ho sian Sion!"
		},
		"135": {
			"1": "<sup>1</sup> I. Halleluya! Puji hamu ma goar ni Jahowa, mamujimuji ma hamu, ale naposo ni Jahowa!",
			"2": "<sup>2</sup> Hamu angka na jongjong di bagasan joro ni Jahowa, di angka alaman ni bagas ni Debatanta!",
			"3": "<sup>3</sup> Puji hamu ma Jahowa, ai pardengganbasa do Jahowa, endehon hamu ma goarna, ai hasudungan do Ibana.",
			"4": "<sup>4</sup> Ai nunga pola dipillit Jahowa si Jakkob di Ibana, nang Israel asa Ibana nampunasa.",
			"5": "<sup>5</sup> Ai anggo ahu tangkas do huboto, tung natimbul do Jahowa, jala Tuhanta i mangatasi sude angka Debata sileban.",
			"6": "<sup>6</sup> Nasa lomo ni rohana dipatupa Jahowa do di angka langit dohot di tano on, di bagasan angka laut ro di sude angka lung.",
			"7": "<sup>7</sup> Ibana do panaekkon angka ombun sian ujung ni tano on, gabe udan do angka hilapi dibahen, Ibana do paruarhon alogo sian angka parpeopanna.",
			"8": "<sup>8</sup> Ibana do mambunu angka buhabaju ni Misir, sian jolma ro di pinahan.",
			"9": "<sup>9</sup> Ibana manongos angka tanda dohot halongangan di parsitongaanmi, ale Misir, mangalo Firaun dohot sude angka naposona i.",
			"10": "<sup>10</sup> Ibana maniaphon torop angka bangso ni parbegu, jala dibunu raja angka na marhuaso:",
			"11": "<sup>11</sup> Si Sihon, raja ni halak Amori, dohot si Og, raja ni Basan ro di sude angka harajaon Kanaan.",
			"12": "<sup>12</sup> Dung i dilehon Ibana tanonasida bahen partalian, partalian ni Israel, bangsona i.",
			"13": "<sup>13</sup> Ale Jahowa, ro di salelenglelengna do goarmu, marsundutsundut do parningotanmu, ale Jahowa.",
			"14": "<sup>14</sup> Ai luluhonon ni Jahowa do sogot bangsona i, jala marpangulahi do sogot rohana mida angka naposona i. II.",
			"15": "<sup>15</sup> Ianggo angka ajiajian ni parbegu perak do jala sere, jadijadian ni tangan ni jolma.",
			"16": "<sup>16</sup> Marpamangan do nasida hape ndang mangkuling; marmata do nasida, hape ndang marnida.",
			"17": "<sup>17</sup> Marpinggol do nasida, hape ndang marbinege, huhut ndang adong hosa di bagasan pamangannasida.",
			"18": "<sup>18</sup> Sobokkon angka i do sogot jolma angka na jumadihonsa, sude angka na marhaposan tusi.",
			"19": "<sup>19</sup> Hamu ale pinompar ni Israel, puji hamu ma Jahowa; hamu ale pinompar ni si Aron, puji hamu ma Jahowa!",
			"20": "<sup>20</sup> Hamu ale pinompar ni si Lepi, puji hamu ma Jahowa! Hamu ale angka na mangkabiari Jahowa, puji hamu ma Jahowa!",
			"21": "<sup>21</sup> Pinuji ma Jahowa sian Sion, Ibana na maringanan di Jerusalem. Halleluya!"
		},
		"136": {
			"1": "<sup>1</sup> I. Mandok mauliate ma hamu tu Jahowa, ai pardengganbasa do Ibana, ai ro di salelenglelengna do asi ni rohana.",
			"2": "<sup>2</sup> Mandok mauliate ma hamu tu Debata, na mangatasi angka Debata sileban, ai ro di salelenglelengna do asi ni rohana.",
			"3": "<sup>3</sup> Mandok mauliate ma hamu tu Tuhan ni angka tuan, ai ro di salelenglelengna do asi ni rohana.",
			"4": "<sup>4</sup> Ibana sandiri jumadihon halongangan angka na bolon, ai ro di salelenglelengna do asi ni rohana.",
			"5": "<sup>5</sup> Ibana sandiri jumadihon angka langit marhitehite hapistaran, ai ro di salelenglelengna do asi ni rohana.",
			"6": "<sup>6</sup> Ibana sandiri paherbang tano on di atas ni angka aek, ai ro di salelenglelengna do asi ni rohana.",
			"7": "<sup>7</sup> Ibana sandiri jumadihon panondang angka na bolon, ai ro di salelenglelengna do asi ni rohana.",
			"8": "<sup>8</sup> Mata ni ari bahen pangguruan ni arian, ai ro di salelenglelengna do asi ni rohana.",
			"9": "<sup>9</sup> Bulan i dohot angka bintang bahen pangguruan ni borngin, ai ro di salelenglelengna do asi ni rohana. II.",
			"10": "<sup>10</sup> Ibana sandiri mambunu angka buhabaju ni Misir, ai ro di salelenglelengna do asi ni rohana.",
			"11": "<sup>11</sup> Jala diparuar Israel sian tongatonganasida, ai ro di salelenglelengna do asi ni rohana.",
			"12": "<sup>12</sup> Marhitehite tangan na gogo jala botohon na toltol, ai ro di salelenglelengna do asi ni rohana.",
			"13": "<sup>13</sup> Ibana naung umponggol laut pararungan i gabe dua bagian, ai ro di salelenglelengna do asi ni rohana.",
			"14": "<sup>14</sup> Jala dipataripar Israel sian tongatongana, ai ro di salelenglelengna do asi ni rohana.",
			"15": "<sup>15</sup> Jala dipangalonongkon Firaun dohot angka paranganna tubagasan laut pararungan i, ai ro di salelenglelengna do asi ni rohana.",
			"16": "<sup>16</sup> Ibana sandiri manogihon bangsona di halongonan, ai ro di salelenglelengna do asi ni roha.",
			"17": "<sup>17</sup> Ibana mambunu raja angka na bolon, ai ro di salelenglelengna do asi ni rohana.",
			"18": "<sup>18</sup> Jala diragehon raja angka na sangap, ai ro di salelenglelengna do asi ni rohana.",
			"19": "<sup>19</sup> Si Sihon i, raja ni halak Amori, ai ro di salelenglelengna do asi ni rohana.",
			"20": "<sup>20</sup> Dohot si Og, raja ni Basan, ai ro di salelenglelengna do asi ni rohana.",
			"21": "<sup>21</sup> Jala dilehon tanonasida bahen partalian, ai ro di salelenglelengna do asi ni rohana.",
			"22": "<sup>22</sup> Partalian ni halak Israel naposona i, ai ro di salelenglelengna do asi ni rohana.",
			"23": "<sup>23</sup> Ibana marningot hita di hajimputonta i, ai ro di salelenglelengna do asi ni rohana.",
			"24": "<sup>24</sup> Jala dirampas do hita sian angka alontai, ai ro di salelenglelengna do asi ni rohana.",
			"25": "<sup>25</sup> Ibana * mangalehon sipanganon tu nasa sibuk, ai ro di salelenglelengna do asi ni rohana.",
			"26": "<sup>26</sup> Mandok mauliate ma hamu tu Debata ni angka surgo, ai ro di salelenglelengna do asi ni roha."
		},
		"137": {
			"1": "<sup>1</sup> Di topi ni angka batang aek Babel, disi do hami hundul huhut tumatangis, molo huingot hami Sion.",
			"2": "<sup>2</sup> Tu hau ampolu, angka na di tongatonga nasida, hugantungkon hami angka hasapinami.",
			"3": "<sup>3</sup> Ai disi do didokkon angka na mambuangkon hami dohononnami angka hata ende, dohot angka na paporsukporsuk hami mandokkon hami marlas ni roha: Endehon hamu ma di hami sada ende sian Sion!",
			"4": "<sup>4</sup> Tung beha ma pangendehonnami di ende ni Jahowa di luat ni halak na pulik marga?",
			"5": "<sup>5</sup> Molo tung huhalupahon ho, ale Jerusalem, ingkon lupa tanganku siamun di ulaonna!",
			"6": "<sup>6</sup> Ingkon lohot ma dilangku di langitlangitna i, molo tung so huingot ho, molo tung so Jerusalem mangatasi saluhut las ni rohangku hubahen.",
			"7": "<sup>7</sup> Sai ingot ma ale Jahowa tu pinompar ni Edom ari hatataban ni Jerusalem, angka didok nasida uju i: Ingkon panepnep hamu ma ro di batu ojahanna i!",
			"8": "<sup>8</sup> Ho ale boru Babel, naung pinapatu, martua ma manang ise na mamaloshon tu ho pambahenmi tu hami!",
			"9": "<sup>9</sup> Martua ma manang ise na manoro posoposom baoa, jala dipangalotakkon tu dolok batu!"
		},
		"138": {
			"1": "<sup>1</sup> Ende sian si Daud. Mandok mauliate ma ahu tu Ho sian nasa rohangku, di jolo ni angka Debata paluonku parhinaloan umpuji Ho.",
			"2": "<sup>2</sup> Marsomba ma ahu mandompakkon jorom na badia i, jala pujionku ma goarmi ala ni asi ni roham dohot ala ni hasintonganmi, ai nunga dipabalga Ho bagabagam, tumindi nasa goarmu.",
			"3": "<sup>3</sup> Dialusi Ho do ahu di ari pangalualuanki, nunga dipapir Ho tondingku, gabe margogo rohangki.",
			"4": "<sup>4</sup> Sai mandok mauliate tu Ho do, ale Jahowa, sude angka raja ni tano on sogot ia dung dibege nasida angka bagabaga ni pamanganmu.",
			"5": "<sup>5</sup> Jala marende do nasida sogot mida angka dalan ni Jahowa, ai timbul do hamuliaon ni Jahowa.",
			"6": "<sup>6</sup> Ai timbul do tongon Jahowa, jala ditatap do na serep roha i, jala ditanda do sian na dao na ginjang roha i.",
			"7": "<sup>7</sup> Molo mardalandalan ahu di parsitongaan ni hagogotan, dipangolu Ho do ahu, diondingkon Ho do tanganmu dompak muruk ni angka musungku, jala ditumpahi siamunmi do ahu.",
			"8": "<sup>8</sup> Sai paujungon ni * Jahowa do mangondihon ahu, ale Jahowa ro di salelenglelengna do asi ni roham, unang tadingkon jadijadian ni tanganmu."
		},
		"139": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Ale Jahowa, disulingkit jala ditanda Ho do ahu!",
			"2": "<sup>2</sup> Sai diboto Ho do manang na hundul manang na jongjong ahu, gari sian na dao * diantusi Ho do pingkiranku.",
			"3": "<sup>3</sup> Manang mardalandalan manang modom ahu, disege Ho do ahu, jala tangkas do diboto Ho angka dalanku sudena.",
			"4": "<sup>4</sup> Ai ndang adong nanggo sada hata di atas dilangku, tongon do ale Jahowa, diboto Ho do sudena i.",
			"5": "<sup>5</sup> Tole sian pudi tole sian jolo dihaliangi Ho do ahu, jala dilinggom tanganmu do ahu.",
			"6": "<sup>6</sup> Tung masurungku do parbinotoan sisongon i di ahu, matimbohu do, ndang hadongdongan ahu.",
			"7": "<sup>7</sup> Tung tudia ma tarbahen ahu laho maradophon tondim, jala tung tudia ma tarbahen ahu maporus maradophon bohim?",
			"8": "<sup>8</sup> Tung sura * manaek ahu tu banua ginjang, disi do Ho, jala tung sura hubahen banua toru podomanku, ida ma disi do Ho.",
			"9": "<sup>9</sup> Tung sura manginjam ahu di angka habong ni buha siang ari, laho * songgop nian tu bariba ni laut.",
			"10": "<sup>10</sup> Nang disi sai toguon ni tanganmu do ahu, jala tiopon ni siamunmu ahu.",
			"11": "<sup>11</sup> Jala tung sura hudok: * Haholomon sambing ma manghungkupi ahu, jadi hatiuron do borngin i humaliang ahu.",
			"12": "<sup>12</sup> Haholomoni pe, ndang mangkolom ianggo di jolom, jala marsinondang do borngin songon arian, songon hatiuron i suang songon i haholomon marimpotimpot.",
			"13": "<sup>13</sup> Ai Ho do na manompa angka piangku, ditonun Ho do ahu di bagasan bortian ni dainang.",
			"14": "<sup>14</sup> Mandok mauliate ma ahu tu Ho ala ni * surung ni pambahenmu di ahu, na sumurung do angka jadijadianmu, jala tangkas situtu do i ditanda rohangku.",
			"15": "<sup>15</sup> Nda tung buni holiholingku di jolom, uju na tarjadi ahu di * sihabunian, uju na tarsirat ahu di dalam laut.",
			"16": "<sup>16</sup> Di hurungan manuk ahu, nunga diida angka matam, jala nunga tarsurat tu pustaham sasudena i, nunga binuhul hian * angka ariaringku, uju so adong dope nanggo sada. II.",
			"17": "<sup>17</sup> Dibahen i mansai arga situtu do angka * pingkiranmu di ahu, ale Debata, jala mansai torop do bilanganna.",
			"18": "<sup>18</sup> Tung sura naeng rajumanku, * tumorop do nasida sian horsik; molo + ngot ahu, tong dope ahu di lambungmi.",
			"19": "<sup>19</sup> Aut dibunu Ho ma nian parjahat i, ale Debata, jala hamu ale angka baoa sisopsop mudar, pasurut hamu ma sian ahu!",
			"20": "<sup>20</sup> Nasida angka na manaringoti Ho mambahen sireheon, marsineang do angka alom mandok goarmu.",
			"21": "<sup>21</sup> Tung so hagigihononku ma, ale Jahowa, angka na mangkagigihon Ho, tung so marbiasbias ahu mida angka na hehe mangalo Ho?",
			"22": "<sup>22</sup> Tung na sun do gigi ni rohangku di nasida, jadi musungku do nasida.",
			"23": "<sup>23</sup> Sulingkit ma ahu, ale Debata, jala tanda rohangki, uji ma ahu jala tanda angka pingkiranki.",
			"24": "<sup>24</sup> Jala ida, manang tung adong lapang haporsuhon di bagasan ahu, jala togu ahu di dalan salelenglelengna."
		},
		"140": {
			"1": "<sup>1</sup> Ende sian si Daud.",
			"2": "<sup>2</sup> Sai palua ma ahu, ale Jahowa, sian jolma parjahat i, sai ramoti ahu sian baoa siulahon jorjor!",
			"3": "<sup>3</sup> Angka na umpingkiri hajahaton di bagasan rohana, angka na patubitubi hamusuon ganup ari.",
			"4": "<sup>4</sup> Sai ditansiri nasida do dilanasida, songon ulok, * bisa ni ulok dari do di toru ni bibirnasida. Sela!",
			"5": "<sup>5</sup> Sai ramoti ma ahu, ale Jahowa, maradophon angka tangan ni parjahat i, maradophon baoa siulahon jorjor, angka na mamingkiri mambahen tarsulandit pathu.",
			"6": "<sup>6</sup> Marsibuni do angka na ginjang roha manaon aring dompak ahu dohot angka jorgong, nunga dipahirtang nasida angka * rambang di pinggol ni dalan, nunga pola ditaon nasida angka bostang padapot ahu. Sela!",
			"7": "<sup>7</sup> Jadi ningku ma tu Jahowa: * Debatangku do Ho, sai pinggol ma, ale Jahowa, soara ni angguhanggukkon!",
			"8": "<sup>8</sup> Jahowa, Tuhanki do partanobatoan ni hatuaonku, nunga diondingi Ho ulungku di ari hatongtangan.",
			"9": "<sup>9</sup> Sai unang lehon, ale Jahowa, pinangido ni parjahat i, sai unang tulus sangkapna i, lam tu ginjangna roha nasida maon. Sela!",
			"10": "<sup>10</sup> Sai pate tu ulu ni angka na mangonsongi ahu ma hajahaton ni bibirnasida i!",
			"11": "<sup>11</sup> Diambalangkon Ibana ma nian tu nasida angka gara, tubagasan api ma nian nasida didabuhon, tubagasan angka lung, unang tarbahen nasida be hehe.",
			"12": "<sup>12</sup> Sai unang ma hot baoa pardila siduatdait di tano on, sai dilotongi hinamago ma baoa siulahon jorjor patompu mago.",
			"13": "<sup>13</sup> Tangkas do huboto, sai na maruli uhum do na dangol dohot angka na pogos bahenon ni Jahowa.",
			"14": "<sup>14</sup> Tongon do, sai pujion ni angka partigor i do goarmu sogot, sai mian di jolo ni bohim do angka na unjur roha."
		},
		"141": {
			"1": "<sup>1</sup> Ende sian si Daud. Ale Jahowa, Ho do na hupajoujou, halaputi ma mandapothon ahu, sai tangi ma soarangki, molo joujou ahu tu Ho!",
			"2": "<sup>2</sup> Sai martimpul ma tangiangku bahen * daupa di jolom, panindang ni tanganku bahen + pelean sipanganon bodari.",
			"3": "<sup>3</sup> Sai bahen ma siramoti pamanganku, ale Jahowa, sai jagai ma pintu ni angka bibirhu!",
			"4": "<sup>4</sup> Unang loas rohangku manimbil * paihuthon parkaro na jat, laho marpangalahohon angka pambahenan di hajahaton rap dohot baoa angka siulahon hajahaton, jala unang tung mangapian ahu naeng mandai panganon pangomoannasida i.",
			"5": "<sup>5</sup> Denggan tahe * dilinsingi partigor i ahu, asi ni roha do i, diajar pe ahu, miak tu ulu do i, sai unang ma diupirhon ulungku antong, ai tong do tangiangki alo ni hajahatonnasida i.",
			"6": "<sup>6</sup> Ditunggalingkon do angka panguhumnasida tu dorpi ni batu hopit, jadi nunga dibege nasida hatangku angka na dampor i.",
			"7": "<sup>7</sup> Songon paninggala na mamunggari tano i, angka maraburan holiholinta ro di baba ni banua toru.",
			"8": "<sup>8</sup> Ai tu Ho do, ale Jahowa, Tuhanku, manaili matangku, marhaposan tu Ho do ahu: Unang tung durushon hosangki!",
			"9": "<sup>9</sup> Sai ramoti ma ahu sian angka mata ni jorgong, na tinaonnasida padapot ahu, dohot sian angka rambang ni angka siulahon hajahaton!",
			"10": "<sup>10</sup> Sai madabu ma angka parjahat i tubagasan jorgongna be, malua boti ma ianggo ahu."
		},
		"142": {
			"1": "<sup>1</sup> Tangiang sipodaon sian si Daud, uju di bagasan liang ibana.",
			"2": "<sup>2</sup> Mangangguk badar ahu joujou tu Jahowa, marhuraja do soarangku tu Jahowa.",
			"3": "<sup>3</sup> Hupangusehon do alualungku tu jolona, hupabotohon hagogotanki tu jolona.",
			"4": "<sup>4</sup> Molo * holom parnidaan ni tondingki di bagasan, sai diboto Ho langkalangkangku; + marsibuni nasida manaon jorgong di dalan sibolunsonku, padapot ahu nian.",
			"5": "<sup>5</sup> Tailihon ma dompak siamun jala ida, hape ndang adong na maralealehon ahu, polpol do haporusanku, ndang adong na marhamaol hosangki.",
			"6": "<sup>6</sup> Mangangguhi tu Ho do ahu, ale Jahowa, ningku do: Ho do haporusanku, parjambaranku di * tano hangoluan on.",
			"7": "<sup>7</sup> Sai parateatehon ma angguk i, ai maras situtu do huhilala, sai * palua ma ahu sian angka na mangalotongi ahu, ai gumogo do nasida sian ahu.",
			"8": "<sup>8</sup> Sai * paruar ma tondingki sian hurungan, asa hupuji goarmu. Marrongoman do sogot marpungu tu ahu angka partigor i, ala binahenmi na denggan i tu ahu."
		},
		"143": {
			"1": "<sup>1</sup> Ende sian si Daud. Ale Jahowa, sai tangihon ma tangiangki, patinggil pinggolmu umbege anggukkon, sai alusi ma ahu di bagasan habonaronmu, hombar tu hatigoranmu.",
			"2": "<sup>2</sup> Jala unang tung boan naposom tu paruhuman, ai ndang adong na tigor roha manang ise, na mangolu maradophon bohim.",
			"3": "<sup>3</sup> Ai sai diburu musu i do tondingki, tung didegehon do ngolungku tu tano, tung dipahundul do ahu tubagasan haholomon marimpotimpot, songon halak naung laon mate.",
			"4": "<sup>4</sup> Jala naung mandate do tondingku di bagasan ahu, naung malampot do rohangku di bagasan.",
			"5": "<sup>5</sup> Sai * hupaingotingot do angka ari na robi, sai mamingkiri do ahu di angka pambahenanmu sudena, sai manimbangi do rohangku di angka jadijadian ni tanganmu.",
			"6": "<sup>6</sup> Sai hupaherbang do tanganku tu Ho, songon tano na so maraek do pangkalungunhon ni * tondingku tu Ho. Sela!",
			"7": "<sup>7</sup> Hapogani ma mangalusi ahu, ale Jahowa, naeng mandate tondingku: Unang tung tabunihon bohim maradophon ahu, asa unang tung doshon angka na manuruk tanoman ahu.",
			"8": "<sup>8</sup> Sai patubegehon ma tu ahu manogotna i asi ni roham, ai marhaposan tu Ho do ahu. Sai pabotohon ma tu ahu dalan sidalananku, ai sai tu Ho do tinuju ni rohangku.",
			"9": "<sup>9</sup> Sai palua ma ahu sian angka musungku, ale Jahowa! Tu Ho do ahu martanobato.",
			"10": "<sup>10</sup> Sai ajari ma ahu mangulahon lomo ni roham, ai Ho do Debatangku, tondim na denggan i ma manogihon ahu di tano na hornop!",
			"11": "<sup>11</sup> Ala ni goarmu, ale Jahowa, sai * pangolu ma ahu, paruar ma tondingku sian parmaraan marhitehite hatigoranmu!",
			"12": "<sup>12</sup> Jala dibahen asi ni roham, sai siaphon ma angka musungku, jala rendephon sude angka na manosak tondingki, ai naposom do ahu."
		},
		"144": {
			"1": "<sup>1</sup> Ende sian si Daud. I. Pinuji ma Jahowa, partanobatoanki, na * mangajari tanganku marporang, angka jarijaringku mangulahon hamusuon.",
			"2": "<sup>2</sup> Parasiroha di ahu jala partanobatoanku, haporusanku dohot sipalua ahu, lombulombungku, jala marhaporusan tu Ibana do ahu, Ibana patundukkon bangsongku, asa guru di ahu.",
			"3": "<sup>3</sup> Ale Jahowa, tung aha ma nian jolma, umbahen pola ditanda Ho ibana? Anak ni jolma na gale, umbahen pola diparhamaol Ho ibana?",
			"4": "<sup>4</sup> Tudos tu hosa sambing do jolma i, songon * halinu na mamolus do angka ariarina i.",
			"5": "<sup>5</sup> Ale Jahowa, sai * pajomba ma angka langitmi, jala tuat ma Ho, sai + jama angka dolok asa martimus nasida!",
			"6": "<sup>6</sup> Sai hilaphon ma hilapi jala paserak nasida, asi siorhon ma angka sumbiam, asa guntur nasida!",
			"7": "<sup>7</sup> Sai surdukkon ma tanganmu sian banua ginjang, sai enet jala palua ma ahu sian angka aek magodang, sian tangan ni angka anak na pulik marga.",
			"8": "<sup>8</sup> Angka parpamangan na mangkatahon na so marniula, jala siamun pangansion do siamunnasida i. II.",
			"9": "<sup>9</sup> Ale Debata, ende na imbaru ma endehononku di Ho, mardongan hasapi sisampulutali mamuji Ho.",
			"10": "<sup>10</sup> Ho do na mangalehon tua tu angka raja, paluahon naposom si Daud sian goluk hamagoan.",
			"11": "<sup>11</sup> Sai rampasi jala, palua ma ahu sian tangan ni angka anak na pulik marga, * parpamangan angka na mangkatahon na so gabeak, jala siamun pangansi do siamunnasida i!",
			"12": "<sup>12</sup> Ala simbur magodang angka anaknami di hadanakonna songon * suansuanan, ia borunami songon tiang na nirungkungan mangihuthon parruhuton ni bagas bolon.",
			"13": "<sup>13</sup> Angka soponami gok do, ripe alapan sian i bohal ragamragam; ia birubirunami sinur ganda marriburibu jala marloksaloksa di alamannami.",
			"14": "<sup>14</sup> Marlambe do angka lombunami, soada na tumbason, jala soada na tarposo, jala ndang adong angguhangguk di alamannami.",
			"15": "<sup>15</sup> Martua ma bangso na songon i maruntung, martua ma bangso na mardebatahon Jahowa!"
		},
		"145": {
			"1": "<sup>1</sup> Ende pujipujian sian si Daud. Patimbulonku ma Ho, ale Debatangku, Ho ale Raja, jala pujionku ma goarmu ro di salelenglelengna.",
			"2": "<sup>2</sup> Ganup ari do pujionku Ho, jala pasangaponku goarmu ro di salelenglelengna.",
			"3": "<sup>3</sup> Timbul do Jahowa, jala sipujion situtu, tung na so hadodoan do hatimbulonna i.",
			"4": "<sup>4</sup> Sai na masitonaan do angka sundut papujipuji angka jadijadianmu jala masipaboaan do nasida di hagogoonmu angka na sumurung i.",
			"5": "<sup>5</sup> Sai papingkirpingkironku do hinauli ni hamuliaonmu na sangap i, dohot angka barita ni halongangan angka na binahenmu.",
			"6": "<sup>6</sup> Jala ingkon paboaboaon do hagogoon ni halongangan angka na binahenmi, jala pajojoronku do angka hatimbulonmu.",
			"7": "<sup>7</sup> Ingkon doras do pararaton parningotan ni denggan ni basam na godang i, jala marolopolop nasida mida hatigoranmi.",
			"8": "<sup>8</sup> Partalup jala parasiroha do Jahowa, lambas do Ibana tarrimas jala pardengganbasa bolon.",
			"9": "<sup>9</sup> Pardengganbasa do Jahowa di saluhutna, jala dilinggom asi ni rohana do jadijadianna sudena.",
			"10": "<sup>10</sup> Mandok mauliate ma sude jadijadianmu tu Ho, ale Jahowa, jala dipuji angka na niasianmu do Ho.",
			"11": "<sup>11</sup> Dibaritahon nasida do hamuliaon ni harajaonmu, jala diparhatopot nasida hagogoonmu na sumurung i.",
			"12": "<sup>12</sup> Laho pabotohon tu jolma manisia angka hagogoonna i, dohot hamuliaon ni harajaonna na sangap i.",
			"13": "<sup>13</sup> Harajaon ro di sude angka saleleng ni lelengna do harajaonmu, jala panggomgomionmu ro di sude angka sundut.",
			"14": "<sup>14</sup> Jahowa do situngkol sude angka na naeng tinggang, jala * sipahehe sude angka na tungki marroha.",
			"15": "<sup>15</sup> Mangaranap tu Ho do angka mata ni sasudena, jadi dilehon Ho tu nasida sipanganonnasida di tingkina be.",
			"16": "<sup>16</sup> Dibungka Ho do tanganmu pasombu lomo ni roha ni nasa na mangolu.",
			"17": "<sup>17</sup> * Nabonar do Jahowa di saluhut angka dalanna jala basa di bagasan saluhut jadijadianna i.",
			"18": "<sup>18</sup> Donok do Jahowa di sude angka na manjou Ibana, tongon tahe di sude angka na manjou Ibana di bagasan hasintongan.",
			"19": "<sup>19</sup> Ibana mambahen lomo ni roha ni angka na mangkabiari Ibana, jala dibege do angguknasida i, jala dipalua do nasida.",
			"20": "<sup>20</sup> Jahowa do pangondingan ni sude angka na mangkaholongi Ibana, jala disiaphon do sude angka parjahat.",
			"21": "<sup>21</sup> Ingkon baritahonon ni pamanganku do pujipujian di Jahowa, jala nasa sibuk mamuji goarna na badia i ro di salelenglelengna."
		},
		"146": {
			"1": "<sup>1</sup> Halleluya! Ale tondingku, puji ma Jahowa!",
			"2": "<sup>2</sup> Pujionku ma Jahowa saleleng ahu mangolu, sai endehononku do Debatangku saleleng adong dope ahu.",
			"3": "<sup>3</sup> Unang marhaposan hamu tu angka pangarajai, tu anak ni jolma, na so umpeop panumpahion di bagasan ibana.",
			"4": "<sup>4</sup> Ia ruar sogot * tondina i, mulak ma ibana tu tanona, di ari na sasada i pesan ma sude angka sangkapsangkapna i.",
			"5": "<sup>5</sup> Martua ma manang ise, na mambahen Debata ni si Jakkob pangurupina, marpangkirimon ibana di Jahowa Debatana!",
			"6": "<sup>6</sup> Sitompa langit dohot tano on dohot laut ro di isina sudena, Siingot hasintongan ro di salelenglelengna.",
			"7": "<sup>7</sup> Sipatingkos uhum tu angka na nirupa, Silehon sipanganon tu angka na male. Jahowa mangkarhari angka na tarrante.",
			"8": "<sup>8</sup> Jahowa patonggor mata ni angka na mapitung, Jahowa pahehe angka na * tungki, Jahowa mangkaholongi angka partigor.",
			"9": "<sup>9</sup> Jahowa mangaramoti * halak na buro, Ibana + margogoihon angka na sopot so marama so marina dohot angka na mabalu, jala dipalipe ianggo dalan ni angka parjahat.",
			"10": "<sup>10</sup> Jahowa do raja ro di salelenglelengna, Debatami, ale Sion, marsundutsundut do Halleluya!"
		},
		"147": {
			"1": "<sup>1</sup> I. Halleluya! Ai denggan do endehononhon Debatanta, ai hasudungan do Ibana tama papujipujion.",
			"2": "<sup>2</sup> Jahowa do na pauli Jerusalem, Ibana na papunguhon halak Israel angka na mampar i.",
			"3": "<sup>3</sup> Ibana pasabam angka parroha bojok, jala dililiti angka bugangnasida i.",
			"4": "<sup>4</sup> Ibana umbilang torop ni angka bintang, dijou do goarnasida sudena.",
			"5": "<sup>5</sup> Timbul do Tuhanta i jala pargogo situtu, ndang habilangan parbinotoannai.",
			"6": "<sup>6</sup> Jahowa pahehehon angka na nirupa, dipatungki tu tano ianggo angka parjahat i.",
			"7": "<sup>7</sup> Marende taripar ma hamu umpuji Jahowa marhitehite hamauliateon, palu hamu ma uninguningan mamuji Debatanta!",
			"8": "<sup>8</sup> Ibana manghungkupi langit i marhitehite ombun, Ibana paradehon udan tu tano on, Ibana patumbur duhutduhut di angka dolok.",
			"9": "<sup>9</sup> Ibana mangalehon tu pinahan gagatonnasida, nang tu angka * anak ni pidong sigak, angka na ngoakngoak.",
			"10": "<sup>10</sup> Ndang lomo rohana mida hagogoon ni hoda, ndang lomo rohana mida haehae ni baoa.",
			"11": "<sup>11</sup> Dihalomohon roha ni Jahowa do tahe angka na mangkabiari Ibana, angka na mangkalungunhon asi ni rohana i. II.",
			"12": "<sup>12</sup> Puji ma Jahowa, ale Jerusalem, puji ma Debata, ale Sion!",
			"13": "<sup>13</sup> Ai Ibana patogu angka ransang ni pargumbanganmu, Ibana mamasumasu angka anakmu di parsitongaanmi.",
			"14": "<sup>14</sup> Ibana mambahen marhademahon parbalohanmu, * dipamahap do ho dohot eme na marmiak.",
			"15": "<sup>15</sup> Ibana manongos bagabagana tu tano on, mansai doras marlojong hatana i.",
			"16": "<sup>16</sup> Ibana na mangalehon ambolas songon imput ni birubiru, disaburhon do nambur songon sirabun.",
			"17": "<sup>17</sup> Ibana maninggangkon ambolasna martanggotanggo; tung ise ma manahan jongjong maradophon ngalina?",
			"18": "<sup>18</sup> Ibana manongos hatana, gabe malala angka i, dipaborhat anginna, mabaor ma angka aek.",
			"19": "<sup>19</sup> Ibana mamaritahon hatana tu si Jakkob, angka patikna dohot uhumna tu Israel.",
			"20": "<sup>20</sup> Ndang dung dibahen songon i ianggo tu manang ise bangso parbegu, jala ndang diboto nasida angka uhumna. Halleluya!"
		},
		"148": {
			"1": "<sup>1</sup> Halleluya! Puji ma Jahowa, hamu ale angka sian banua ginjang, puji hamu Ibana di angka banua ginjang!",
			"2": "<sup>2</sup> Puji Ibana, sude hamu ale angka surusuruanna, puji Ibana, sude hamu ale angka paranganna!",
			"3": "<sup>3</sup> Puji Ibana, ho ale mata ni ari dohot bulan, puji Ibana, sude hamu ale bintang angka na marsinondang i!",
			"4": "<sup>4</sup> Puji Ibana, hamu ale angka langit ni langitan dohot hamu ale aek angka na di atas ni langit!",
			"5": "<sup>5</sup> Ingkon pujionnasida ma goar ni Jahowa, ai mandokkon Ibana, jadi tartompa ma nasida.",
			"6": "<sup>6</sup> Jala Ibana * pahot angka nasida ro di salelenglelengna, dibahen do sada aturan jala ndang halaosansa.",
			"7": "<sup>7</sup> Puji ma Jahowa, hamu ale angka sian tano on, angka binatang ni laut ro di sude angka lung!",
			"8": "<sup>8</sup> Ho ale api dohot ambolas ro di timus, habahaba, na pasauthon hatana i.",
			"9": "<sup>9</sup> Hamu ale angka dolok dohot sude angka robean, hamu ale hau angka na marparbue ro di sude hau Ares.",
			"10": "<sup>10</sup> Ho ale binatang dohot sude pahanpahanan, angka gulomit ro di angka pidong na marhabong.",
			"11": "<sup>11</sup> Hamu ale angka raja ni tano on dohot sude angka bangso, hamu ale angka pangarajai ro di sude angka panguhum ni tano on.",
			"12": "<sup>12</sup> Hamu ale angka dolidoli dohot namarbaju pe, hamu ale angka natuatua rap dohot angka na bajar.",
			"13": "<sup>13</sup> Ingkon pujionnasida ma goar ni Jahowa, ai sasada goarna i do na timbul, diatasi hamuliaonna i do tano on dohot angka langit!",
			"14": "<sup>14</sup> Jala Ibana patimbul sada * tanduk di bangsona i, bahen pujipujian di sude angka na niasianna, di angka anak ni Israel, bangso hasolhotonna i. Halleluya!"
		},
		"149": {
			"1": "<sup>1</sup> Halleluya. Endehon hamu ma * di Jahowa sada ende na imbaru, pujipujianna di bagasan luhutan ni angka na niasian!",
			"2": "<sup>2</sup> Marlas ni roha ma Israel mida * Sitompa ibana, marolopolop ma angka anak ni Sion mida + rajanasida i!",
			"3": "<sup>3</sup> Ingkon pujionnasida ma goarna marhaliang arbap, mardongan sordam dohot sarune pujionnasida Ibana!",
			"4": "<sup>4</sup> Ai lomo do roha ni Jahowa mida bangsona, dipahei do angka na dangol marhitehite hatuaon.",
			"5": "<sup>5</sup> Marolopolop ma sogot angka na niasian di bagasan hamuliaon, mariaia ma nasida di atas podomannasida i.",
			"6": "<sup>6</sup> Angka ende hatimbulon ni Debata do di bagasan aruarunasida, jala podang sidua baba do di tangannasida.",
			"7": "<sup>7</sup> Laho patupahon partubolon tu angka parbegu, angka paminsangon tu angka bangso.",
			"8": "<sup>8</sup> Laho tarihot angka rajanasida dohot rante, jala angka na sangap sian nasida dohot angka bostang bosi.",
			"9": "<sup>9</sup> Asa pasonggophon tu nasida uhum na tarsurat i. Hamuliaon ma i di sude angka na niasianna. Halleluya!"
		},
		"150": {
			"1": "<sup>1</sup> Halleluya! Puji hamu ma Debata di bagasan habadiaonna i, puji hamu ma ibana di hajanghajang ni hagogoonna i!",
			"2": "<sup>2</sup> Puji hamu ma Ibana ala hagogoonna, angka na sumurung i, puji hamu ma Ibana, hombar tu hinagodang ni hatimbulonna.",
			"3": "<sup>3</sup> Puji hamu ma Ibana mardongan soara ni sarune, puji hamu ma Ibana mardongan arbap dohot sordam.",
			"4": "<sup>4</sup> Puji hamu ma Ibana mardongan tali sajak dohot panontoron na marliat, puji hamu ma Ibana mardongan hasapi dohot tulila!",
			"5": "<sup>5</sup> Puji hamu ma Ibana mardongan ogung panggora, puji hamu ma Ibana mardongan ogung panonggahi!",
			"6": "<sup>6</sup> Sude na marhosa ingkon mamuji Jahowa! Halleluya."
		}
	}
};
